BEGIN
DECLARE max_follower INT(11) DEFAULT f_get_max_follower(iuser_id);
DECLARE max_post INT(11) DEFAULT f_get_max_post(iuser_id);
DECLARE max_like DECIMAL(10,4) DEFAULT f_get_max_like(iuser_id);
DECLARE max_response DECIMAL(10,4) DEFAULT f_get_max_response(iuser_id);

