VALUES
	(1,'aniesbaswedan','https://instagram.com/p/B5XVKFmAsw-',3888593,100651,'Menerima teman-teman pengemudi angkutan perkotaan (angkot) KWK Jakarta Utara di Pendopo Balaikota siang tadi.⁣\n⁣\nMereka datang menyampaikan aspirasi agar program Pemprov DKI untuk integrasi transportasi umum massal JakLingko diteruskan dan diperluas khususnya di Jakarta Utara.⁣\n⁣\nKami senang dengan kedatangan teman-teman hari ini, berarti program Jaklingko ini yang kita rancang untuk memfasilitasi kepentingan umum bisa menggunakan kendaraan umum dari mana saja yang terintegrasi itu sejalan dengan kepentingan pengemudi dan perusahaan, karena itu mereka ingin bergabung.⁣\n⁣\nOperator angkot merasa diuntungkan, publik juga diuntungkan, jadi ini merupakan contoh bagaimana integrasi bukan hanya aspek transportasinya tapi bisnis modelnya adalah bisnis model yang tidak merugikan bagi operator.⁣\n⁣\nKita berharap para operator bisa merawat kendaraan dengan baik, melakukan update kendaraan secara berkala, kualitas pelayanan baik karena mereka akan berada di dalam sistem JakLingko yang saling menguntungkan.⁣\n⁣\nKami senang dan mudah-mudahan harapan teman-teman bisa segera terlaksana, sebagian armada memang belum bisa bergabung di 2019 karena anggarannya belum cukup tapi insyaAllah di tahun 2020 semua bisa terlibat.⁣\n⁣\n#JakLingko⁣\n#integrasi⁣\n#transportasi⁣\n#KWK⁣\n#angkot','2019-11-27 16:53:07',4,0,0,0,'2019-11-28 19:04:33','2019-11-28 19:04:33'),
	(2,'aniesbaswedan','https://instagram.com/p/B5RVgVNgwb-',3888593,136556,'Berjalan kaki di gang ini bisa menjadi lebih pintar. :)⁣\n⁣\nMural edukasi ini karya anak-anak muda di Pademangan Timur. Dengan dukungan Kelurahan mereka memperindah tembok-tembok Gang 22 dan Gang 33 di kawasan Jalan Pademangan 2 RT 13 RW 003, Jakarta Utara.⁣\n⁣\nMuralnya bukan sekadar gambar indah/ kata-kata mutiara, tapi materi ilmu pengetahuan dan pelajaran sekolah. Dihadirkan sebagai sarana edukasi bagi warga, khususnya pelajar SDN Pademangan Timur 01 yang sering melewati gang tersebut.⁣\n⁣\nWarga pun bisa menciptakan iklim pembelajaran menyenangkan, cinta ilmu pengetahuan.⁣\n⁣\nAda gang yang menarik seperti ini di lingkungan teman-teman? ⁣\n⁣\n#gangmuraledukasi⁣\n#muraljakarta⁣\n#DKIJakarta⁣\n#JakartaBerkolabo2asi','2019-11-25 09:00:43',2,0,0,0,'2019-11-28 19:04:33','2019-11-28 19:04:33'),
	(3,'aniesbaswedan','https://instagram.com/p/B5PphHCgcA-',3888593,90176,'Semalam adalah babak baru, sebuah sejarah baru. Untuk pertama kalinya kita bisa memeriahkan Festival Deepavali dan diselenggarakan secara bersama di DKI Jakarta.⁣\n⁣\nIni menegaskan komitmen kami di Jakarta, bahwa Jakarta harus bisa menjadi tempat bagi semua. Rumah bagi semua dimana semua merasakan kesetaraan kesempatan.⁣\n⁣\nDan itu artinya dari seluruh aspek, kita harus fasilitasi. Termasuk bagi masyarakat Hindu, dan khususnya masyarakat Hindu keturunan India. Kita memastikan bahwa semua yang menjadi kebutuhan, apalagi terkait dengan kegiatan keagamaan, akan kita fasilitasi dan tuntaskan di Jakarta.⁣\n⁣\nTermasuk juga libur fakultatif, sejak 2017, kita sudah mengeluarkan Keputusan Gubernur untuk libur fakultatif Deepavali di Jakarta ini. Dan ini tentu menjadi harapan dari semua bahwa bukan hanya 2 Provinsi, Provinsi Bali dan Jakarta yang memberikan libur fakultatif. Mudah-mudahan akan bisa menjadi libur nasional di seluruh provinsi di Indonesia.⁣\n⁣\nApalagi kita menyadari bahwa Indonesia dan India adalah dua negara demokrasi terbesar di dunia. Dua-duanya menghormati prinsip-prinsip demokrasi. Dua-duanya mempraktikkan demokrasi. Dan dua-duanya menjadi rujukan bagi dunia.⁣\n⁣\nIni adalah dua negara yang memiliki sejarah yang jadi inspirasi bagi banyak kemerdekaan di berbagai belahan dunia. Perjuangan Indonesia, perjuangan India dan hari ini kita terhubungkan kembali lewat festival Deepavali.⁣\n⁣\nKebersamaan semalam adalah hasil kolaborasi antara Pemprov DKI Jakarta dengan Gema Sadhana dan Komunitas Hindu India. Dan kita merasakan bahwa kegiatan Deepavali kali ini melibatkan komunitas yang luar biasa. Apresiasi untuk semua pihak yang terlibat mewujudkannya.⁣\n⁣\nFestival Deepavali 23 November 2019 di Pasar Seni Ancol akan dicatat sebagai sejarah sebagai yang pertama kalinya di Jakarta. Kita ingin festival ini nantinya menjadi reguler dan lebih besar lagi. Kita sedang siapkan, nanti festival berikutnya di Pasar Baru yang akan menjadi Little India-nya Jakarta.⁣\n⁣\nKami ingin memfasilitasi komunitas yang selama ini ada di ibukota. Dan sekaligus menarik lebih banyak lagi orang datang ke Jakarta mendapatkan pengalaman yang unik berada di Jakarta.⁣\n⁣\n#Deepavali\n#FestivalDeepavali','2019-11-24 17:17:06',4,0,0,0,'2019-11-28 19:04:33','2019-11-28 19:04:33'),
	(4,'aniesbaswedan','https://instagram.com/p/B5MOQ87gh6p',3888593,88020,'Melanjutkan jalan-jalan ke Jembatan Antar Kampung (JAK), pagi ini kita ke Koja, Jakarta Utara.⁣\n⁣\nJembatan Kerang Hijau ini menggantung di atas Kali Penghubung Bendungan Melayu. Menghubungkan antara RW 05 Kelurahan Tugu Selatan dan RW 01 Kelurahan Rawa Badak Selatan. Jembatan sepanjang 10 meter dengan lebar dua meter ini mengambil tema kerang hijau karena sesuai dengan karakteristik Jakarta Utara sebagai wilayah pesisir.⁣\n⁣\nJembatan ikonik ini dibangun Sudin Bina Marga Jakarta Utara atas permintaan warga untuk memperbaiki jembatan lama yang sudah tidak layak pakai.⁣\n⁣\nAda jembatan antar kampung yang sudah mengkhawatirkan kondisinya di dekatmu? Silakan laporkan ke kanal pengaduan CRM (Cepat Respon Masyarakat).⁣\n⁣\n#JembatanKerangHijau⁣\n#Koja⁣\n#BinaMargaDKI⁣\n#JembatanAntarKampung⁣\n#CRM','2019-11-23 09:21:15',2,0,0,0,'2019-11-28 19:04:33','2019-11-28 19:04:33'),
	(5,'aniesbaswedan','https://instagram.com/p/B5KDhmaggvy',3888593,80757,'Terpukau memandang karya-karya foto mempesona ini. Lokasi sama, JPO sama, gedung sama. Yang dipandang sama, tapi dengan mata, pikiran dan hati yang berbeda-beda memunculkan sudut pandang yang beragam dan hasil fotonya pun beda-beda sekali.⁣\n⁣\nLihat saja karya-karya ini. Dan tentu terasa bahwa dari fotografer yang jernih itu memang mengalir karya yang memukau.⁣\n⁣\nSaat pikiran tak jernih, fotopun jadi suram, tiada keindahan. Karya pun nampak pucat, tanpa rasa, tanpa nuansa. Tapi, saat pikiran jernih, hati jernih, dan mata jernih maka foto pun seakan memancarkan keindahan. Foto memukau, tak henti dipandang.⁣\n⁣\nMemang keindahan sebuah foto itu adalah pancaran dari mata, hati dan pikiran fotografernya. Karya fotografi sesungguhnya adalah potret diri fotografernya. ⁣\n⁣\nIni bukan soal profesional atau amatir, bukan sekadar berpengalaman atau tak berpengalaman. Siapa pun bisa memotret. Pemula pun hasilnya bisa mempesona karena pada akhirnya, keindahan karya itu bukan cuma soal mata, tapi justru soal mata hati. ⁣\n⁣\nMari teruslah jadi pribadi-pribadi dengan pikiran jernih, mata jernih dan karya pun jadi memesona...','2019-11-22 13:08:55',3,0,0,0,'2019-11-28 19:04:33','2019-11-28 19:04:33'),
	(6,'aniesbaswedan','https://instagram.com/p/B5Hu76KgNym',3888593,119296,'Alhamdulillah, Pemprov DKI Jakarta baru saja menerima kembali Penghargaan Keterbukaan Informasi Publik Tahun 2019 yang berdasarkan penilaian oleh Komisi Informasi Pusat Republik Indonesia.⁣\n⁣\nIni menunjukkan komitmen Pemprov DKI Jakarta untuk terus mendukung dan melaksanakan praktik open governance. yang di dalamnya ada komponen transparansi, keterbukaan. Sesuai yang diamanatkan dalam Undang-undang nomor 14/2008 tentang Keterbukaan Informasi Publik. ⁣\n⁣\nTapi yang lebih penting adalah bahwa komitmen Pemprov DKI Jakarta dalam hal keterbukaan informasi ini telah melampaui apa yang telah diarahkan oleh Undang-undang KIP itu sendiri. Kita memberikan akses informasi kepada publik terhadap berbagai aspek kegiatan, dari perencanaan hingga hasil kinerja Pemprov DKI Jakarta. ⁣\n⁣\nJadi kami merasa bersyukur sekali bahwa kategori yang kita dapat adalah ketegori yang tertinggi sebagai Badan Publik yang Informatif, dua tahun berturut-turut. Apresiasi atas kerja keras seluruh jajaran Pejabat Pengelola Informasi dan Dokumentasi (PPID) Dinas Komunikasi, Informatika dan Statistik Pemprov DKI Jakarta.⁣\n⁣\nBerkat mereka semua inovasi, semua karya, semua kolaborasi, yang dilakukan Pemprov DKI selama ini bisa diketahui publik dan kami bisa mengajak publik lebih banyak lagi untuk terlibat di dalam pembangunan di Jakarta. ⁣\n⁣\nKami bersyukur dan akan terus tingkatkan di masa yang akan datang.⁣\n⁣\nppid.jakarta.go.id','2019-11-21 15:30:32',3,0,0,0,'2019-11-28 19:04:34','2019-11-28 19:04:34'),
	(7,'aniesbaswedan','https://instagram.com/p/B5HYDgWgRw0',3888593,84455,'Kali ini kita ke Jakarta Barat. Jembatan Krendang kini dipercantik oleh Suku Dinas Bina Marga Kota Administrasi Jakarta Barat.⁣\n⁣\nJembatan antar kampung (JAK) ini melintasi Kali Duri, Krendang Tambora Jakarta Barat, menghubungkan Kampung Krendang, khususnya RT.005 RW.07 dengan RPTRA Krendang.⁣\n⁣\nJembatan Krendang terlihat makin menarik pada malam hari sehingga jadi spot baru untuk warga berswafoto. Kita berharap jembatan ini tak hanya bermanfaat bagi warga tapi menjadi ruang ketiga yg menyatukan warga dari dua sisi kali. Kami titipkan pada teman-teman Kampung Krendang agar menjaga dan memelihara jembatan ini.⁣\n⁣\nApakah kamu tinggal di dekat Jembatan Krendang ini? Unggah fotomu, sertakan tagar #JembatanKrendang.⁣\n⁣\n#DinasBinaMargaDKI #pasukankuning #pelayananmasyarakat #kelurahankrendang #kominfotikjb #tambora #JembatanKrendang #jembatanantarkampung #DKIJakarta #WajahBaruJakarta','2019-11-21 12:10:35',2,0,0,0,'2019-11-28 19:04:34','2019-11-28 19:04:34'),
	(8,'humas.jateng','https://instagram.com/p/B5U5IF6FGDB',11314,371,'\"?????? ???? ???? ??? ????, ????? ????? ??????? ????? ??? ????? ???? ???? ????????????, ??????????? ????????? ??????? ??? ????? ???? ?????????? ?? ?????? ????????? ?? ???? ??????\"\n\nItu yang diungkapkan Gus @tajyasinmz saat bersama @najwashihab di @matanajwa On Stage Sabtu (23/11) lalu. Gus Yasin juga pamerkan sarung bermotif batik yang dikenakan adalah produk pesantren Jawa Tengah. ??\n———\n#HumasJateng #TajYasin #MataNajwaonStage #MataNajwaOnStageSemarang #MataNajwaMudaBerkuasa #Narasitv #NarasiNewsroom #Semarang #JatengGayeng #JawaTengah','2019-11-26 18:09:42',5,0,0,0,'2019-11-28 19:04:39','2019-11-28 19:04:39'),
	(9,'humas.jateng','https://instagram.com/p/B5Re1s0FiYc',11314,433,'Selamat Hari Guru Nasional #SahabatHumas! ?\n\nKalian sudah baca pidato Peringatan Hari Guru Nasional dari Mas Menteri @kemdikbud.ri Nadiem Makarim?\n\nHanya 2 lembar, isinya langsung ke persoalan dan kalau dibacakan dalam upacara pasti cepat selesai, setidaknya itu komentar Pakdhe @ganjar_pranowo ?\n\nTadi pagi, setelah Upacara Peringatan #HariGuruNasional tingkat Jawa Tengah Padkhe juga punya pesan buat semua para guru, \"???? ????? ??????? & ???????? ????? ?????? ??????? ?? ???????!\" Gimana menurut kalian?\n———\n#HumasJateng #GanjarPranowo #HGN2019 #HariGuruNasional #SelamatHariGuru #HariGuruNasional2019 #MerdekaBelajar #GuruPenggerak #JatengGayeng #JawaTengah','2019-11-25 10:22:17',2,0,0,0,'2019-11-28 19:04:39','2019-11-28 19:04:39'),
	(10,'humasprovjatim','https://instagram.com/p/B5WhI1OA9Cz',10415,172,'Gubernur Jawa Timur Khofifah Indar Parawansa melepas 119 atlet dan 29 pelatih  kontingan asal Jatim yang akan berlaga di Sea Games Manila 2019. Pelepasan atlet yang dilaksanakan di Hotel Sultan, Jakarta, Selasa malam (26/11) tersebut dihadiri Ketua DPD RI yang juga Ketua Dewan Penyantun KONI Jatim La Nyala Mataliti , Wakil Ketua Umum KONI Sarwono, Yuni Deputy Kemenpora dan Ketua KONI Jatim, Erlangga Satria Agung.\n.\nKesempatan tersebut dimanfaatkan Gubernur Khofifah sekaligus untuk memompa semangat seluruh atlet yang rencananya akan berangkat seluruhnya Kamis (28/11) menuju Manila, Filipina. \"Atlet Jawa Timur harus mampu mengibarkan bendera merah putih dan kumandangkan Indonesia  disana, raihlah emas sebanyak mungkin dan buatlah bangga Indonesia di mata dunia lewat prestasi kalian. Saya yakin Jawa Timur mampu,\" ungkap Khofifah. .\n.\n.\n#gubernurjatim #khofifah #atlet #atletjatim\n#seagames2019 #seagames #koni #olahraga','2019-11-27 09:18:34',2,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(11,'humasprovjatim','https://instagram.com/p/B5T3sePAuFu',10415,167,'Gubernur Jawa Timur Khofifah Indar Parawansa berhasil meraih dua penghargaan sekaligus dalam ajang Penghargaan Organisasi Masyarakat (Ormas) Tahun 2019 yang diselenggarakan oleh Kementerian Dalam Negeri RI di Hotel Kartika Candra Jakarta, Senin (25/11).\n.\nPenghargaan pertama diraih untuk kategori Pemerintah Provinsi Sebagai Pembina Ormas Terbaik. Bahkan Provinsi Jawa Timur merupakan satu- satunya provinsi yang mendapatkan anugerah penghargaan ini.  Sedangkan penghargaan kedua diterima Khofifah selaku Ketua Umum PP Muslimat NU untuk kategori Penghargaan Khusus Bakti Sepanjang Hidup (Long Life Achievement) untuk Muslimat NU.\n.\nPenghargaan tersebut diserahkan secara langsung oleh Menteri Dalam Negeri (Mendagri) Prof. H. Muhammad Tito Karnavian, Ph.D kepada Gubernur Jawa Timur Khofifah Indar Parawansa. Penghargaan kategori Pemerintah Provinsi Sebagai Pembina Ormas Terbaik diberikan karena Pemprov Jatim dianggap mampu dan berhasil membina ormas dengan baik. .\n.\nSecara keseluruhan, Jatim memiliki hampir 14.000 ormas, baik yang berbadan hukum maupun yang legalitasnya dengan surat keterangan terdaftar. Jumlah ormas yang besar ini mampu dikelola Pemprov Jatim. Jatim juga mampu melakukan pemberdayaan dan sinergitas ormas dengan baik. Ruang komunikasi dan koordinasi terjalin dengan lancar, dan ormas ditempatkan sebagai mitra pembangunan Provinsi Jatim.\n.\n.\n.\n#gubernurjatim #khofifah #penghargaan #ormas #penghargaanormas #muslimat #muslimatnu #mendagri #titokarnavian','2019-11-26 08:37:57',2,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(12,'humasprovjatim','https://instagram.com/p/B5SSiU2AXMy',10415,219,'Provinsi Jawa Timur menerima  penghargaan sebagai Provinsi Terbaik dalam dukungan pelaksanaan program Inovasi Desa Tahun 2019. Tidak hanya itu, Gubernur Jawa Timur, Khofifah Indar Parawansa pun memperoleh penghargaan atas dukungannya dalam pelaksanaan program inovasi desa besutan Kementerian Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi.\n. .\nPenghargaan tersebut diserahkan Menteri Koordinator Bidang Pembangunan Manusia dan Kebudayaan, Muhadjir Effendy didampingi Menteri Desa dan PDTT, Abdul Halim Iskandar kepada Gubernur Khofifah di Merlyn Park Hotel, Jakarta, Senin (25/11).\n.\nKhofifah mengatakan, dana desa merupakan stimulus yang diberikan pemerintah untuk menggerakkan perekonomian masyarakat desa. Tentu saja, butuh inovasi dalam pemanfaatannya sehingga memiliki dampak yang besar bagi masyarakat. Besarnya dana yang ditransfer ke desa mampu menjadi pemicu sekaligus pemacu tumbuh dan berkembangnya seluruh potensi desa. .\n.\nUntuk itu mendorong masyarakat desa untuk turut mengawal setiap tahapan penggunaan dana desa yang digunakan dalam membangun infrastruktur, pengembangan ekonomi masyarakat, pendidikan, dan juga kesehatan. .\n.\n#gubernurjatim #khofifah #danadesa #inovasidesa #pembangunandesa #desa','2019-11-25 17:54:01',4,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(13,'humasprovjatim','https://instagram.com/p/B5RG4zGAwYA',10415,167,'Selamat Hari Guru Nasional Tahun 2019. Terimakasih atas pengabdian dan jasamu para guru. Tetaplah menjadi pelita bagi seluruh anak bangsa. Jasamu akan kami kenang selamanya ?\n.\n.\n#hariguru #hutpgri #hariguru2019 #selamathariguru #guru #pahlawantanpatandajasa','2019-11-25 06:52:59',1,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(14,'humasprovjatim','https://instagram.com/p/B5P2F9nAOV0',10415,151,'Dalam Peringatan Hari Guru Tahun 2019 dan HUT Ke-74 Persatuan Guru Republik Indonesia (PGRI)  Tingkat Jawa Timur yang diselenggarakan di JX International Surabaya, pagi ini, Gubernur @khofifah.ip menekankan pentingnya peranan guru dalam mewujudkan SDM  Unggul menuju Indonesia Maju 2045. Untuk mencapai masa depan Indonesia yang cerah perlu didukung peran guru yang ikut meningkatkan kualitas sumber daya manusia. Ini senada dengan tema peringatan Hari Guru Nasional Tahun 2019 dan HUT Ke-74 PGRI Tingkat Jatim yaitu “Peran Strategis Guru Dalam Mewujudkan Sumber Daya Manusia Indonesia Unggul”.\n.\n.\nDalam kesempatan ini Gubernur Khofifah juga menerima penghargaan dari Ketua  PGRI atas kepeduliannya terhadap peningkatan mutu pendidikan di Jawa Timur. Penghargaan tersebut diraihnya dengan berbagai langkah yang dilakukan untuk meningkatkan kualitas pendidikan di Jatim. .\n.\n.\n#gubernurjatim #khofifah #hariguru #hutpgri #hariguru2019 #selamathariguru #guru #pahlawantanpatandajasa','2019-11-24 19:07:00',5,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(15,'humasprovjatim','https://instagram.com/p/B5PoUbwgS-V',10415,281,'Ketua Dewan Kerajinan Nasional Daerah (Dekranasda) Jatim Arumi Emil Elestianto Dardak mengapresiasi penyelenggaraan Mojobatik Festival 2019 yang diselenggarakan di Alun-Alun Mojokerto, Sabtu (23/11) malam. Arumi berharap, acara yang diselenggarakan oleh Pemkot Mojokerto itu dapat semakin menumbuhkan rasa cinta dan sayang terhadap batik khas Kota Mojokerto. Apalagi kegiatan tersebut menampilkan berbagai kreativitas dan inovasi para perajin dan desainer batik.\n.\n.\nMenurutnya, keberadaan batik saat ini telah diakui sebagai warisan budaya asli bangsa Indonesia. Karena itu, sudah menjadi kewajiban bagi warga negara Indonesia untuk senantiasa mencintai dan menjaga warisan leluhur untuk terus dikembangkan dan dilestarikan. Melalui event Mojobatik Festival 2019, Arumi berharap agar event tersebut bisa menjadi sarana yang tepat untuk mengenalkan batik khas Kota Mojokerto kepada masyarakat luas. .\n.\n.\n#mojobatik #arumibachsin #dekranasda\r#dekranasdajatim\n#batik #batikjatim','2019-11-24 17:06:38',4,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(16,'humasprovjatim','https://instagram.com/p/B5O3f9cALh9',10415,156,'Membangun karakter bangsa adalah sebuah keniscayaan dan kebutuhan. Karakter bangsa akan terbangun melalui bangunan karakter pribadi  warga bangsanya. Kedudukan tinggi seseorang tidak akan berarti apapun jika tidak memilki karakter atau akhlak. Maka proses menjaga dan  menyempurnakan akhlak harus terus diikhtiarkan. .\n.\nPesan tersebut disampaikan Gubernur Jawa Timur Khofifah Indar Parawansa saat membuka Emotional Spiritual Quotient (ESQ) New Chapter Character Building Tingkat I di Empire Palace Jl. Blauran Genteng Surabaya, Sabtu (23/11) pagi.\n.\nMenurutnya, mengenali jati diri, lingkungan  serta mengenali sang pencipta dengan berbagai kebesaran ciptaanNya adalah salah satu cara untuk membangun karakter dalam diri seseorang sehingga menjadi insan yang pandai mensyukuri nikmat Allah yang maha  menciptakan kehidupan. Mengenali diri sendiri juga akan membuat seseorang lebih menghargai orang lain dan jauh dari keangkuhan dan kesombongan.\n.\n.\n.\n#gubernurjatim #khofifah #karakterbangsa #jatidiri #trainingesq #esq','2019-11-24 10:00:02',2,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(17,'humasprovjatim','https://instagram.com/p/B5MOZ27A96S',10415,150,'Gubernur Jawa Timur Khofifah Indar Parawansa meminta kepada bupati/walikota dalam menggunakan Daftar Isian Pelaksanaan Anggaran (DIPA) harus bisa tersampaikan kepada penerima manfaat. Ia meminta seluruh pihak tak hanya melakukan \'sent\' program tapi juga memastikan program \'delivered\' pada masyarakat. Seperti beberapa kali disampaikan oleh Presiden.\n.\nPesan itu disampaikannya saat membuka Rapat Koordinasi Provinsi Jawa Timur Tahun 2019 Sinergi Pemerintah Pusat dan Daerah Dalam Rangka Mensukseskan Lima Prioritas Pembangunan Nasional Untuk Mewujudkan Indonesia Maju dan Penyerahan DIPA Tahun Anggaran (TA) 2020 di Convex Grand City Surabaya, Jumat (22/11). .\n.\nMenurutnya penyerahan DIPA kepada bupati/walikota ini juga disertai transfer alokasi dana yang harus sampai ke desa,  total DAK dan alokasi dana transfer daerah dan desa se Jatim  jumlahnya mencapai  Rp. 79,31 triliun. Penyerahan DIPA ini diberikan guna menjalankan program prioritas pembangunan nasional 2019-2024 untuk mewujudkan Indonesia Maju  pada tahun 2045. .\n.\n.\n#gubernurjatim #khofifah #dipa #anggaran','2019-11-23 09:22:28',2,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(18,'humasprovjatim','https://instagram.com/p/B5JgBM2g6E6',10415,257,'Ketua Forum Peningkatan Konsumsi Ikan Nasional (Forikan) Jawa Timur, Arumi Emil Elestianto Dardak mendorong seluruh pihak, untuk membangun mentalitas rutin makan ikan di tengah-tengah masyarakat. Tujuannya agar tingkat konsumsi ikan di Jatim kian meningkat, sehingga kebutuhan gizi masyarakat, khususnya anak-anak terpenuhi.\n.\nMentalitas rutin konsumsi ikan ini harus terus dibangun, sebab ikan memiliki nilai gizi yang tinggi. Selain itu, kita tinggal di negara maritim, dimana wilayah lautannya lebih besar daripada daratan. Dengan demikian, potensi ikan kita sudah pasti sangat banyak, baik ikan laut, maupun ikan tawar. Hal itu disampaikannya saat membuka puncak Hari Ikan Nasional (Harkannas) ke-6 Tahun 2019 di Dyandra Expo Surabaya, Kamis (21/11).\n.\n.\n.\n#arumibachsin\n#forikan #forikanjatim #gemarikan #ayomakanikan','2019-11-22 07:58:40',1,0,0,0,'2019-11-28 19:04:43','2019-11-28 19:04:43'),
	(19,'humas_jabar','https://instagram.com/p/B5Xw72-Bk3V',88728,476,'Pertemuan tersebut membahas sejumlah peluang kerja sama dari kedua belah pihak?\n.\nTerlebih, Pemda Provinsi Jawa Barat dan Souss Massa Region sudah membuat kesepakatan Sister City pada November 2017 lalu?\n.\nPada kesempatan tersebut, Kang @Ridwankamil menawarkan sejumlah produk unggulan Jabar. Mulai dari kopi, teh, kriya, sampai perikanan. Nah, selain itu Kang Emil juga membuka peluang kerja sama di bidang ekonomi, seperti UMKM dan investasi?\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas Jabar by @wdudi75 .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #KerjaSamaLN','2019-11-27 20:55:51',5,0,0,0,'2019-11-28 19:04:49','2019-11-28 19:04:49'),
	(20,'humas_jabar','https://instagram.com/p/B5Xf41Rhd4t',88728,419,'Nantinya PT Pertamina (Persero) bakal mengintegrasikan kilang dan membangun pabrik yang memproduksi sejumlah produk petrokimia turunan ya di Kabupaten Indramayu?\n.\nKang @Ridwankamil mengatakan tugas Pemerintah Daerah Provinsi Jawa Barat dalam berinvestasi tersebut adalah mengamankan tata ruang dan menunjuk lokasi?\n.\nKarena, lahan yang digunakan lebih dari 200 hektare akan didorong untuk dijadikan Kawasan Ekonomi Khusus (KEK)\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas Jabar by @sleepybro_ .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum','2019-11-27 18:26:53',5,0,0,0,'2019-11-28 19:04:49','2019-11-28 19:04:49'),
	(21,'humas_jabar','https://instagram.com/p/B5W_WEFhtsi',88728,544,'Wilujeng siang wargi Jabar sadayana ?\n.\nSaatos tuang sareng rerencangan di kantor atanapi di sakola, raos upami ngaemutan deui kecap sesebutan sipat jalma ?\n.\nDinten ieu, #Kangmin sareng Tim Humas Jabar bade masihan sababaraha kecap sesebutan, hayu diajar sasarengan wargi?\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nInfografis by @gunturrofika .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #Rebonyunda','2019-11-27 13:42:31',3,0,0,0,'2019-11-28 19:04:49','2019-11-28 19:04:49'),
	(22,'humas_jabar','https://instagram.com/p/B5WXTt-h1qz',88728,436,'“Tandur”merupakan istilah dalam pertanian masyarakat tanah Sunda yaitu singkatan dari bahasa sunda “Tanam Mundur”(Tandur)?\n.\nCara menanam padi ini dilakukan dengan membungkuk mundur, oleh karena itu munculah sebutan kata tandur wargi?\n.\nBenih padi ditanam di antara pertemuan garis lurus yang memanjang dan memotong pada satu petak sawah, sehingga terlihat rapi?\n.\nAda ga nih wargi Jabar yang pagi ini sedang \"tandur\" di desa tercintanya ? .\n.\n#JabarKita #JabarJuaraLahirBatin\nDokumentasi by @tembangsunda taken at Cisalak, Subang, Jawa Barat.\n. .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #DesaWisataJabar','2019-11-27 07:52:40',1,0,0,0,'2019-11-28 19:04:49','2019-11-28 19:04:49'),
	(23,'humas_jabar','https://instagram.com/p/B5UoLach7i7',88728,564,'Melalui Musyawarah Nasional (Munas) ke-VI Asosiasi Pemerintah Provinsi Seluruh Indonesia (APPSI) di Jakarta, Menteri Dalam Negeri (Mendagri) Republik Indonesia (RI) Tito Karnavian mendorong gubernur untuk berimprovisasi dalam meningkatkan Pendapatan Asli Daerah (PAD).\n.\nKang @Ridwankamil  getol menawarkan berbagai proyek strategis di provinsi dengan jumlah penduduk terbesar se-Tanah Air ini melalui forum investasi, antara lain West Java Investment Summit (WJIS) 2019 dan US-Indonesia Investment Summit.\n.\nPemda Provinsi Jawa Barat pun memiliki konsep delapan pintu anggaran dalam membangun Jabar. Selain APBD, pembangunan provinsi dengan jumlah penduduk terbesar se-Tanah Air ini bersumber dari dana umat hingga Corporate Social Responsibility (CSR).\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas Jabar by @tatang.tarsiman .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum','2019-11-26 15:41:36',3,0,0,0,'2019-11-28 19:04:49','2019-11-28 19:04:49'),
	(24,'humas_jabar','https://instagram.com/p/B5Ts4_JB43F',88728,605,'Selamat pagi Selasa, selalu berjuang tanpa putus asa ?\n.\nBegitupun dengan segenap jajaran @Infobijb yang sudah 5 tahun membangun dan mengelola Bandara kebanggaan Jawa Barat ?\n.\nKemarin, 25 November 2019 PT BIJB (Perseroda) berulang tahun yang ke-5 lhoo wargi ?\n.\nApanih harapan dan doa wargi untuk Bandara Kertajati ini ?\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDokumentasi from @infobijb .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #bijbkertajati #BangunJabar','2019-11-26 07:03:32',1,0,0,0,'2019-11-28 19:04:51','2019-11-28 19:04:51'),
	(25,'humas_jabar','https://instagram.com/p/B5SOIydBAwu',88728,425,'\"Guru Indonesia yang tercinta, tugas anda adalah yang termulia sekaligus yang tersulit\"\n.\nSalah satu petikan isi pidato dari Menteri Pendidikan dan Kebudayaan (Mendikbud) RI Nadiem Makarim dalam momentum Hari Guru Nasional Tahun 2019?\n.\nMenurut Kang @Ridwankamil arahan Mendikbud berkaitan dengan perubahan metode pembelajaran di sekolah?\n.\n\"Pak Menteri mengajak guru untuk membuat situasi belajar itu menjadi menyenangkan. Tidak hanya urusan menghafal, tapi juga bakti sosial, berpetualang, mengasah keterampilan, dan murid disuruh berani menyampaikan gagasan\"\n- Ridwan Kamil, Gubernur Jawa Barat.\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas Jabar by @tatang.tarsiman .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #HariGuruNasional2019','2019-11-25 17:15:34',4,0,0,0,'2019-11-28 19:04:51','2019-11-28 19:04:51'),
	(26,'humas_jabar','https://instagram.com/p/B5Ouk3shPt1',88728,559,'Selamat berakhir pekan wargi Jabar ?\n.\nBobotoh yang hari ini nyetadion cuuung ☝️\n.\nJangan lupa untuk senantiasa menjaga fasilitas Stadion Si Jalak Harupat ya wargi ?\n.\nSemoga hari ini @Persib_official bisa meraih tiga point atas @psbaritoputeraofficial yaa?\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nFoto keren ini diabadikan oleh kang @randi_suryanagara .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #Persibday','2019-11-24 08:42:04',2,0,0,0,'2019-11-28 19:04:51','2019-11-28 19:04:51'),
	(27,'humas_jabar','https://instagram.com/p/B5NiGwqBD01',88728,478,'Bekerja sama dengan Bank Indonesia, Pemerintah Daerah Provinsi Jawa Barat membuat Pilot Project Pusat Distribusi Provinsi (P3DP) Jawa Barat?\n.\nP3DP digagas untuk menjaga inflasi dan stabilitas harga bahan kebutuhan pokok masyarakat?\n.\n\"Kami tambahkan pusat distribusi bekerja sama dengan Bank Indonesia, supaya kita bisa menjaga inflasi. Karena kalau sudah inflasi, yang mahal harga dapur\"\n- @Ridwankamil Gubernur Jawa Barat. .\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas Jabar by @yanaimisiana .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum','2019-11-23 21:33:51',5,0,0,0,'2019-11-28 19:04:51','2019-11-28 19:04:51'),
	(28,'humas_jabar','https://instagram.com/p/B5MABW4Bcbh',88728,406,'Selamat pagi Wargi Jabar?\n.\nTadi malam ada acara keren lho di Kabupaten Bandung Barat, ada yang datang langsung kesana gak nih ? Yap acara Festival Film Bandung (FFB) 2019?\n.\nFFB ini digelar sebagai bentuk komitmen dari Pemda Provinsi Jawa Barat dalam mendukung perkembangan industri kreatif dan film nasional?\n.\nKang @Ridwankamil berharap kualitas perfilman nasional yang konsisten bisa membawa film-film Indonesia semakin berjaya di masa depan?\n.\n\"Kita juga ingin film ini menjadi industri kreatif, menambah visi Jawa Barat sebagai provinsi pariwisata juga provinsi ekonomi kreatif\"\n- Ridwan Kamil, Gubernur Jawa Barat.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas Jabar by @yanaimisiana .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #FestivalFilmBandung','2019-11-23 07:16:47',1,0,0,0,'2019-11-28 19:04:52','2019-11-28 19:04:52'),
	(29,'humas_jabar','https://instagram.com/p/B5KZzGjhP-_',88728,1067,'Wilujeng sonten, wilujeng leleson wargi Jabar?\n.\nKemarin, Presiden RI @Jokowi telah mengumumkan 7 Staff Khusus Presiden periode 2019-2024 lho wargi ?\n.\nKetujuh staff khusus tersebut merupakan anak muda Indonesia yang berbakat, keren dan tentunya menginspirasi dong?\n.\nKuy wargi Jabar, kita sama-sama bersinergi bersama mereka untuk memberikan gagasan segar yang inovatif demi mewujudkan visi misi Presiden dan Wakil Presiden RI Periode 2019-2024 dalam menjadikan negara kita Maju dan SDM Unggul?\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nInfografis by @kemensetneg.ri .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum #Jokowi #Marufamin #Staffkhususpresiden','2019-11-22 16:23:33',4,0,0,0,'2019-11-28 19:04:53','2019-11-28 19:04:53'),
	(30,'humas_jabar','https://instagram.com/p/B5IKI2JBcwZ',88728,872,'Alhamdulillah Provinsi Jawa Barat (Jabar) mendapat penghargaan sebagai salah satu Provinsi Informatif di ajang Anugerah Keterbukaan Informasi Publik (KIP) 2019?\n.\nMenurut Kang @Ridwankamil tersebut menandakan bahwa Jawa Barat sebagai Provinsi yang taat pada aturan hukum?\n.\n\" Alhamdulillah, Jawa Barat mendapatkan anugerah salah satu provinsi yang paling informatif dalam keterbukaan informasi publik. Kategorinya informatif, menuju informatif, kurang informatif, dan tidak informatif\"\n- Gubernur Jabar, Ridwan Kamil\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas @kemensetneg.ri .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #Ridwankamil #Uuruzhanululum','2019-11-21 19:28:13',5,0,0,0,'2019-11-28 19:04:53','2019-11-28 19:04:53'),
	(31,'jokowi','https://instagram.com/p/B5RtKzLBca9',26786079,522679,'Dunia berkembang dan berubah cepat, teknologi kian mutakhir. Dan di tengah perubahan itu, para guru dituntut untuk tidak sekadar mengajar, tetapi juga mendidik dengan lebih fleksibel, kreatif, menarik, dan lebih menyenangkan.\n\nGuru tidak akan pernah tergantikan oleh mesin secanggih apa pun. Guru membentuk karakter anak bangsa dengan budi pekerti, toleransi, dan nilai-nilai kebaikan. Guru menumbuhkan empati sosial pada diri anak didik, membangun imajinasi dan kreativitas, serta mengokohkan semangat persatuan dan kesatuan bangsa.\n\nGuru adalah penggerak Indonesia Maju.','2019-11-25 12:27:29',2,0,0,0,'2019-11-28 19:04:58','2019-11-28 19:04:58'),
	(32,'jokowi','https://instagram.com/p/B5P00e6hd15',26786079,886462,'Desa Gamcheon tadinya adalah kampung yang kumuh di Busan, Korea Selatan. Sudah kumuh, lokasinya pun sulit: di lereng gunung yang curam. Sampai kemudian desa ini berbenah, ditata, diberdayakan.\n\nJadilah Gamcheon Culture Village sebagai salah satu tujuan wisata yang ramai, bahkan dikenal dengan sebutan “Machu Picchu-nya Busan”. Mengisi hari Minggu di Busan, saya mengunjungi desa budaya Gamcheon selepas siang tadi. Luar biasa. Rumah-rumah yang dicat berwarna-warni, dinding-dindingnya dihiasi beragam karya seni seperti mural. Jalan-jalan dan lorongnya yang sempit dipenuhi toko cenderamata, galeri seni, dan tempat makan.\n\nDari sebuah kafe di ketinggian, saya dan Ibu Negara menikmati pemandangan atap-atap bangunan yang seolah bertumpuk seraya menikmati makanan khas Korea Selatan.\n\nPenataan Desa Gamcheon mengingatkan saya model serupa di Tanah Air seperti yang ada di Klaten, Yogyakarta, atau di Nglanggeran, Gunung Kidul. Gamcheon bisa menjadi inspirasi bagi kepala daerah kita, bagi kampung-kampung kita, bagi desa-desa kita, bahwa yang kumuh pun kalau ditata dengan baik, bisa meningkatkan ekonomi masyarakat.','2019-11-24 18:55:52',5,0,0,0,'2019-11-28 19:04:58','2019-11-28 19:04:58'),
	(33,'jokowi','https://instagram.com/p/B5O-MbPBEa2',26786079,635923,'Temukan saya dalam gambar ini. Ada jurnalis, juru kamera, dan yang terbanyak adalah orang-orang yang tengah mengacungkan sehelai kertas. Kertas itu adalah lembar-lembar sertifikat hak milik atas sebidang tanah yang penerbitannya kita percepat semenjak tiga tahun terakhir.\n\nSaya ingat, pada akhir 2014 lalu saya mendapat laporan bahwa ada 126 juta bidang tanah di seluruh Tanah Air yang belum bersertifikat. Dari jumlah tersebut, baru 46 juta bidang yang diselesaikan.\n\nSementara, setiap tahun badan pertanahan hanya bisa menerbitkan 500 ribu sertifikat. Saya pernah merasakan jadi rakyat biasa, tahu betapa sulit dan berbelitnya mengurus sertifikat hak atas tanah. Kalau masih terus begitu, butuh 160 tahun lagi untuk menyelesaikan semua sertifikat lahan di Indonesia ini.\n\nAlhamdulillah, sejak tahun 2017, pendaftaran bidang tanah di Indonesia meningkat lebih sepuluh kali lipat. Dari lima juta lembar sertifikat tahun 2017, naik jadi sembilan juta tahun 2018, dan sampai November 2019 ini sudah 8,5 juta. Saya sendiri kerap menyerahkan langsung sertifikat tanah itu di setiap kunjungan ke daerah.','2019-11-24 10:58:32',2,0,0,0,'2019-11-28 19:04:58','2019-11-28 19:04:58'),
	(34,'jokowi','https://instagram.com/p/B5MuUFZB47A',26786079,677330,'Bertolak menuju Busan, Korea Selatan, siang ini, untuk kunjungan selama tiga hari.\n\nDi Busan, saya menghadiri rangkaian acara Konferensi Tingkat Tinggi (KTT) ASEAN-RoK, juga mengadakan pertemuan bilateral dengan Presiden Moon Jae-in, dan bertemu beberapa pemimpin perusahaan Korea Selatan.\n\nSelain itu, saya juga akan menemui kelompok ilmuwan dan peneliti muda Indonesia di negara itu.\n\nSelamat berakhir pekan.','2019-11-23 14:01:18',3,0,0,0,'2019-11-28 19:04:58','2019-11-28 19:04:58'),
	(35,'jokowi','https://instagram.com/p/B5KyPHbBxOW',26786079,559704,'Indonesia sebagai negara kepulauan terbesar di dunia, harus menjadi sebuah kekuatan regional yang baik dan disegani. Salah satunya ya dengan memperkuat alat utama sistem persenjataan (alutsista), yang modern, sejalan dengan perkembangan teknologi, sekaligus memperkuat industri pertahanan di dalam negeri.\n\nItulah yang saya tegaskan dalam rapat terbatas mengenai kebijakan pengadaan alutsista di Jakarta hari ini.\n\nSaya meminta jajaran terkait membuat rencana dan peta jalan yang jelas mengenai pengembangan industri alat pertahanan di dalam negeri. Peta jalan itu harus dapat menghubungkan industri alat pertahanan dari hulu ke hilir dan melibatkan BUMN dan pihak swasta. Dengan begitu, kita bisa mengurangi ketergantungan pada impor alutsista.\n\nSelain itu, pengadaan alutsista  jangan lagi berorientasi pada penyerapan anggaran, apalagi sekadar proyek. Kita hentikan cara-cara seperti itu.\n\nKalau pun ada impor alutsista dan kerja sama pertahanan dengan negara lain, saya minta kepastian alih teknologi kepada bangsa Indonesia.\n\nKarena itulah, kita tidak akan membeli alutsista yang teknologinya sudah usang.','2019-11-22 19:57:05',5,0,0,0,'2019-11-28 19:04:58','2019-11-28 19:04:58'),
	(36,'jokowi','https://instagram.com/p/B5IQPLNB1oF',26786079,591909,'Tujuh anak muda  ini adalah jembatan saya ke anak-anak muda, para santri, para diaspora yang tersebar di berbagai tempat untuk bersama-sama membangun bangsa ini. Sebagai staf khusus presiden, mereka akan jadi teman diskusi saya setiap bulan, setiap minggu, atau setiap hari.\n\nBersama mereka, saya bisa mencari cara yang out of the box, yang melompat, mengejar kemajuan.','2019-11-21 20:21:31',5,0,0,0,'2019-11-28 19:04:59','2019-11-28 19:04:59'),
	(37,'kaltaraprov','https://instagram.com/p/B5Rs49Wjx5X',14282,404,'Sesuai jadwal, tahap pendaftaran online dan penyerahan berkas persyaratan seleksi CPNS di lingkup Pemprov Kaltara Tahun 2019 akan ditutup pada 28 November 2019 mendatang. Meski demikian, jadwal tersebut masih tentatif dan bisa berubah. Tergantung keputusan dari Badan Kepagawaian Nasional (BKN)-selaku Panitia Seleksi Nasional (Penselnas) penerimanaan CPNS. .\nMelihat waktu yang kian mepet, Kepala @bkdkaltara Burhanuddin melalui Kepala Bidang Pengembangan dan Perencanaan Pegawai Denny Prayudi, meminta kepada para calon pelamar agar menyiapakan berkasnya sesuai dengan persyaratan yang ditentukan. “Kalau sesuai pengumuman hasil seleksi administrasi CPNS akan diumumkan pada 16 Desember 2019, namun jadwal ini masih tentatif dan dapat berubah sewaktu-waktu,” ungkap Deny. (@mukhlis.mhsut72)\n.\nCek keterangan lengkapnya di:\nhttps://humas.kaltaraprov.go.id\n.\n? by: @abdulghaf\n.\n#kaltarapastiterdepan\n#kaltaraprov\n#infokaltara \n#beritakaltara19\n#humasprovkaltara \n#humprosetdakaltara','2019-11-25 12:25:03',2,0,0,0,'2019-11-28 19:05:03','2019-11-28 19:05:03'),
	(38,'kaltaraprov','https://instagram.com/p/B5RehZ9Hwo0',14282,299,'DIPA\n\nGubernur Kaltara @irianto_lambrie menyerahkan secara simbolik dana DIPA dan TKDD 2020 kepada pemerintah daerah, instansi vertikal dan Satker lainnya.\n_\n? : @anggrinogilangverlando\n.\n#kaltarapastiterdepan\n#kaltaraprov\n#infokaltara \n#beritakaltara19\n#humasprovkaltara \n#humprosetdakaltara','2019-11-25 10:19:30',2,0,0,0,'2019-11-28 19:05:03','2019-11-28 19:05:03'),
	(39,'kaltaraprov','https://instagram.com/p/B5RVcxMo9lS',14282,476,'Sesuai dengan Surat Keputusan (SK) Gubernur Kalimantan Utara (Kaltara) No. 188.44/K.719/2019, tentang Upah Minimum Provinsi Kaltara Tahun 2020, Upah Minum Provinsi (UMP) di Kaltara pada 2020 ditetapkan sebesar Rp 3.000.804. Naik sebesar 8,51 persen dibandingkan dengan UMP tahun 2019 sebesar Rp 2.765.463. “Angka tersebut sesuai dengan formulasi yang menjadi ketetapan Kementerian Tenaga Kerja Republik Indonesia (Kemenker RI). Kenaikannya sebesar 8,51 persen dan telah disepakati oleh Dewan Pengupahan Kaltara,” ujar Armin Mustafa, Kepala @nakertrans_provkaltara didampingi Kabid Pengawasan Tenaga Kerja dan Hubungan Industrial (HI), Asnawi.\n.\nArmin mengatakan, sebelumnya Kemenaker RI menetapkan UMP tahun 2020 sebesar 8,51 persen. Di mana, hal itu tertuang dalam Surat Edaran (SE) Nomor B-m/308/HI.01.00/X/2019 tanggal 15 Oktober 2019, tentang Penyampaian Data Tingkat Inflasi Nasional dan Pertumbuhan Produk Domestik Bruto Tahun 2019. Dalam SE ini, menjelaskan bahwa inflasi nasional tercatat 3,39 persen dan pertumbuhan ekonomi nasional 5,12 persen, kemudian diakumulasi menjadi besaran kenaikan UMP 2020. “Kenaikan UMP memberi efek maksimal terhadap kesejahteraan pekerja,” ungkap Armin. (@iqbalhaerani)\n.\nCek keterangan lengkapnya di:\nhttps://humas.kaltaraprov.go.id\n.\n? by: @adhie_project\n.\n#kaltarapastiterdepan\n#kaltaraprov\n#infokaltara \n#beritakaltara19\n#humasprovkaltara \n#humprosetdakaltara','2019-11-25 09:00:14',2,0,0,0,'2019-11-28 19:05:03','2019-11-28 19:05:03'),
	(40,'kaltaraprov','https://instagram.com/p/B5HQkQMIeCq',14282,249,'Mereka terdiri dari, Tenaga Kerja Asing (TKA) sebanyak 254 orang, orang asing yang memiliki Kartu Ijin Tinggal Sementara (KITAS) 295 orang, memiliki Kartu Ijin Tinggal Tetap (KITAP) 9 orang, dan kunjungan 1 orang. Selain itu, dilaporkan juga bahwa sepanjang Januari hingga November 2019, jumlah orang asing yang keluar-masuk Kaltara sebanyak 187 orang.\n_\nDiungkapkan Kepala Badan Kesbangpol Kaltara, Basiran, pengawasan orang asing ini melibatkan beberapa instansi. Seperti, TKA yang diawasi oleh satuan tugas (Satgas) TKA yang dibawahi Dinas Tenaga Kerja dan Transmigrasi (Disnakertrans). “Pemantauan orang asing didasarkan pada Permendagri No. 49/2010, tentang Pemantauan Orang Asing dan Organisasi Masyarakat Asing di Daerah, dan Permendagri No. 50/2010 untuk pengawasan TKA,” jelas Basiran yang ditemui di ruang kerjanya, kemarin (20/11).\n_\nBaca selengkapnya di humas.kaltaraprov.go.id','2019-11-21 11:05:09',2,0,0,0,'2019-11-28 19:05:04','2019-11-28 19:05:04'),
