	(45,'kumparancom','https://instagram.com/p/B5XgTvLACXG',654741,8141,'PT MRT Jakarta baru beroperasi secara komersial pada Bulan April 2019. Namun, penumpang @mrtjkt yang ditargetkan hanya 65.000 sehari saat ini sudah mencapai 90.000 penumpang. Jumlah penumpang itu menambah penghasilan MRT Jakarta dari segi pembelian tiket, serta tambahan pemasukan dari non tiket seperti iklan dan penamaan stasiun.⁠\n-⁠\nDirektur Utama MRT Jakarta William Syahbandar mengungkapkan, sejauh ini pihaknya sudah mendapatkan laba sebesar 60-70 miliar. Angka laba bersih itu baru perhitungan dari pihak MRT. Secara resmi MRT Jakarta masih menunggu audit terkait jumlah pendapatan di tahun 2019.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanBISNIS #mrt #mrtjakarta #bisnis #kereta #bisnismrt #labamrtjakarta #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan.⁠','2019-11-27 18:30:33',5,0,0,0,'2019-11-28 19:05:17','2019-11-28 19:05:17'),
