	(47,'kumparancom','https://instagram.com/p/B5XV3EoFODw',654741,10775,'Pengusaha properti terkemuka, Ciputra, meninggal dunia di Singapura pada Rabu (27/11) sekitar pukul 01.05 waktu setempat. Sebagai arsitek dan pengusaha properti, Ciputra diketahui memiliki minat besar terhadap seni. Berikut rekam jejaknya semasa hidup.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠⠀⁠\n#kumparanBISNIS #ciputra #ciputragroup #bisnis #founderciputrameninggal #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-11-27 16:59:16',4,0,0,0,'2019-11-28 19:05:17','2019-11-28 19:05:17'),
	(48,'kumparancom','https://instagram.com/p/B5XEz2UAln5',654741,14782,'Bagi jubir Presiden Jokowi, Fadjroel Rachman, tidak ada yang salah dengan pernyataan Agnez Mo. Kata dia, @agnezmo hanya menceritakan asal-usulnya.⁠\n-⁠\n\"Dia bercerita tentang asal-usul dirinya, memuji keberagaman negeri tempat dia dilahirkan,\" ungkap dia.⁠\n-⁠\nFadjroel menambahkan, selama ini Agnez Mo telah membawa nama Indonesia dalam kancah musik internasional. Ia pun memotivasi warga negara Indonesia untuk bisa berbuat demikian, dengan caranya masing-masing.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #jubirpresiden #agnezmo #agnes #wawancara #interview #buildseries #mediaas #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-11-27 14:30:16',3,0,0,0,'2019-11-28 19:05:17','2019-11-28 19:05:17'),
	(49,'kumparancom','https://instagram.com/p/B5XBb81DX1B',654741,9296,'Zhu Zhong-fa, pria berusia 43 tahun asal Hangzhou, China mengalami sakit kepala yang berlangsung satu bulan lamanya. Dokter pun kemudian memindai otaknya dan mendapati ratusan cacing pita hidup di sana.⁠\n-⁠\nMenurut laporan News 18, Zhu mengunjungi rumah sakit First Affiliated Hospital of College of Medicine, Zhejiang University, dengan keluhan sakit kepala yang disertai kejang. Setelah dilakukan MRI pada otak pasien, hasilnya otak pasien menderita kerusakan cukup parah yang diakibatkan oleh cacing pita atau disebut sebagai neurocysticercosis.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanSAINS #otak #cacingpita #penyakit #sakitkepala #china #dokter #rumahsakitchina #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan.⁠','2019-11-27 14:00:48',3,0,0,0,'2019-11-28 19:05:18','2019-11-28 19:05:18'),
	(50,'kumparancom','https://instagram.com/p/B5W2f2DDt-k',654741,20447,'Sebuah mobil \"terjun bebas\" dari atas flyover, menimpa pejalan kaki di bawahnya. Satu orang tewas dan tiga lainnya terluka dalam kecelakaan itu. Video kecelakaan di India ini pun viral di media sosial.⁠\n-⁠\nMenurut media India Hindustan Times, peristiwa itu terjadi pada Sabtu lalu (23/11). Mobil sedan Volkswagen itu melaju dengan kecepatan tinggi di jalan layang kota Hyderabat sekitar pukul 01.00 siang. Ketika jalanan menikung, mobil hilang kendali dan menghantam pinggiran flyover.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #india #kecelakaan #videokecelakaan #kecelakaanmobil #mobilkecelakaan #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan.','2019-11-27 12:30:18',2,0,0,0,'2019-11-28 19:05:18','2019-11-28 19:05:18'),
