	(123,'kumparancom','https://instagram.com/p/B5HW5tKgNxW',654741,5382,'Ketua PP Muhammadiyah Prof Bahtiar Effendy meninggal dunia. Ia mengembuskan nafas terakhir di ICU RSIJ Cempaka Putih, pada Kamis (21/11) pukul 00.00 dini hari. Sebelumnya, Bahtiar sudah beberapa hari dirawat di RSIJ Cempaka Putih. Sejak Rabu (20/11), kondisinya menurun. Jenazah Bahtiar akan dikebumikan pada Kamis (21/11) setelah zuhur di pemakaman Lamperes, Depok.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠⠀⁠\n#kumparanNEWS #muhammadiyah #profbahtiar #effendy #bahtiareffendywafat #ketuappmuhammadiyah #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-11-21 12:00:31',2,1,1,1,'2019-11-28 19:05:31','2020-06-09 05:24:29'),
