	(125,'ridwankamil','https://instagram.com/p/B5T15mogc5I',11234545,107504,'SELAMAT & TERIMA KASIH para pelajar Jawa Barat yang kembali menjadi juara umum 3 tahun berturut-turut dan Pekan Olahraga Pelajar Nasional XV tahun 2019 ini di Jakarta. .\n\nKamu-kamu adalah luar biasa.\n\nSesuai semboyan “Mens sana in corpore sano” yaitu menang di sana juara di sini. \n#JABARJUARA','2019-11-26 08:22:16',2,1,1,1,'2019-11-28 19:05:36','2020-06-08 11:36:55'),
	(126,'ridwankamil','https://instagram.com/p/B5RqvqnApKV',11234545,110205,'Ini adalah Ibu Nunung Nurhasanah, guru jaman saya sekolah di SD Banjarsari Bandung, sekitar 35 tahun yang lalu. Beliau selain mengajari saya di kelas,  juga aktif mengarahkan dan memotivasi saya untuk menyalurkan energi motoriknya dengan aktif ikut organisasi: Pramuka, Pengibar Bendera dan ikut grup menari.\n\nWaktu SD saya hiper aktif dan agak bengal. Pernah main bola di kelas sampai memecahkan kaca ruang guru di sebelahnya. Pernah dihukum bersihkan WC selama seminggu tiap jam istirahat. Ibu Nunung lah yang menasehati saya dengan sabar. Dan buahnya, sebagian aspek kepemimpinan saya hari ini datang dari nasehat2 beliau. \nDi rumah, orangtua adalah guru kita. Sebaliknya, di sekolah, guru lah pengganti orang tua kita.\n\nAda sedikit bantuan ibadah umrah untuk Ibu Nunung dan suami sesuai cita-citanya. Hal yang sedikit dibanding ilmu yang diberikan Ibu kepada saya. Semoga manfaat dan mabrur.\n\nTerima kasih untuk Ibu Nunung dan guru-guru teladan lainnya se Indonesia yang selalu bersabar dalam mendidik kami para muridnya. .\n\nSelamat Hari Guru.','2019-11-25 12:12:38',2,1,1,1,'2019-11-28 19:05:37','2020-06-08 11:36:49'),
	(127,'ridwankamil','https://instagram.com/p/B5O5aPWAYCl',11234545,139875,'“Bunga-bunga Cinta di kebun pernikahan itu harus rajin dirawat dan dijaga”\n\nAda puluhan ribu pasangan di Jawa Barat mengajukan gugatan perceraian setiap tahun. Kebanyakan karena faktor ekonomi dan perselingkuhan. Apalagi godaan yang hilir mudik melalui media sosial atau digital.\nSuatu fenomena sosial yang mengkhawatirkan.\n\nKepada yang sudah menikah semoga kehangatan cintanya selalu dirawat dan dijaga dari godaan yang datang menghampiri.\n\nSelamat berhari Minggu. #JanganLupaBahagia bersama yang dicinta.','2019-11-24 10:16:44',2,1,1,1,'2019-11-28 19:05:37','2020-06-08 11:36:40'),
	(128,'viceind','https://instagram.com/p/B5XB-FlgqHc',341855,37403,'Bisnis perumahan eksklusif Islami—dilengkapi dewan syuro dan hukum syariah—berkembang pesat. Ada kekhawatiran tren ini merusak kohesi sosial. Penghuni pada VICE mengaku ingin bebas menjalankan agama. Selengkapnya di VICE.com. Link di bio. #viceindonesia\n-\n?Muhammad Ishomuddin','2019-11-27 14:05:27',3,1,1,1,'2019-11-28 19:05:42','2020-06-08 11:36:34'),
	(129,'viceind','https://instagram.com/p/B5W0MOCDhO6',341855,24414,'Penyanyi 33 tahun ini jadi trending topic di Twitter, gara-gara mengaku ke media asing kalau dia tidak berdarah Indonesia. Buat kalian yang sewot sama penyanyi pop 33 tahun itu, emang apa sih yang bisa kita sebut sebagai \"darah Indonesia\"? #opini\n-\nSelengkapnya di VICE.com. Link di bio. #viceindonesia\n-\n? Matt Winklemeyer/AFP','2019-11-27 12:05:03',2,1,1,1,'2019-11-28 19:05:42','2020-01-17 03:24:47'),
	(130,'viceind','https://instagram.com/p/B5UckzUgDvO',341855,29885,'Instant Pot adalah penemuan penting bagi jagat kuliner. Alat masak ini segera ngetren dan muncul dalam berbagai variasi fungsinya selama beberapa tahun terakhir. Intinya, Instant Pot merupakan kombinasi panci presto dan slow cooker ala-ala magic jar yang biasa kalian pakai menanak nasi. Instant Pot, yang pertama kali muncul di pasaran pada 2010, ternyata bisa dipakai untuk berbagai kebutuhan memasak. Termasuk, menghasilkan fermentasi anggur merah di rumah kalian sendiri. Selengkapnya di VICE.com. Link di bio. #viceindonesia\n-\n? Alachua Country/Flickr','2019-11-26 14:00:13',3,1,1,1,'2019-11-28 19:05:43','2019-11-30 03:23:59'),
