	(132,'humas.jateng','https://instagram.com/p/B5m0WwClxQQ',11445,499,'Five, four, three, two, one, #CloseTheDoor!\nFamiliar sama dengan jargonnya? ?\n\nAkan ada bincang-bincang seru dan menarik. Pakdhe @ganjar_pranowo bersama mantan pesulap kenamaan Indonesia siapa lagi kalau bukan mas @mastercorbuzier \nTunggu tanggal mainnya ya #SahabatHumas ??\n———\n#HumasJateng #GanjarPranowo #DeddyCorbuzier #JatengGayeng #JawaTengah','2019-12-03 17:14:20',4,1,1,1,'2019-12-05 03:22:36','2019-12-05 04:02:21'),
	(133,'humasprovjatim','https://instagram.com/p/B5l4kaWABZ9',10649,290,'Saat menjadi inspektur upacara peringatan HUT KORPRI ke 48, di halaman Grahadi, Senin (2/12) kemarin, Gubernur Jawa Timur @khofifah.ip meminta ASN di jajaran Pemprov Jawa Timur untuk berpikir lateral (lateral thinking) atau berpikir melompat. Sesuai arahan Presiden Joko Widodo, seluruh ASN harus membuat inovasi dan juga melakukan perubahan agar percepatan layanan masyarakat bisa terwujud. Percepatan layanan itu salah satunya bisa dilakukan dengan maksimalisi pemanfaatan teknologi.\n.\nDalam bekerja ASN tidak sekedar melakukan yang lebih baik dari kemarin. Tapi harus melakukan hal yang lebih baik dari negara lain. Oleh sebab itu berpikir melompat harus menjadi poin penekanan dalam cara kerja ASN.  Pasalnya saat ini tantangan dalam penerapan lateral thinking adalah ASN dalam bekerja senantiasa dalam format  struktural. Dimana cara kerja dan kordinasi  birokrasi harus sesuai dengan jenjang stuktural birokrasi. Sehingga terkesan strukturalis. Saat ini dibutuhkan format agar lebih fungsional. .\n.\n.\n#gubernurjatim #khofifah #korpri #harikorpri #harikorpri2019','2019-12-03 08:31:55',2,1,1,1,'2019-12-05 03:22:38','2019-12-05 04:01:47'),
	(134,'humas_jabar','https://instagram.com/p/B5nU_83hSik',89274,451,'Salah satunya dengan mendesain kota baru di sekitar pelabuhan Patimban, supaya akses menuju pelabuhan tertata?\n.\n“ Saya sudah minta ke JICA bulan Januari 2020 untuk mulai mendesain masterplan sebuah kota, sehingga jelas kalau mau ada pusat pemerintahan Subang silakan, rekreasi, industri dan lainnya. Akhirnya (Patimban) menjadi contoh pelabuhan di Indonesia” - Ridwan Kamil, Gubernur Jawa Barat.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nDok Humas Jabar @yanaimisiana .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava \n#RidwanKamil #UuRuzhanulUlum','2019-12-03 21:59:35',5,1,1,1,'2019-12-05 03:22:41','2019-12-05 04:00:23'),
	(135,'jokowi','https://instagram.com/p/B5mznYuh2Ly',26899852,313793,'Disabilitas bukanlah penghalang seseorang untuk belajar, untuk bekerja, untuk maju.\n\nSaya ingin mengajak kita semua untuk memberikan perlakuan dan kesempatan yang sama pada saudara-saudara kita penyandang disabilitas untuk bersama-sama membangun bangsa.\n\nSelamat Hari Disabilitas Internasional.','2019-12-03 17:07:52',4,1,1,1,'2019-12-05 03:22:43','2019-12-05 03:59:53'),
	(136,'jokowi','https://instagram.com/p/B5l1UpZBXbO',26899852,309961,'Selamat pagi. Menjelang akhir tahun 2019 ini, pembangunan jalan tol Trans Sumatra tetap berjalan. Panjang totalnya 2.974 kilometer, membelah Pulau Sumatra dari Lampung sampai Aceh, dan ditargetkan selesai tahun 2024.\n\nHingga akhir 2019 ini, Tol Trans Sumatra yang beroperasi adalah 501,16 kilometer!\n\nRuas-ruas yang telah rampung dan dapat dilalui adalah Bakauheni – Terbanggi Besar 141 kilometer, Terbanggi Besar - Pematang Panggang - Kayu Agung sepanjang 189 kilometer, Palembang – Indralaya 22 kilometer, Medan – Binjai 10,46 kilometer, Medan – Kualanamu – Tebing Tinggi 62,2 kilometer dan Belawan - Medan - Tanjung Morawa 43 kilometer. Dan yang segera beroperasi Desember ini adalah Kayu Agung-Jakabaring sepanjang 33,5 kilometer.\n\nJalan tol ini akan memangkas waktu tempuh antardaerah dan memperlancar arus distribusi barang dari pusat industri ke berbagai wilayah di Sumatra, dan menghidupkan titik-titik perekonomian baru di sepanjang Pulau Sumatra.','2019-12-03 08:03:33',2,1,1,1,'2019-12-05 03:22:43','2019-12-05 03:59:10'),
	(137,'kaltaraprov','https://instagram.com/p/B5mGqp6oPdB',14414,312,'Salah satunya, adalah pembangunan jalan pendekat dari Tanjung Selor menuju Tanah Kuning. Kepala Bidang Bina Marga Dinas Pekerjaan Umum Penataan Ruang Perumahan dan Kawasan Permukiman (DPUR-Perkim) Kaltara, Yusran menjelaskan, jalan pendekat itu merupakan jalan baru dengan titik temu di Desa Binai dengan jarak 39,85 kilometer. Sementara jika dibandingkan dengan jalan yang ada sekarang berjarak 72,47 kilometer. “Dengan kata lain, jalan baru yang kita bangun nantinya akan memangkas 32,62 kilometer dengan jalan yang ada saat ini,” jelasnya.\n.\nJalan baru ini nantinya akan mendukung kegiatan di KIPI Tanah Kuning-Mangkupadi untuk mengangkut kendaraan yang bertonase besar. Menurutnya, jalan yang ada saat ini tidak layak digunakan untuk kegiatan industri. Lantaran fisik jalan yang sempit dan berkelok, di mana beban jalan yang ditanggung juga kecil. “Saat ini, proses pembentukan jalan masih berupa timbunan dan belum terkoneksi. Ini dibangun secara perlahan dan akan terus berprogress,” kata Yusran. (@abdul_khalik_p_barana)\n.\nCek keterangan lengkapnya di:\nhttps://humas.kaltaraprov.go.id\n.\n? by: dokumeninfopubdok\n.\n#kaltarapastiterdepan\n#kaltaraprov\n#infokaltara \n#beritakaltara19\n#humasprovkaltara \n#humprosetdakaltara','2019-12-03 10:35:06',2,1,1,1,'2019-12-05 03:22:45','2019-12-05 03:58:25'),
	(138,'kumparancom','https://instagram.com/p/B5nGyuPoNAN',660574,5731,'Menantu Presiden @jokowi, Bobby Afif Nasution memantapkan niatnya mengikuti pemilihan Wali Kota Medan tahun 2020. Bobby menyerahkan formulir pendaftaran serta berkas persyaratan calon Wali Kota Medan ke kantor DPD PDIP Sumut, pada Selasa (3/12). Ia mengungkapkan, ini merupakan bentuk keseriusannya ingin terjun ke politik.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠⠀⁠\n#kumparanNEWS #bobby #pdip #jokowi #menantujokowi #presidenjokowi #walikotamedan #calonwalikota #calonwalikotamedan #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-12-03 20:01:21',5,1,1,1,'2019-12-05 03:22:48','2019-12-05 03:57:42'),
