	(140,'kumparancom','https://instagram.com/p/B5mnzxWAsxF',660574,7117,'Cabang olahraga angkat besi kembali menyumbangkan medali emas untuk kontingen Indonesia di SEA Games 2019. Kali ini Deni mempersembahkannya dari nomor 69 kg putra di Ninoy Aquino Memorial Stadium, Selasa (3/12). Deni berhasil menorehkan angkatan terbaik dengan total beban 315 kg.⁠\n-⁠\nBerkat ini, Indonesia bisa melampaui jumlah perolehan emas Indonesia Malaysia di ajang SEA Games 2019. Indonesia menorehkan 11 emas, atau unggul 1 atas Malaysia.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠⠀⁠\n#kumparanSPORT #deni #angkatbesi #seagames #seagames2019 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-12-03 15:24:42',3,1,1,1,'2019-12-05 03:22:49','2019-12-05 03:55:30'),
	(141,'kumparancom','https://instagram.com/p/B5mmhsOAx_N',660574,8228,'Ditjen Bea dan Cukai Kemenkeu memastikan adanya 18 kotak selundupan yang dibawa melalui pesawat baru Airbus A330-900 Neo milik Garuda Indonesia. Kasubdit Komunikasi Dan Publikasi Bea Cukai Deni Surjantoro menegaskan, kotak itu milik penumpang VIP yang ikut dalam pendaratan pertama Airbus baru Garuda tersebut.⁠\n-⁠\n18 kotak selundupan tersebut terdiri dari 15 kotak yang berisi spare part motor Harley Davidson bekas dan sisanya merupakan unit sepeda lipat baru merek Brompton.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠⠀⁠\n#kumparanBISNIS #pesawat #kemenkeu #pesawatgaruda #selundupan #sparepart #harley #brompton #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-12-03 15:13:30',3,1,1,1,'2019-12-05 03:22:49','2019-12-05 03:54:03'),
	(142,'kumparancom','https://instagram.com/p/B5mDPuKD-Lc',660574,7353,'Ledakan di Monas tak membuat aktivitas Presiden Jokowi terganggu. Jokowi tetap berkantor di Istana Negara, Jakarta, Selasa (3/12). Iring-iringan mobil kepresidenan tampak memasuki kompleks Istana sekitar pukul 08.50 WIB. Tampak penjagaan ketat oleh Paspampres di luar Istana. Sejumlah agenda kenegaraan rencananya akan diikuti @jokowi.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠⠀⁠\n#kumparanNEWS #bom #monas #bommonas #ledakan #ledakanjakarta #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-12-03 10:05:13',2,1,1,1,'2019-12-05 03:22:49','2019-12-05 03:52:51'),
	(143,'kumparancom','https://instagram.com/p/B5mAsy2FGGb',660574,10147,'Ledakan terjadi di Monas, Jakarta Pusat sekitar pukul 07.05 WIB, Selasa (3/12). Berdasarkan informasi yang diterima saat ini, ada dua korban terluka akibat insiden ini. Polri dan TNI masih berada di lokasi untuk melakukan penyelidikan dan olah TKP. Petugas telah meminta pengunjung untuk keluar dari area Monas.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠⠀⁠\n#kumparanNEWS #bom #monas #bommonas #ledakan #ledakanjakarta #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2019-12-03 09:42:58',2,1,1,1,'2019-12-05 03:22:50','2019-12-05 03:52:14'),
	(144,'viceind','https://instagram.com/p/B5m5m3Fgyfk',346635,17856,'Sudah memaksa para ayam memproduksi telur lewat cara-cara tidak normal, kini setelah kelebihan kuota, jutaan ayam akan dibunuh begitu saja atas nama kontrol harga. Keputusan ini diambil Kementerian Pertanian (Kementan) pada 27 November lalu. Anjloknya harga ayam karena kelebihan suplai membuat 7 juta bibit ayam akan dimusnahkan setiap minggu sejak Desember 2019. Kata peternak lokal, ini semua gara-gara pemerintah membuka impor. Selengkapnya di VICE.com. Link di bio. #viceindonesia\n-\n? Ahmad Zamroni/AFP','2019-12-03 18:00:14',5,1,1,1,'2019-12-05 03:22:56','2019-12-05 03:45:15'),
	(145,'viceind','https://instagram.com/p/B5mQ96Sof_R',346635,25794,'Startup pembuat matras Wakefit sedang mencari karyawan magang yang mau tidur sembilan jam penuh selama 100 malam, dengan iming-iming uang saku 100 Ribu Rupee atau setara Rp19,6 juta. Ini baru yang namanya pekerjaan ideal bagi kaum rebahan. Selengkapnya di VICE.com. Link di bio. #viceindonesia\n-\n? Kinga Chichewics/Unsplash','2019-12-03 12:05:07',2,1,1,1,'2019-12-05 03:22:56','2019-12-05 03:44:40'),
	(146,'humasprovjatim','https://instagram.com/p/CAXUUY2A5IC',26202,288,'Gubernur Jawa Timur, Khofifah Indar Parawansa mengungkapkan duka cita yang sangat mendalam atas meninggalnya seorang perawat yang tengah dalam kondisi mengandung dan berstatus Pasien Dalam Pengawasan (PDP).\n.\nPerawat tersebut bernama Ari Puspitasari dan dalam setiap harinya ia bekerja di RS Royal Surabaya. Ari sapaan lekat almarhumah ini meninggal pada hari Senin (18/5) pukul 10.15.\n.\n\"Innalillahi wa innailaihi rojiun, Kembali pahlawan medis Jawa Timur berpulang. Atas nama pribadi dan Pemprov Jawa Timur, saya ucapkan duka cita mendalam dan terimakasih yang sebesar-besarnya atas pengabdian dan pengorbanan almarhumah Ari Puspita S.kep, NS,\" ungkap Khofifah saat ditemui di Gedung Grahadi, Surabaya, Senin (18/5).\n.\n.\n#khofifah\n#emil\n#arumi\n#jawatimur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n@khofifah.ip \n@emildardak','2020-05-19 16:25:33',4,1,1,1,'2020-05-20 22:47:38','2020-05-21 13:26:40'),
	(147,'kumparancom','https://instagram.com/p/CAXeisNFfOT',949890,6977,'Kasus virus corona di Aceh saat ini tercatat hanya ada 2 kasus aktif yang sedang ditangani. Provinsi paling barat Indonesia itu menjadi satu-satunya wilayah dengan kasus positif aktif paling sedikit secara nasional.\n-\nKepala Balai Litbangkes Aceh, Fahmi Ichwansyah, mengakui penurunan kasus tersebut. Bahkan, sejak sepekan terakhir Balitbangkes Aceh hanya memeriksa 3-10 sampel per hari. Fahmi menilai, penurunan angka kasus COVID-19 di Aceh karena Tim Gugus Tugas, Pemerintah Aceh, dan semua perangkat sudah berjalan dengan baik.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #psbb #aceh #pemerintah #positifcorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-19 17:54:53',4,1,1,1,'2020-05-20 22:47:50','2020-06-08 11:36:29'),
	(148,'kumparancom','https://instagram.com/p/CAXRI9iFOn-',949890,3955,'Juru bicara pemerintah untuk penanganan COVID-19, Achmad Yurianto, mengatakan pada Selasa (19/5) terdapat penambahan sebanyak 486 kasus positif. Sehingga total kasus positif corona menjadi 18.496 dari sebelumnya 18.010 orang.\n-\nPasien yang meninggal bertambah sebanyak 30 orang. Sehingga total kasus meninggal sebanyak 1.221 orang. Kabar baiknya, pasien yang sembuh terdapat tambahan 143 pasien. Sehingga total pasien yang sembuh sebanyak 4.467 orang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #pasien #pandemi #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-19 15:57:46',3,1,1,1,'2020-05-20 22:47:51','2020-06-08 11:36:23'),
	(149,'kumparancom','https://instagram.com/p/CAW-CM9gIyy',949890,5424,'Sebuah video penjemputan Habib Bahar bin Smith untuk kembali ke jeruji besi di Lapas Gunung Sindur beredar. Dalam video itu, tampak percakapan Habib Bahar dengan petugas yang menjemputnya. Tak ada perlawanan dari Habib Bahar maupun pendukungnya. Namun, ia meminta izin untuk merokok satu batang sebelum dibawa kembali ke bui.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #habibbahar #kriminal #tahanan #asimilasi #bogor #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-19 13:15:57',3,1,1,1,'2020-05-20 22:47:51','2020-06-08 11:36:12'),
	(150,'kumparancom','https://instagram.com/p/CAW7ucclYDD',949890,13709,'Istilah The New Normal muncul hampir bersamaan dengan rencana Presiden Jokowi untuk melonggarkan PSBB. Banyak pihak mengaitkan new normal sebagai cara hidup baru setelah virus corona \"hadir\" di bumi dan hingga kini belum ditemukan vaksin sebagai antivirus. Simak penjelasan berikut.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #psbb #newnormal #pemerintah #psbb #jakarta #psbbjakarta #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-19 12:50:39',2,1,1,1,'2020-05-20 22:47:52','2020-06-08 11:36:01'),
	(151,'kumparancom','https://instagram.com/p/CAW46u1ljGI',949890,7625,'Konser amal corona bertajuk \'Berbagi Kasih Bersama Bimbo\' pada Minggu (17/5) malam menuai kritik. Acara yang diinisiasi MPR, Badan Pembinaan Ideologi Pancasila (BPIP) dan Badan Nasional Penanggulangan Bencana (BNPB) itu dinilai mengabaikan physical distancing.\n-\nMerespons hal itu, Ketua MPR, Bambang Soesatyo, meminta maaf dan memberikan klarifikasi. Bamsoet mengaku tak menyangka solidaritas masyarakat luar biasa untuk bisa saling membantu sesama. Menurutnya, sejak awal, semua pihak di studio sudah berupaya menjaga jarak.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #psbb #bamsoet #mpr #konseramal #jakarta #psbbjakarta #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-19 12:26:07',2,1,1,1,'2020-05-20 22:47:52','2020-06-08 11:35:55'),
	(152,'kumparancom','https://instagram.com/p/CAWyx9eFCUr',949890,14025,'Sejumlah pengendara kendaraan bermotor mengalami kemacetan lalu lintas di Tol Dalam Kota dan Jalan MT Haryono, Pancoran, Jakarta, Senin (18/5). Berikut potretnya.\n-\nMeski status PSBB untuk menekan virus corona masih berlaku, banyak kendaraan pribadi yang masih beraktivitas seperti biasa. Penerapan PSBB di Jakarta masih berlaku hingga 22 Mei 2020, namun masih terlihat warga yang melanggar aturan tersebut.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #psbb #pancoran #macet #jakarta #psbbjakarta #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-19 11:32:29',2,1,1,1,'2020-05-20 22:47:52','2020-05-21 13:21:48'),
	(153,'kumparancom','https://instagram.com/p/CAWtBhClXIz',949890,15511,'Habib Bahar bin Smith kembali dijebloskan ke penjara. Ia diamankan kembali pada Selasa (19/5) dini hari di pesantrennya, Pondok Pesantren Tajul Alawin, Kampung Poktua, Desa Pabuaran, Kecamatan Kemang Kabupaten Bogor.\n-\nKadivpas Kemenkumham Jabar, Abdul Aris, membenarkan kabar tersebut. Ia mengatakan Habib Bahar ditahan kembali di Lapas Gunung Sindur karena melanggar ketentuan asimilasi.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #habibbahar #kriminal #tahanan #asimilasi #bogor #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-19 10:42:11',2,1,1,1,'2020-05-20 22:47:53','2020-05-21 13:18:04'),
