	(156,'faktanyagoogle','https://instagram.com/p/CAXzvCvB92h',2365108,29511,'Seorang pencuri berusaha membawa kabur mobil Tesla Model 3 di California. Namun, apesnya ia tak bisa keluar dari mobil tersebut karena tak mengetahui caranya.\n.\nAlih-alih mencuri mobil tersebut, justru malah terperangkap dan pemilik mobil dapat menghubungi polisi. Ternyata, mobil canggih ini dapat dikontrol melalui aplikasi Tesla di smartphone pemilik mobil. Jadi, sang pemilik mobil langsung mematikan motor listrik mobil tersebut dan mengunci pintunya melaui smartphonenya dari jarak jauh. Wah keren banget ya~\n#faktanyagoogle','2020-05-19 21:00:04',5,1,1,1,'2020-05-20 22:48:01','2020-06-08 11:35:38'),
	(157,'faktanyagoogle','https://instagram.com/p/CAXiVYBB2mK',2365108,22045,'Kabarnya, Kemendikbud berencana membuka kembali sekolah pada Juli mendatang. Hal ini membuat pengamat pendidikan dari Universitas Yarsi, Fasli Jalal menyarankan seluruh siswa dan guru melakukan tes corona secara berkala jika sekolah dibuka kembali.\n.\nMenurut Fasli, hal ini penting dilakukan agar satuan pendidikan bisa mengetahui jika ada siswa atau guru yang terinfeksi virus corona selama kegiatan di sekolah. Mengingat, rentang usia siswa yang masih muda membuat mereka menjadi pembawa virus paling efektif.\n#faktanyagoogle','2020-05-19 18:28:01',5,1,1,1,'2020-05-20 22:48:01','2020-06-08 11:35:27'),
	(158,'faktanyagoogle','https://instagram.com/p/CAXbtPUBqgg',2365108,17652,'Seorang pasien positif corona sempat menggunjuni pasar kaget Bandung, Kecamatan Cibiru. Hal ini dikonfirmasi oleh Camat Cibiru, bahwa ada 8 orang di kecamatannya yang positif corona dan salah satunya pergi ke pasar kaget.\n.\nPasien positif corona ini mengakui ia pergi ke pasar kaget dan membeli buah-buahan. Kini, ia sedang menjalani isolasi mandiri dan pihak kecamatan masih terus mencari orang-orang yang sempat berhubungan dengan pasien tersebut.\n#faktanyagoogle','2020-05-19 17:30:06',4,1,1,1,'2020-05-20 22:48:01','2020-06-08 11:35:21'),
	(159,'faktanyagoogle','https://instagram.com/p/CAXDrOlhfPG',2365108,17569,'Dilansir dari cnnindonesia.com, Masjid Istiqlal, Jakarta Pusat memutuskan secara resmi tak menggelar Salat Idulfitri 1441 Hijriah secara berjamaah seperti tahun-tahun sebelumnya. Keputusan ini karena situasi saat ini masih pandemi virus corona (Covid-19).\n.\nKepala Hubungan Masyarakat dan Protokol Masjid Istiqlal, Abu Hurairah Abdul Salam menyatakan keputusan itu sudah diambil oleh Imam Besar Masjid Istiqlal, Nasaruddin Umar.\n.\n\"Iya bisa dipastikan Istiqlal tidak akan menggelar sholat Idulfitri,\" kata Abu kepada CNNIndonesia.com, Selasa (18/5).\n.\nLebih lanjut, Abu menyatakan Masjid terbesar di Asia Tenggara itu akan tutup dan tak beroperasi saat lebaran atau pada tanggal 1 Syawal 1441 Hijriah tiba.\n.\nAbu menjelaskan salah satu faktor Istiqlal tak menggelar Salat Idulfitri disebabkan penyebaran virus corona masih masif, khususnya di Provinsi DKI Jakarta.\n\"DKI masih zona merah,\" kata dia.\n#faktanyagoogle','2020-05-19 14:00:07',3,1,1,1,'2020-05-20 22:48:01','2020-06-08 11:18:39'),
	(160,'faktanyagoogle','https://instagram.com/p/CAWhYFqBzhH',2365108,36848,'Siapa nih yang udah kangen nonton bioskop? Hmm, saat pandemi corona membuat bioskop-bioskop tutup untuk sementara. Tapi, kini ada rencana unik untuk bisa menonton bioskop yaitu drive-in cinema atau bioskop teater mobil.\n.\nRencana drive-in cinema ini muncul dari perusahaan Ergo and Co. Namun, sampai saat ini timnya sedang mematangkan strategi untuk mengadakan drive-in cinema. Pihak perusahaan juga menyampaikan ingin mengadakan drive-in cinema ini di Bulan Juni, memungkin bisa berjalan jika PSBB ini sedikit lebih longgar.\n#faktanyagoogle','2020-05-19 09:00:25',2,1,1,1,'2020-05-20 22:48:03','2020-06-08 11:18:34'),
	(161,'kumparancom','https://instagram.com/p/CAc_xDtFjLU',951882,2858,'Kalau-kalau terlewat, berikut sederet informasi positif yang layak kamu ketahui.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanNEWS #beritapositif #positivenews #socialdistancing #kuatbersama #thrkumparan #thr #corona #virus #viruscorona #covid #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 21:21:24',5,1,1,1,'2020-05-22 19:57:21','2020-05-23 04:11:22'),
	(162,'kumparancom','https://instagram.com/p/CAcywe-lPAi',951882,2012,'Konten ini merupakan hasil liputan partner resmi #1001MediaOnline kumparan, @tugujogja.id.\n-\nWiwit pandemi virus corona, jumlah keluhan kasus kekerasan marang wanita lan bocah-bocah ing Bantul cenderung mudhun. Angka kasebut dicatet wiwitan wulan Januari, ana 23 aduan utawa laporan keluhan.\n-\nSaiki ing pertengahan Mei, mung ana siji laporan. Kepala Bagian Tata Usaha Unit Pelakasana Teknis Daerah Perlindungan Perempuan dan Anak (UPTD PPA) Kabupaten Bantul Haryani mangsuli hal kasebut.\n•••\nMulai pandemi virus corona, jumlah kasus kekerasan pada wanita dan beberapa anak di Bantul cenderung turun. Angka tersebut tercatat mulai bulan Januari, ada 23 laporan atau keluhan.\n-\nSekarang di pertengahan Mei, hanya ada satu laporan. Kepala Bagian Tata Usaha Unit Pelaksana Teknis Daerah Perlindungan Perempuan dan Anak (UPTD PPA) Kabupaten Bantul Haryani telah konfirmasi hal tersebut.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #pandemi #jogja #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 19:27:44',5,1,1,1,'2020-05-22 19:57:21','2020-06-08 11:18:28'),
	(163,'kumparancom','https://instagram.com/p/CAcZ0a-lp4Y',951882,7685,'Kasus virus corona di Indonesia terus mengalami peningkatan. Pemerintah mengumumkan penambahan 973 pasien positif virus corona, sehingga total pasien positif adalah 20.162 orang.\n-\nSelain itu, ada penambahan 36 pasien yang meninggal, sehingga total pasien positif virus corona yang meninggal mencapai 1.278 orang. Sementara itu, pasien yang sembuh bertambah sebanyak 263 orang, menjadi 4.838 pasien.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pasien #updatepasien #rumahsakit #positifcorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 15:49:49',3,1,1,1,'2020-05-22 19:57:23','2020-05-23 04:10:56'),
	(164,'kumparancom','https://instagram.com/p/CAcQ7ttlBQ7',951882,5005,'Presiden @jokowi telah meluncurkan 55 produk konsorsium hasil riset dan inovasi anak bangsa pada Rabu (20/5). Produk-produk tersebut ditujukan untuk mempercepat penanganan COVID-19 di Indonesia.\n-\nIa pun berharap karya-karya tersebut tak berhenti di laboratorium saja. Riset-riset tersebut harus berlanjut hingga tahap produksi massal untuk memenuhi kebutuhan domestik, bahkan diekspor ke mancanegara.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #jokowi #ventilator #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 14:32:10',3,1,1,1,'2020-05-22 19:57:23','2020-05-23 04:10:50'),
	(165,'kumparancom','https://instagram.com/p/CAcJ6pulDu6',951882,4926,'PT Dirgantara Indonesia dan Institut Teknologi Bandung (ITB) berkerja sama memproduksi ventilator bernama Ventilator Vent-I. Dua institusi ini mengklaim menyanggupi memproduksi 500 unit per minggu atau sekitar 2.000 per bulannya oleh PTDI, usai dilakukan uji klinis.\n-\nProduksi ventilator di dalam negeri tersebut diharapkan bisa mengurangi ketergantungan terhadap impor ventilator yang saat ini sangat dibutuhkan untuk menangani pasien terinfeksi virus corona. Berikut potretnya.\n-\nKredit foto: Antara\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #ventilator #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 13:30:51',3,1,1,1,'2020-05-22 19:57:24','2020-05-23 04:10:42'),
	(166,'kumparancom','https://instagram.com/p/CAcHn9yD3oj',951882,7367,'Warga Bandung dan sekitarnya dihebohkan dengan suara dentuman misterius pada Kamis (21/5) pagi. @bmkgbandung memastikan dentuman itu tak berasal dari gempa bumi.\n-\nSelain itu, Tony memastikan kondisi cuaca di Bandung dan sekitarnya sejak pagi cerah, berawan, dan tidak terjadi hujan disertai petir. Saat ini, pihaknya tengah menyelidiki sumber suara dentuman itu.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #bandung #dentuman #bmkg #cuaca #sains #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 13:11:01',3,1,1,1,'2020-05-22 19:57:24','2020-05-23 04:10:37'),
	(167,'kumparancom','https://instagram.com/p/CAcFsh4FckZ',951882,4189,'Sejumlah warga Bandung mengaku mendengar suara dentuman misterius di wilayah Kota Bandung hingga Kabupaten Bandung pada Kamis, 21 Mei 2020, sekitar pukul 09.30 WIB.\n-\nKepala @bmkgbandung, Tony Agus Wijaya, berkata kondisi cuaca Bandung sekitaran pagi tadi cerah. Maka dari itu, BMKG akan melakukan analisis selain dari faktor gempa, cuaca, dan petir, untuk mengungkap sumber suara dentuman tersebut.\n-\nKredit audio: Twitter rbarkah_.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #bandung #dentuman #bmkg #cuaca #sains #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 12:56:40',2,1,1,1,'2020-05-22 19:57:25','2020-05-23 04:10:33'),
	(168,'kumparancom','https://instagram.com/p/CAb71Y6lLh1',951882,3184,'Menteri Kesehatan Bolivia Marcelo Navajas ditangkap atas dugaan korupsi terkait pembelian ventilator dengan harga tinggi. Marcelo ditahan oleh kepolisian di La Paz, Bolivia.\n-\nSelain Marcelo, pihak kepolisian juga turut mengamankan dua pejabat kementerian kesehatan Bolivia lainnya.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #korupsi #bolivia #pandemi #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 11:27:48',2,1,1,1,'2020-05-22 19:57:25','2020-05-23 04:10:28'),
	(169,'kumparancom','https://instagram.com/p/CAbt93zlzkf',951882,3727,'Pada Minggu (17/5) lalu, Mal CBD Ciledug Kota Tangerang ramai dipenuhi warga yang hendak membeli baju lebaran. Mereka seolah tak mempedulikan untuk tetap menjaga jarak atau di rumah saja saat PSBB.\n-\nInsiden padatnya warga berbelanja di Mal CBD Ciledug tersebut membuat Pemkot Tangerang mengambil langkah tegas. Pemkot Tangerang akhirnya menutup sementara operasional Mal CBD Ciledug pada Rabu (20/5).\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #mall #pandemi #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-21 09:26:38',2,1,1,1,'2020-05-22 19:57:26','2020-05-23 04:10:19'),
	(170,'kumparancom','https://instagram.com/p/CAbQbJkAB3y',951882,9697,'Tuhan yang datang dari Surga dan kembali ke Surga.\nMembawa misi kebaikan bagi umat-Nya.\nHai, para manusia di bumi.\nMari teruskan kebaikan untuk sesama.\n-\nSelamat memperingati kenaikan Yesus Kristus.\nSemoga Tuhan Yesus senantiasa memberkatimu','2020-05-21 05:08:40',1,1,1,1,'2020-05-22 19:57:26','2020-05-23 04:10:15'),
