	(172,'nevertooweird','https://instagram.com/p/CAbmWXAJ6VD',1556759,28000,'But I still don\'t listen.','2020-05-21 08:20:06',2,1,1,1,'2020-05-22 19:57:31','2020-06-08 11:18:15'),
	(173,'faktanyagoogle','https://instagram.com/p/CAcvqI9h2IQ',2364343,23303,'Kamu udah siap-siap bikin kue lebaran belum nih, guys? Hehe, momen Lebaran memang semakin terasa saat ada kue lebaran bikinan sendiri. Namun, beberapa warganet di Twitter justru membagikan postingannya yang gagal membuat kue lebaran.\n.\nKumpulan kue lebaran yang gagal ini, justru membuat warganet ngakak. Pasalnya, tampilan kue ini unik banget, mulai dari ulat gosong, nastar cap kaki, hingga kue pocong mumun. Hahaha ada-ada aja.. tapi tetap semangat untuk coba bikin kue lebaran lagi ya, guys. Belajar dari kesalahan! Hehe~\n#faktanyagoogle','2020-05-21 19:00:39',5,1,1,1,'2020-05-22 19:57:34','2020-05-23 04:10:09'),
	(174,'faktanyagoogle','https://instagram.com/p/CAclWaBhEMQ',2364343,22493,'Warga Montemorelos di Meksiko dibikin geger dengan turunnya hujan es yang bentuknya mirip dengan virus corona. Warga setempat pun memposting hujan es ini ke media sosial dan ramai jadi perbincangan warganet.\n.\nPartikel virus corona pada manusia biasanya digambarkan berbentuk bulat dan memiliki tonjolan-tonjolan mirip duri. Begitu juga dengan bentu hujan es ini, bentuknya bulan dan seperti berduri di bagian luarnya. Sebagian warga di Meksiko percaya hujan es batu yang mirip virus corona ini merupakan peringatan dari Tuhan. Mereka menganggap bahwa Tuhan mengirimkannya untuk mengingatkan agar tetap tinggal di rumah.\n#faktanyagoogle','2020-05-21 17:30:34',4,1,1,1,'2020-05-22 19:57:34','2020-05-23 04:10:04'),
	(175,'faktanyagoogle','https://instagram.com/p/CAcGc81h9ym',2364343,33704,'Belum lama, beberapa daerah terlihat mall-nya bejubel pembeli demi belanja jelang Lebaran. Suasana ramainya mall juga sempat viral di sosial media dan jadi perbincangan hangat warganet. Kabarnya, salah satu mall di Medan ternyata kasirnya positif corona. Hal ini membuat para pembeli dilanda ketakutan.\n.\nMall tempat kasir positif virus corona ini sempat ramai dikunjungi meski di tengah pandemi. Kini setelah adanya laporan satu orang kasir positif virus corona, seluruh karyawan mall diwajibkan melakukan rapid test.\n#faktanyagoogle','2020-05-21 13:00:35',3,1,1,1,'2020-05-22 19:57:34','2020-05-23 04:09:58'),
	(176,'faktanyagoogle','https://instagram.com/p/CAcCpgJB1wF',2364343,28087,'Dilansir dari antaranews.com, Ketua Gugus Tugas Percepatan Penanganan COVID-19 sekaligus Kepala Badan Nasional Penanggulangan Bencana (BNPB) Doni Monardo menyatakan masyarakat harus bersiap menghadapi tantangan hidup dengan COVID-19 karena sampai sekarang belum diketahui kapan pandemi akan berakhir.\n.\n\"Sejauh ini belum ada lembaga yang berani mengatakan kapan COVID-19 akan berakhir, termasuk juga belum ada kepastian kapan vaksin akan ditemukan sehingga sangat mungkin kita akan selamanya hidup dengan COVID-19,\" kata Doni di Jakarta, Senin, usai mengikuti rapat melalui telekonferensi video perihal penanganan pandemi.\n.\nDia mengatakan masyarakat harus bersiap hidup dengan kondisi yang baru, yang dia sebut sebagai \"normal baru\".\n.\n\"Upaya atau strategi menghadapi tantangan new normal (normal baru). Gugus Tugas sudah memberikan beberapa masukan, pertama tentang pentingnya prakondisi melalui survei, kajian riset, kemudian juga waktu yang tepat kapan harus dimulai (new normal) dilihat dari data lapangan. Bapak Presiden sudah perintahkan untuk mengkaji daerah mana yang boleh dibuka,\" kata Doni.\n#faktanyagoogle','2020-05-21 12:27:21',2,1,1,1,'2020-05-22 19:57:35','2020-05-23 04:09:48'),
	(177,'humasprovjatim','https://instagram.com/p/CAfmgNwAq8Q',26398,215,'Ekstensifikasi pelayanan masyarakat terus dilakukan oleh Pemprov Jawa Timur guna penanganan pasien Covid-19 yang terus meningkat.\n.\n Setelah sebelumnya dilakukan penambahan kapasaitas bed hingga ventilator di berbagai rumah sakit rujukan, kali ini, Gubernur Jatim, Khofifah Indar Parawansa, meninjau langsung kesiapan Rumah Sakit Darurat Covid-19 Jatim dan meminta agar bisa segera dioperasikan.\n.\nDengan total kapasitas saat ini mencapai 200 orang, dan bisa di maksimalkan sampai 500 orang ,  RS Lapangan Covid-19 Jatim yang didirikan di Gedung Pusat Penelitian dan Pengembangan Pelayanan Kesehatan Jl. Indrapura no. 17 Surabaya ini rencananya diperuntukkan bagi pasien konfirmasi positif baru yang terkategori ringan. .\n.\nGubernur Khofifah menyebut bahwa kapasitas tersebut akan terus dimaksimalkan hingga bisa mencapai 500 orang pasien.\n.\n\"Yang kita ingin bahwa yang di RS rujukan itu yang kondisi berat, yang ringan dan sedang seyogyanya kita siapkan di rumah sakit  lapangan seperti sekarang. Kalau total dengan ekstensifikasi kamar-kamar itu semua, bisa sampai 500 bed,\" ungkap Gubernur Khofifah seusai meninjau langsung pembangunan RS Lapangan Covid-19 Jatim pada Jum’at (22/5) siang.\n.\n.\n#khofifah\n#emil\n#arumi\n#jawatimur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n@khofifah.ip \n@emildardak','2020-05-22 21:38:22',5,1,1,1,'2020-05-23 18:06:32','2020-06-08 11:18:10'),
	(178,'humasprovjatim','https://instagram.com/p/CAeYEhtA-Dk',26398,187,'​Berbagai upaya dan dukungan terus dilakukan oleh Pemprov Jawa Timur untuk bisa memaksimalkan pelayanan penanganan Covid-19 di rumah sakit.\n.\n​Kali ini, Gubernur Jawa Timur, @khofifah.ip menyerahkan 40 Ventilator dan Continous Positive Airway Pressure (CPAP) kepada 20 Rumah Sakit Rujukan di Jawa Timur, di Gedung Negara Grahadi, Surabaya, Rabu (20/5) malam.\n.\n​Selain Ventilator, juga diserahkan bantuan Alat Pelindung Diri bagi para tenaga medis dan paramedis antara lain berupa hazmat, face shield, masker, gloves, dan disinfektan.\n​Ke 20 rumah sakit yang mendapat bantuan tersebut diantaranya yaitu, Rumkital dr. Ramelan Surabaya, RSUD Sidoarjo, RSUD dr. Iskak Tulungagung, RSUD Gambiran Kediri,  RSUD Dr. Soegiri Lamongan, dan RS Bhayangkara Surabaya.\n.\n​\"Dengan adanya bantuan tambahan ventilator ini, maka per hari ini total kapasitas ventilator isolasi di Jatim mencapai 162. Atau naik 6 kali lipat dari 20 Maret dengan jumlah awal sebanyak 26 ventilator,\" terang Gubernur Jatim yang akrab disapa Khofifah.\n.\n#khofifah\n#emil\n#arumi\n#jawa timur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n@khofifah.ip \n@emildardak','2020-05-22 10:13:01',2,1,1,1,'2020-05-23 18:06:32','2020-06-08 11:18:02'),
	(179,'humasprovjatim','https://instagram.com/p/CAeWwUQgXuY',26398,181,'Pemerintah Provinsi Jawa Timur membagikan  paket sembako  dan uang tunai 200 ribu  untuk tiga bulan secara door to door atau dari rumah ke rumah kepada warga Jatim di wilayah Jabodetabek.\n.\n​Cara ini ditempuh, guna menghindari kerumunan warga. Adapun paket sembako tersebut berisi beras, minyak goreng, mie instan, gula, masker, dan hand sanitizer. Penerima paket sembako tersebut merupakan warga Jatim yang tidak  mudik ke kampung halaman dan terdampak secara ekonomi akibat pandemi Covid-19.\n.\n​Selain Paket Sembako, Pemprov Jatim juga memberikan uang tunai sejumlah Rp200 ribu per kepala keluarga yang merupakan program jaring pengaman sosial. Uang tunai tersebut akan diberikan selama tiga bulan kedepan hingga Juli 2020.\n.\n​\"Bantuan berangkat langsung dari Surabaya, Senin (18/5) dan sampai di Jakarta Selasa (19/5), selanjutnya langsung dibagikan secara door to door oleh Badan Penghubung Daerah Provinsi Jatim di Jakarta,\" ungkap Gubernur Jawa Timur, @khofifah.ip .\n.\n#khofifah\n#emil\n#arumi\n#jawa timur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n@khofifah.ip \n@emildardak','2020-05-22 10:01:31',2,1,1,1,'2020-05-23 18:06:32','2020-06-08 11:17:54'),
