	(181,'kumparancom','https://instagram.com/p/CAfdn5-F7VF',952724,5501,'Sidang isbat yang berlangsung hari ini, Jumat (22/5) menetapkan bahwa 1 Syawal 1441 H jatuh pada hari Minggu (24/5). Pemerintah mengimbau agar masyarakat menjalankan ibadah di rumah masing-masing untuk meminimalisir penularan virus corona.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #lebaran #idulfitri #syawal #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 20:20:47',5,1,1,1,'2020-05-23 18:06:42','2020-06-08 11:17:33'),
	(182,'kumparancom','https://instagram.com/p/CAfC-21FhET',952724,3268,'Juru bicara pemerintah untuk penanganan COVID-19, Achmad Yurianto, mengatakan pada Jumat ini masih terdapat penambahan 634 kasus positif. Sehingga total kasus positif corona menjadi 20.796 dari sebelumnya 20.162.\n-\nSementara itu, pasien yang meninggal juga masih bertambah sebanyak 48 orang. Sehingga total kasus meninggal sebanyak 1.326 pasien dari sebelumnya 1.278 orang. Kabar baiknya, terdapat tambahan 219 pasien yang sembuh. Sehingga total pasien yang sembuh sebanyak 5.057 dari sebelumnya 4.838 orang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #pandemi #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 16:27:59',4,1,1,1,'2020-05-23 18:06:45','2020-06-08 11:17:27'),
	(183,'kumparancom','https://instagram.com/p/CAfAXYellEl',952724,3087,'Menurut Psikolog Anak dan Keluarga Anna Surti Ariani, agar kondisi keluarga tetap harmonis di tengah pandemi, perlu ada privasi atau batasan yang harus disepakati dengan pasangan. Hal ini tentunya akan menciptakan rasa nyaman bagi kedua pihak.\n-\nSimak penjelasan selengkapnya dalam #VirtualTalk4 bersama Psikolog Anak dan Keluarga, @annasurtinina, dan Momfluencer, @reinitaarlin di kum.pr/virtualtalk4.\n-⁠\n#kumparanMOM #virtualtalk4 #virtualtalk #mom #pandemi #keluarga #tipskeluarga #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 16:05:07',4,1,1,1,'2020-05-23 18:06:45','2020-06-08 11:17:20'),
	(184,'kumparancom','https://instagram.com/p/CAe6Uyoldn9',952724,4120,'Konten ini merupakan hasil liputan partner resmi #1001MediaOnline, @panturapostcom.\n-\nWong-wong sing pada blanja nang mal lan pasar tradisional Kota Tegal saiki bakal dipriksani petugas seka Dinas Kesehatan (Dinkes), Selasa (19/5). Langkah kiye eben virus corona ora nyebar nang nang ndi-ndi ora.\n•••\nPengunjung di pusat perbelanjaan Kota Tegal secara acak diminta menjalani rapit test oleh petugas dari Dinas Kesehatan (Dinkes) setempat, Selasa (19/5). Langkah ini dilakukan untuk mencegah penyebaran corona.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #pandemi #mal #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 15:12:20',3,1,1,1,'2020-05-23 18:06:45','2020-06-08 11:17:11'),
	(185,'kumparancom','https://instagram.com/p/CAe11UUFKOn',952724,4210,'Kepala Suku Dinas Pertamanan dan Hutan Kota Jakarta Barat, Jauhar Arifin, mengatakan di Lebaran ini, ziarah kubur masih diizinkan. Namun, dengan menerapkan protokol kesehatan.\n-\nSelama ziarah kubur, warga harus memastikan adanya social distancing, dan diwajibkan menggunakan masker. Selain itu, jumlah peziarah pun akan dibatasi dan akan dipantau oleh petugas pamdal dan penjaga makam.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pemerintah #pandemi #ziarah #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 14:33:05',3,1,1,1,'2020-05-23 18:06:46','2020-06-08 11:17:04'),
	(186,'kumparancom','https://instagram.com/p/CAevAFxFuBh',952724,3597,'PT Fast Food Indonesia Tbk (FAST) sebagai pemegang lisensi gerai @kfc telah melakukan penutupan terhadap 115 gerai di seluruh Indonesia.\n-\nSelain itu, ada sebanyak 4.988 karyawan yang dirumahkan. Pihak manajemen mengakui ekonomi perusahaan terganggu akibat mewabahnya pandemi virus corona.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanBISNIS #kuatbersama #dirumahaja #pemerintah #kfc #pandemi #pasiencorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 13:33:23',3,1,1,1,'2020-05-23 18:06:47','2020-06-08 11:16:53'),
	(187,'kumparancom','https://instagram.com/p/CAetX07Furs',952724,15185,'M Nuh, pemenang lelang motor listrik Gesits bertanda tangan Presiden @jokowi mendadak bingung karena ditagih uang sebesar Rp 2,5 M. Sebelumnya, Nuh memang mengaku telah mengikuti acara tersebut, namun, ia mengira acara itu adalah undian sepeda motor, bukan pelelangan.\n-\nKendati demikian, Kabid Humas Polda Jambi Kombes Pol Kuswahyudi Tresnadi mengatakan, Nuh tidak ditahan. Ia hanya diwawancara oleh pihak kepolisian, setelah itu Nuh dipersilakan pulang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pasien #motorjokowi #lelang #positifcorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 13:19:09',3,1,1,1,'2020-05-23 18:06:47','2020-06-08 11:10:21'),
	(188,'kumparancom','https://instagram.com/p/CAeoo0Ulj5U',952724,3531,'Sebelumnya, pemerintah telah melarang warga untuk mudik demi mencegah penyebaran wabah virus corona semakin meluas. Meski begitu, tak sedikit masyarakat yang tetap nekat mudik. Karenanya, pihak kepolisian pun bersiaga di titik pemeriksaan pemudik, salah satunya di ruas tol Cikopo-Palimanan.\n-\nSetiap kendaraan yang melintas di pintu Tol Cikopo-Palimanan satu persatu diperiksa petugas. Jika terindikasi hendak mudik, mereka akan langsung diminta putar balik ke titik awal perjalanan. Berikut potretnya.\n-\nKredit foto: ANTARA FOTO/Nova Wahyudi.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pasien #tolcipali #psbb #positifcorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 12:37:47',2,1,1,1,'2020-05-23 18:06:47','2020-06-08 11:10:15'),
	(189,'kumparancom','https://instagram.com/p/CAec58Vnlda',952724,6192,'Pemkot Tegal berencana pada hari ini, Jumat (22/5), akan menutup PSBB Kota Tegal, Jawa Tengah.\n-\nPSBB yang digelar sejak 23 April akan ditutup dengan penyemprotan disinfektan dengan helikopter dan water canon, penyalaan sirene, dan kembang api di pusat kota. Hal ini dibenarkan oleh Sekretaris Daerah Tegal Johardi.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pasien #tegal #psbb #positifcorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-05-22 11:00:22',2,1,1,1,'2020-05-23 18:06:47','2020-06-08 11:10:09'),
	(190,'nevertooweird','https://instagram.com/p/CAeLJFyj4BW',1557223,40542,'When did you hit that age?','2020-05-22 08:20:04',2,1,1,1,'2020-05-23 18:06:54','2020-06-08 11:10:03'),
	(191,'faktanyagoogle','https://instagram.com/p/CAfcc_PBeKO',2364038,28394,'Sujono, warga Desa Pojok Sari, Magetan, terpaksa menjual blender miliknya untuk membeli beras. Pria berusia 40 tahun ini sehari-hari bekerja sebagai penjual pentol, tapi karena Covid19 ia tak bisa berdagang selama 3 bulan.\n.\nVideo yang beredar sempat viral saat Sujono menawarkan blender miliknya pada pengendara yang melintas di jalan. Saat ada orang yang membantu, orang tersebut memberi uang Rp 100 ribu dan meminta Sujono menyimpan blendernya kembali.\n#faktanyagoogle','2020-05-22 20:10:33',5,1,1,1,'2020-05-23 18:06:57','2020-06-08 11:09:58'),
	(192,'faktanyagoogle','https://instagram.com/p/CAfGti6hXnJ',2364038,28478,'Larangan mudik Lebaran yang diberlakukan oleh pemerintah, nyatanya tak berjalan dengan mulus. Banyak sekali masyarakat yang nekat mudik dengan berbagai macam modusnya. Namun, jangan senang dulu. Pasalnya, pihak kepolisan serta Pemprov DKI telah memastikan bahwa pemudik yang sudah berada di kampung halaman akan sulit kembali ke Jakarta usai Lebaran.\n.\nDilansir dari kompas.com, Kabag Ops Korlantas Polri Kombes Benyamin mengatakan, akan ada proses penyekatan yang dilakukan saat arus balik atau usai Lebaran untuk menyaring pendatang yang akan masuk ke Jabodetabek.\n.\n\" Larangan mudik sudah menjadi kebijakan dari pemerintah, jadi saat arus mudik dan ketika arus balik kembali, kami tetap adakan penyekatan-penyekatan. Tujuannya agar mereka tidak bisa masuk ke Jakarta, buat yang sudah mudik, akan susah kembali ke Jakarta,\" ujar Benyamin saat berbincang dalam program Otolive bersama Kompas.com, Rabu (21/5/2020).\n#faktanyagoogle','2020-05-22 17:00:34',4,1,1,1,'2020-05-23 18:06:58','2020-06-08 11:09:51'),
	(193,'faktanyagoogle','https://instagram.com/p/CAeyHeihvKx',2364038,39229,'Wakil Presiden Ma\'ruf Amin menyampaikan permintaan maaf dan akui kesulitan menghadapi virus corona. Melansir laman cnnIndonesia, Ma\'ruf menyampaikan permintaan maaf karena corona belum hilang sampai saat ini. Wilayah Indonesia yang sangat luas dan besarnya jumlah penduduk disampaikan oleh Ma\'ruf menjadi kesulitan tersendiri untuk menghadapi wabah ini.\n.\nMa\'ruf mengimbau masyarakat untuk tetap menjaga kesehatan. Ia juga menyatakan dalam waktu dekat pemerintah akan menggulirkan kembali kegiatan perekonomian agar bisa kembali seperti semula.\n#faktanyagoogle','2020-05-22 14:00:37',3,1,1,1,'2020-05-23 18:06:58','2020-06-08 11:09:45'),
	(194,'humasprovjatim','https://instagram.com/p/CA9Ggbgpv_L',27256,338,'Gubernur Jawa Timur Khofifah Indar Parawansa bersama Kepala Badan Nasional Penanggulangan Bencana (BNPB) Letnan Jenderal TNI Doni Monardo dan Menteri Kesehatan RI Letnan Jenderal TNI (Purn) Terawan Agus Putranto secara langsung meresmikan Rumah Sakit (RS) Lapangan Covid-19 Pemprov Jatim, yang berada di Jl. Indrapura, Surabaya, Selasa(2/6) sore.\n.\nPeresmian tersebut ditandai dengan pemecahan kendi tepat di depan pintu masuk ke RS Lapangan Covid-19 yang dilakukan oleh Kepala BNPB Letjend TNI Doni Monardo yang juga merupakan Ketua Gugus Pusat Penanganan Covid-19, didampingi oleh Gubernur Khofifah dan Menkes Terawan.\n.\nPer hari Selasa (2/6) RS Lapangan Covid-19 ini, telah memasuki hari ketiga operasional. Dimana, sudah terdapat 23 orang pasien positif Covid-19 dengan kondisi ringan hingga sedang yang berdomisili di Surabaya. Dengan rincian, 13 orang pasien perempuan dan 10 orang pasien laki-laki.\n.\nDalam sambutannnya, Kepala BNPB Letjen TNI Doni Monardo menyampaikan, apresiasinya kepada Gubernur Khofifah atas gagasannya untuk mendirikan RS Lapangan Covid-19 yang diperuntukkan bagi pasien positif dengan indikasi ringan hingga sedang. Menurutnya, ini sangat penting karena akan bisa mengurangi beban RS rujukan. .\n.\n#khofifah\n#emil\n#arumi\n#jawatimur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n@khofifah.ip \n@emildardak','2020-06-03 08:36:00',2,1,1,1,'2020-06-04 21:34:16','2020-06-08 10:59:18'),
