	(198,'kumparancom','https://instagram.com/p/CA-Gg22HB-K',964253,10190,'Gregory Wong, pria yang dikenal sebagai selebgram menyamar menjadi Garda Nasional AS di tengah-tengah kerusuhan. @gregorywong (31) diketahui menumpang Uber sambil membawa senapan. Dia kemudian memutari kota Los Angeles yang tengah membara akibat protes atas kematian George Floyd. Wong lantas berhenti di sekitar jalanan yang tengah dijaga Garda Nasional AS.⁠\n-⁠\nAksinya dipergoki oleh sejumlah anggota Garda Nasional. Setelah diinterogasi, polisi menangkap Wong pada Selasa (3/6) dini hari atas tuduhan perakitan atau pendistribusian senjata tempur. ⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #amerika #unjukrasa #derekchauvin #demonstran #georgefloyd #as #demo #amerikaserikat #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 18:00:56',5,1,1,1,'2020-06-04 21:34:27','2020-06-08 10:48:58'),
	(199,'kumparancom','https://instagram.com/p/CA-BisEHjfE',964253,16470,'Majelis Hakim Pengadilan Tata Usaha Negara Jakarta menyatakan pemerintah melakukan perbuatan melanggar hukum terkait pemblokiran internet di Papua dan Papua Barat pada pertengahan 2019 lalu.⁠\n-⁠\nPemerintah dalam hal ini ialah Presiden yang menjadi pihak Tergugat 1 serta Menteri Komunikasi dan Informatika selaku pihak Tergugat 2. Gugatan diajukan oleh Aliansi Jurnalis Independen (AJI) serta Pembela Kebebasan Berekspresi Asia Tenggara (SAFEnet). Mereka menggugat Presiden serta Menteri Komunikasi dan Informatika.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #papua #pemerintah #menkominfo #internet #ptun #papuabarat #presiden #ptun #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 17:16:56',4,1,1,1,'2020-06-04 21:34:27','2020-06-08 10:48:24'),
	(200,'kumparancom','https://instagram.com/p/CA-AGjAl3sk',964253,5796,'Insiden menghebohkan terjadi di Delhi, India. Kawanan monyet dilaporkan menyerang petugas laboratorium di Meerut Medical College dan membawa lari sejumlah sampel tes virus corona.\n-\nMonyet-monyet itu mengambil sampel tes COVID-19 dari tiga pasien dan melarikan diri. Kemudian, salah satu monyet terlihat sedang bergelantung di pohon sembari mengunyah sampel tes virus tersebut.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanSAINS #kuatbersama #dirumahaja #newnormal #coronavirus #monyet #india #sampel #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 16:59:17',4,1,1,1,'2020-06-04 21:34:27','2020-06-08 10:47:28'),
	(201,'kumparancom','https://instagram.com/p/CA98i1EFztL',964253,3747,'Daerah mana yang bisa menerapkan new normal terlebih dahulu?\n-\nAda tiga kriteria yang harus dipenuhi setiap daerah sebelum menerapkan new normal, salah satunya adalah indeks penularan virus corona atau Reproduksi Efektif (Rt) di bawah angka 1. Maka, jika ingin menerapkan new normal, maka angka Rt di wilayah tersebut harus di bawah 1. Angka ini berarti kasus baru di daerah tersebut sudah turun setidaknya dua pekan berturut-turut.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #coronavirus #perekonomian #coronaindonesia #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 16:28:11',4,1,1,1,'2020-06-04 21:34:27','2020-06-08 10:46:08'),
	(202,'kumparancom','https://instagram.com/p/CA94MlwFQve',964253,3834,'Per Rabu (3/6) pukul 12.00 WIB, jumlah pasien positif bertambah 684 orang, sehingga total kini ada 28.233 terjangkit corona. Jumlah pasien positif COVID-19 yang meninggal pun bertambah 35 orang. Sehingga jumlah pasien meninggal menjadi 1.698 orang. Kabar baiknya, jumlah pasien virus corona yang sembuh bertambah 471 orang, menjadi 8.406 orang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #coronavirus #perekonomian #phk #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 15:50:12',3,1,1,1,'2020-06-04 21:34:28','2020-06-08 10:44:57'),
	(203,'kumparancom','https://instagram.com/p/CA9otYcHp7o',964253,3882,'Menurut Prof. Pratiwi Sudarmomo ahli mikrobiologi dari Fakultas Kedokteran Universitas Indonesia (FKUI), kemungkinan munculnya gelombang kedua bisa saja terjadi pasca-Lebaran.⁠\n-⁠\nKemungkinan itu ditambah dengan masuknya tenaga kerja dari luar negeri ke Indonesia. Mobilitas masyarakat yang tinggi ini patut diwaspadai, karena SARS-CoV-2 yang tergolong virus RNA memiliki kemampuan untuk bermutasi terus menerus dari waktu ke waktu. Hal itu didukung pula dengan diabaikannya perintah physical distancing oleh masyarakat.⁠\n-⁠\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanSAINS #kuatbersama #dirumahaja #gelombangkedua #newnormal #corona #coronavirus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 13:39:48',3,1,1,1,'2020-06-04 21:34:28','2020-06-08 10:44:17'),
	(204,'kumparancom','https://instagram.com/p/CA9dtjnFjSr',964253,28786,'Di tengah kemarahan massa yang meluber di jalanan, para anggota kepolisian Amerika Serikat mencoba menunjukkan sikap solidaritasnya terhadap para demonstran. Salah satunya dengan berlutut di hadapan para pendemo. Selain berlutut petugas kepolisian pun saling menyapa dengan demonstran.\n-\nAksi tersebut dilakukan sebagai tanda bahwa mereka memahami kemarahan massa terhadap kematian George Floyd. Berikut potretnya.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #amerika #unjukrasa #derekchauvin #demonstran #georgefloyd #as #demo #amerikaserikat #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 11:58:46',2,1,1,1,'2020-06-04 21:34:28','2020-06-07 23:14:36'),
	(205,'kumparancom','https://instagram.com/p/CA9WtuPFXtF',964253,5341,'Pemprov DKI akan melakukan karantina lokal terhadap 62 RW di Jakarta usai PSBB berakhir pada 4 Juni. Langkah karantina itu dilakukan karena penularan virus corona di 62 RW tersebut masih tinggi. Pemprov DKI bersama pihak terkait masih membahas lebih lanjut mengenai teknis karantina lokal.\n-\n\"Ada 62 RW. PSBL itu di tingkat RW karena tingkat percepatan penularan yang masih tinggi. Detailnya ada di Dinas Kesehatan,\" kata Deputi Gubernur Bidang Pengendalian Kependudukan dan Permukiman DKI Jakarta, Suharti.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #psbb #psbl #dkijakarta #coronavirus #rumahibadah #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 10:57:37',2,1,1,1,'2020-06-04 21:34:29','2020-06-07 23:12:53'),
	(206,'kumparancom','https://instagram.com/p/CA9JTvGIYPt',964253,4276,'Laron kawin dengan pasangan yang sama seumur hidup lho, gaes!⁠\n-⁠\nUsai mendapat pasangan yang cocok, laron akan menanggalkan sayapnya dan turun kembali ke tanah, untuk membuat sarang baru. Di sarang baru itulah raja dan ratu menghasilkan telur-telur yang akan jadi koloni generasi selanjutnya.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanSAINS #laron #faktalaron #hewanunik #hewan #faktahewan #sains #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-03 09:00:50',2,1,1,1,'2020-06-04 21:34:29','2020-06-07 22:43:28'),
	(207,'faktanyagoogle','https://instagram.com/p/CA-U4EkHrbX',2358331,46162,'Pemerintah Rusia resmi melaporkan adanya kutu mutan baru yang menghisap darah. Keberadaan kutu mutan ini menjadi kekhawatiran di tengah mewabahnya virus Corona yang membuat rumah sakit kewalahan. Kini, kasus kutu mutan di Rusia Tengah telah mencapai 8.215, di mana 2.125 kasus melibatkan anak-anak.\n.\nDilansir dari suara.com, hampir dua persen orang yang tergigit membawa ensefalitis viral tick-borne, yang dapat menyebabkan kerusakan otak permanen, dan sepertiga mampu menularkan tick-borne borreliosis atau penyakit Lyme yang menyerang sendi, jantung, dan sistem saraf.\n#faktanyagoogle','2020-06-03 20:00:48',5,1,1,1,'2020-06-04 21:34:36','2020-06-07 22:42:53'),
	(208,'faktanyagoogle','https://instagram.com/p/CA-FWfDBkJB',2358331,30558,'Sejak 4 hari terakhir, Kota Surabaya terlihat berwarna hitam dalam peta sebaran Covid19 di Jawa Timur. Angka kasus corona di Jawa Timur tengah jadi sorotan karena angka kasus harian yang tinggi, mengungguli Jakarta.\n.\nSebelumnya, Kota Surabaya memang sempat ditakutkan akan menjadi wilayah dengan sebaran corona tertinggi di Indonesia. Pasalnya sebesar 65 persen pasien Covid-19 di Jawa Timur, disumbang oleh tiga daerah yakni Kota Surabaya, Kabupaten Sidoarjo dan Kabupaten Gresik. Hingga Selasa (2/6/2020) malam, kasus Covid19 di Surabaya telah mencapai 2.748 kasus.\n#faktanyagoogle','2020-06-03 17:45:09',4,1,1,1,'2020-06-04 21:34:36','2020-06-07 22:41:59'),
	(209,'faktanyagoogle','https://instagram.com/p/CA9gXEvhgmr',2358331,39662,'Aliansi Badan Eksekutif Mahasiswa Seluruh Indonesia (BEM SI) dan para mahasiswa ramaikan tagar #MendikbudDicariMahasiswa di Twitter. BEM SI dan para mahasiswa ini meminta untuk bertemu Mendikbud Nadiem Makarim untuk mendiskusikan terkait pemangkasan uang kuliah tunggal (UKT).\n.\nHal ini dilakukan karena penurunan uang kuliah dianggap genting. Kondisi ekonomi sebagian besar orang tua mahasiswa menurun selama pandemi Corona. Selain itu, kebutuhan pulsa menjadi kebutuhan tambahan di tengah pandemi ini. Dalam satu pekan mahasiswa menggunakan kuota internet berkisar Rp 25-500 ribu untuk kuliah online. Ini menambah beban keadaan ekonomi keluarga mahasiswa tersebut di saat krisis Corona.\n#faktanyagoogle','2020-06-03 12:21:55',2,1,1,1,'2020-06-04 21:34:36','2020-06-07 22:40:44'),
	(210,'faktanyagoogle','https://instagram.com/p/CA9QIMQhoJ4',2358331,25163,'Saat ini tenaga medis menjadi garda terdepan dalam penanganan virus Corona. Namun, dokter yang sedang hamil 7 bulan ini jadi perhatian publik karena tetap rawat pasien Corona. Ia mengaku ingin membantu para pasien di daerah itu yang mayoritas berpenghasilan rendah.\n.\nZafia Anklesaria, tetap menjalankan tugasnya di Dignity Health California Hospital Medical Center, Los Angeles. Ia merupakan kepala dari perawatan intensif di rumah sakit tersebut. Wanita yang berusia 35 tahun ini tak bisa tinggal diam melihat pandemi Corona ini. Apalagi, orang-orang yang memiliki penghasilan rendah cenderung tak bisa menerapkan sosial distancing yang akhirnya terinfeksi.\n.\nMeskipun ia mengerjakan tugas yang berat saat hamil, tapi teman-teman perawatnya sangat perhatian dan menjaganya. Suaminya juga ikut khawatir saat melihat istrinya menjalani tugas saat hamil, tapi Zafia bersyukur suaminya bisa mengerti.\n#faktanyagoogle','2020-06-03 10:00:04',2,1,1,1,'2020-06-04 21:34:37','2020-06-07 22:39:11'),
	(211,'kumparancom','https://instagram.com/p/CBA9xn8lLJk',965165,2762,'Dalam masa PSBB transisi di Jakarta ini, Gubernur DKI Jakarta Anies Baswedan mulai melonggarkan seluruh sektor untuk kembali beraktivitas secara terbatas. Meski begitu, ada 66 RW dari total 2.738 RW di Jakarta yang akan dikarantina lokal. Berikut daftarnya.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #karantinalokal #psbb #psbl #aniesbaswedan #dkijakarta #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 13:36:40',3,1,1,1,'2020-06-05 10:00:26','2020-06-07 21:54:48'),
