	(213,'kumparancom','https://instagram.com/p/CBAn8JeHhCr',965165,11492,'Pasangan selebriti Raffi Ahmad dan Nagita Slavina baru-baru ini mengeluhkan tingginya tagihan listrik PLN yang mencapai Rp 17 juta per bulan.\n-\nMenjawab hal itu, Manager PLN Unit Pelaksana Pelayanan Pelanggan Ciputat, Sigit Arimurti, menjelaskan biaya konsumsi listrik di rumah Raffi Ahmad masih dalam batas wajar. Apalagi, Nagita juga mengakui kepada petugas bahwa ada banyak peralatan elektronik di rumahnya.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanBISNIS #pln #artis #raffiahmad #nagitaslavina #listrik #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-04 10:31:14',2,1,1,1,'2020-06-05 10:00:26','2020-06-07 21:53:09'),
	(214,'kumparancom','https://instagram.com/p/CBAnccfl-sR',965165,2979,'Masjid Istiqlal belum akan menggelar salat Jumat berjemaah, meski Pemprov DKI Jakarta telah mengizinkan pembukaan kembali masjid mulai Jumat (5/6) seiring dimulainya PSBB masa transisi.\n-\nKepala Humas dan Protokol Masjid Istiqlal, Abu Hurairah, mengatakan Masjid Istiqlal belum membuka masjid dalam waktu dekat, termasuk untuk salat Jumat. Kemungkinan masjid baru akan dibuka Juli setelah renovasi selesai.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #psbbjakarta #psbb #masker #maljakarta #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 10:21:32',2,1,1,1,'2020-06-05 10:00:26','2020-06-05 12:07:19'),
	(215,'kumparancom','https://instagram.com/p/CBAlMB2lsyB',965165,3515,'Gugus Tugas Percepatan penanganan COVID-19 Kota Batam Kepulauan Riau mengkonfirmasi terdapat 11 pasien baru pada Rabu (3/6). Lima di antaranya merupakan satu keluarga yang tertular dari pasien 100.\n-\nKetua Gugus Tugas Batam Muhammad Rudi menuturkan, kelima pasien tersebut tertular virus corona ketika silaturahmi dengan pasien 100 saat Idul Fitri kemarin.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #keluarga #batam #silahturahmi #lebaran #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 10:01:49',2,1,1,1,'2020-06-05 10:00:26','2020-06-05 12:06:47'),
