	(217,'kumparancom','https://instagram.com/p/CBAcO6SlwdN',965165,9589,'Hari ini, Kamis (4/6), Gubernur DKI Jakarta @aniesbaswedan memutuskan bahwa Jakarta akan memperpanjang status PSBB sebagai masa transisi. Lantas, seperti apa ketentuannya? Begini rinciannya.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #masatransisi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 08:43:34',2,1,1,1,'2020-06-05 10:00:27','2020-06-05 12:04:38'),
	(218,'kumparancom','https://instagram.com/p/CBAaNy1Hpw0',965165,2868,'Merebaknya virus corona di Indonesia berimbas pada terganggunya industri penerbangan. Salah satunya Susi Air, yang harus menutup 99 persen penerbangannya.\n-\nPemilik Susi Air yang juga mantan Menteri Kelautan dan Perikanan, @susipudjiastuti115, mengaku bahwa dampak pandemi membuat seluruh operasional bisnis maskapai nyaris berhenti total.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.\n-\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #pesawat #susiair #phk #susipudjiastuti #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 08:30:54',2,1,1,1,'2020-06-05 10:00:27','2020-06-05 12:03:56'),
	(219,'kumparancom','https://instagram.com/p/CBAadaQg8L7',965165,8802,'Youtuber Ferdian Paleka dan dua rekannya yakni M. Aidil dan Tubagus Fahddinar dipastikan bebas dari tahanan setelah para korban mencabut laporannya.⁠\n-⁠\nKasatreskrim Polrestabes Bandung AKBP Galih Indragiri membenarkan hal tersebut. Menurut Galih, korban mencabut laporannya pada pekan lalu. Hal itu menjadi dasar polisi untuk membebaskan para tahanan. ⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #ferdianpaleka #ferdian #youtuber #bandung #polisi #tahanan #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 08:28:14',2,1,1,1,'2020-06-05 10:00:27','2020-06-05 12:03:08'),
	(220,'kumparancom','https://instagram.com/p/CBASEDeF-AS',965165,2968,'Gubernur DKI Jakarta, Anies Baswedan, mengingatkan agar masyarakat tetap disiplin menjalankan protokol COVID-19. Sebab jika tidak, maka angka lonjakan kasus akan kembali seperti bulan Mei 2020.\n-\nPenyebaran corona di Jakarta sudah terkendali, namun Gubernur Anies Baswedan tetap memperpanjang PSBB di Jakarta hingga akhir Juni 2020. Dengan begitu, Jakarta masuk dalam masa transisi.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #psbbjakarta #psbb #masker #aniesbaswedan #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 07:14:42',1,1,1,1,'2020-06-05 10:00:27','2020-06-05 12:02:25'),
	(221,'kumparancom','https://instagram.com/p/CBAMHXvF9VT',965165,8636,'Gubernur DKI Jakarta, Anies Baswedan, mengatakan bakal mengenakan denda terhadap warga yang tidak memakai masker di Jakarta saat periode PSBB Masa Transisi. Denda yang dikenakan sebesar Rp 250.000 per orang.\n-\nDalam protokol kesehatan PSBB masa transisi, Anies mewajibkan semua orang yang beraktivitas di Jakarta harus pakai masker. Dia bilang Pemprov DKI Jakarta telah membagikan 20 juta masker gratis untuk masyarakat di Jakarta.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanSAINS #kuatbersama #dirumahaja #newnormal #psbbjakarta #psbb #masker #aniesbaswedan #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 06:22:44',1,1,1,1,'2020-06-05 10:00:27','2020-06-05 12:01:37'),
	(222,'kumparancom','https://instagram.com/p/CBAJxRklUun',965165,3234,'Banjir rob menggenangi pemukiman warga di wilayah pesisir utara Kota Pekalongan, Jawa Tengah, Rabu (3/6). Luapan air laut tersebut memasuki pemukiman warga di Kelurahan Slamaran.\n-\nKetinggian banjir yang disebabkan naiknya permukaan air laut ini bervariasi. Rata-rata ketinggian banjir yang menggenangi rumah warga antara 10-50 sentimeter. Berikut potretnya.\n-\nKredit foto: ANTARA FOTO/Harviyan Perdana Putra.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanNEWS #banjirrob #banjir #bencanaalam #pekalongan #perumahanwarga #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-04 06:02:14',1,1,1,1,'2020-06-05 10:00:27','2020-06-05 12:01:09'),
	(223,'kumparancom','https://instagram.com/p/CBAHAZ9FhbW',965165,6366,'Gubernur DKI Jakarta @aniesbaswedan memutuskan untuk memperpanjang masa PSBB di Jakarta hingga akhir Juni. PSBB fase keempat ini merupakan masa transisi Jakarta menuju kondisi yang lebih sehat.\n-\nMasa transisi ini dilakukan Anies untuk tetap menjamin warga tidak terjangkit virus corona. Di sisi lain, dengan adanya masa transisi ini warga bisa kembali berkegiatan di luar rumah.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #coronavirus #psbb #aniesbaswedan #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 05:38:05',1,1,1,1,'2020-06-05 10:00:27','2020-06-05 12:00:51'),
	(224,'kumparancom','https://instagram.com/p/CBAEqZ3FzAs',965165,4267,'Setelah sukses mencapai target 10 ribu tes/hari, Presiden @jokowi meminta target pelaksanaan tes PCR untuk mendeteksi corona ditambah menjadi 20 ribu/hari.\n-\nOleh sebab itu, ia meminta kepada para jajarannya untuk mempersiapkan segala hal yang diperlukan untuk mencapai angka tersebut.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #coronavirus #rapidtest #swabtest #jokowi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 05:17:36',1,1,1,1,'2020-06-05 10:00:28','2020-06-05 12:00:25'),
	(225,'kumparancom','https://instagram.com/p/CBACBVJllAD',965165,2723,'Hati-hati, gaes. Jangan sampai terkecoh oleh hoaks!\n-\nBeredar sebuah pesan berantai di grup percakapan WhatsApp yang menyebut bahwa penyebab penyakit COVID-19 bukanlah dari virus corona sebagaimana diketahui sekarang, melainkan dari bakteri yang bisa diobati oleh antibiotik.\n-\nNamun, hal tersebut nyatanya adalah hoaks. Menurut Sharad Joshi, ahli pulmonologi dari Max Hospital India, COVID-19 disebabkan oleh infeksi virus.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanSAINS #kuatbersama #dirumahaja #newnormal #coronavirus #hoaks #hoax #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 04:54:31',1,1,1,1,'2020-06-05 10:00:28','2020-06-05 12:00:02'),
	(226,'kumparancom','https://instagram.com/p/CA_6iiKF1tI',965165,6763,'Kota Surabaya kini menjadi wilayah terbanyak yang mencatat kasus COVID-19 di Jawa Timur. Saking tingginya kasus corona di Surabaya, wilayah tersebut ditandai masuk zona hitam dalam peta persebaran di situs infocovid19.jatimprov.go.id.\n-\nTercatat, per Selasa (2/6), kasus positif COVID-19 di Jatim telah mencapai 5.132, dengan di antaranya 6.754 pasien PDP, dan 24.932 orang ODP. Adapun kasus COVID-19 di Surabaya telah mencapai 2.748.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #coronavirus #surabaya #jawatimur #pemerintah #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-04 03:50:52',1,1,1,1,'2020-06-05 10:00:28','2020-06-05 11:59:51'),
	(227,'nevertooweird','https://instagram.com/p/CBA73yAj-h2',1563876,36105,'We’re getting older so quickly.','2020-06-04 13:20:04',3,1,1,1,'2020-06-05 10:00:33','2020-06-05 11:59:22'),
	(228,'nevertooweird','https://instagram.com/p/CA_peZrnv0I',1563876,36355,'Which one is it?!','2020-06-04 01:20:04',6,1,1,1,'2020-06-05 10:00:33','2020-06-05 11:58:32'),
	(229,'faktanyagoogle','https://instagram.com/p/CBA5zrGhg8q',2358005,6955,'Sebelumnya, pemilik restoran memang membeli lahan yang merupakan pemakaman tua milik tokoh agama sejak abad ke-16. Ia memiliki ide yang unik, dengan tak membongkar makam tapi ingin makam-makam kuno tersebut ada di dalam restoran.\n.\nYap, restoran unik yang bernama New Lucky ini berhasil membuat pengunjung penasaran dengan makan bersama makam kuno. Restoran yang terletak di kawasan Ahmadabad, India ini terdapat 12 makam di dalamnya. Sang pemilik resto juga memasang pagar di sekliling makam agar tak terinjak. Bahkan, setiap hari para pegawainya juga membersihkan makam dan menaburkan bunga di atas pusara tersebut. Kamu tertarik ke restoran ini, guys?\n#faktanyagoogle','2020-06-04 13:02:00',3,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:57:42'),
	(230,'faktanyagoogle','https://instagram.com/p/CBAvZRHh2s3',2358005,6662,'Mal di Kota Depok, Jawa Barat belum bisa dibuka saat \"PSBB Proporsional\" yang mulai diterapkan pada Jumat besok (5/6/2020). Wali Kota Depok dengan Forum Komunikasi Pimpinan daerah (Forkopimda) telah menyepakati bahwa mal paling cepat bisa dibuka pada 16 Juni mendatang.\n.\nPemerintah saat ini tengah memastikan bahwa penularan corona di Depok bisa ditekan dan tak kembali melonjak dalam 14 hari ke depan. Jika hal tersebut bisa dicapai dan keadaan dinyatakan relatf kondusif maka mal bisa beroperasi kembali dengan protokol kesehatan.\n#faktanyagoogle','2020-06-04 11:31:00',2,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:56:02'),
	(231,'faktanyagoogle','https://instagram.com/p/CBAm0BDhfDG',2358005,10419,'Anies Baswedan mengatakan bahwa pusat perbelanjaan atau mal bisa kembali buka pada masa PSBB transisi ini. Mal dan pasar non-pangan diizinkan kembali buka pada hari Senin, tanggal 15 Juni 2020.\n.\nPusat-pusat pertokoan juga diperbolehkan kembali untuk beroperasi. Selain itu, rumah makan yang tak berada di mal bisa kembali buka pada 8 Juni tapi harus membatasi kapasitas maksimal 50 persen dari tempat duduk yang tersedia.\n#faktanyagoogle','2020-06-04 10:16:01',2,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:55:42'),
	(232,'faktanyagoogle','https://instagram.com/p/CBAeOwLBVPR',2358005,8357,'Setelah dilakukannya pelonggaran lockdown, kini negara di Eropa seperti Spanyol, Prancis, dan Inggris sudah kembali membuka pantai-pantai. Para turis lokal pun bisa memanfaatkannya untuk berjemur serta menikmati suasana di pantai.\n\nMeski begitu, puluhan turis di sebagian negara, Prancis misalnya, tetap berjemur dengan mengikuti protokol jarak sosial. Hal ini dilakukan pula karena telah dipasangi tali pembatas agar tetap menjaga jarak.\n\nKarena hal tersebut, sektor pariwisata kembali bangkit seiring kedatangan para turis lokal ke pantai. Di sebagian wilayah tetap ada petugas pelayanan yang menggunakan masker dan sarung tangan pelindung.\n#faktanyagoogle','2020-06-04 09:01:01',2,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:55:09'),
	(233,'faktanyagoogle','https://instagram.com/p/CBAT7aWBhtt',2358005,10536,'Sampai saat ini belum ada keputusan final terkait mulainya kembali aktivitas pendidikan di sekolah. Namun, diskusi yang dibahas dalam rapat Ridwan Kamil dalam konferensi pers di Makodam III Siliwangi, wacana yang mengemuka yaitu pada Januari 2021 karena itu yang paling bisa diperhitungkan untuk wilayah Jawa Barat.\n.\nRidwan Kamil mengatakan pihaknya tak ingin tergesa-gesa untuk membuka sekolah karena risiko yang sangat berbahaya untuk anak. Ia butuh waktu untuk mendiskusikan hal ini, Ridwan Kamil tak ingin mengorbankan anak-anak yang di mana Jawa Barat hampir nol kasusnya yang terinfeksi Covid19. Jawa Barat harus menjaga rasio ini agar tak banyak anak-anak yang terinfeksi Covid19.\n#faktanyagoogle','2020-06-04 07:31:00',1,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:54:46'),
	(234,'faktanyagoogle','https://instagram.com/p/CBALliPBurR',2358005,10040,'Anies Baswedan, melalui siaran YouTube Pemprov DKI Jakarta menyampaikan status pembatasan sosial skala besar (PSBB) di Jakarta. Ia memutuskan untuk menetapkan status PSBB di Jakarta diperpanjang dan menetapkan bulan Juni sebagai masa transisi.\n.\nJadi, status di Jakarta masih PSBB namun merupakan masa transisi. Hal ini diputuskan karena sebagian besar wilayah di Jakarta sudah hijau dan kuning tetapi masih ada zona merahnya juga.\n#faktanyagoogle','2020-06-04 06:18:06',1,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:54:13'),
	(235,'faktanyagoogle','https://instagram.com/p/CA_-_iCBB0M',2358005,7277,'University Hospital Antwerp di Belgia kini memiliki robot Covid19 yang super canggih. Yap, robot ini bisa berbicara lebih dari 53 bahasa, mendeteksi demam, hingga melihat orang yang memakai masker atau tidak.\n.\nRobot ini sudah ada di rumah sakit sejak 2013, tapi sekarang ia memiliki tugas baru untuk mendeteksi tanda-tanda orang yang terinfeksi corona. Tak hanya Belgia, robot ini sudah dijual di sejumlah klinik di Prancis, Belanda, Amerika Serikat, dan Rwanda dengan harga 30.000 euro atau sekitar Rp 488 juta.\n#faktanyagoogle','2020-06-04 04:28:04',1,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:53:36'),
	(236,'faktanyagoogle','https://instagram.com/p/CA_3DI4hP3p',2358005,9240,'Gimana, kamu ada plan trip ke Thailand? Mulai 1 Juli 2020, Pemerintah Thailand akan mencabut semua pembatasan dan membuka kembali perjalanan antarprovinsi dan internasional. Melansir laman travel.dream, pencabutan tersebut diberlakukan berdasarkan keputusan darurat negara. Sehingga keputusan ini akan menjadi pembukaan kembali negara Thailand secara penuh.\n.\nThailand akan mendukung new normal dengan tetap menerapkan protokol kesehatan. Pemerintah Thailand tengah mempersiapkan segalanya di bulan Juni sebagai tonggak sejarah. Sejauh ini, Thailand dianggap sukses dalam melayani penyebaran virus corona.\n#faktanyagoogle','2020-06-04 03:18:39',1,1,1,1,'2020-06-05 10:00:36','2020-06-05 11:53:16'),
	(237,'humas_jabar','https://instagram.com/p/CBCPF5LBi4F',125725,1198,'Sampurasun, wargi Jabar!⁣\n⁣.\nUntuk mempersiapkan penerapan new normal di Jawa Barat, Pemdaprov Jabar telah mengkaji Adaptasi Kegiatan Baru atau AKB30, yaitu panduan 30 bidang kegiatan yang diperbolehkan saat pandemi. AKB30 dirancang agar wargi Jabar tetap aman dari virus saat berkegiatan selama pandemi masih berlangsung dengan tidak mengabaikan protokol kesehatan. ⁣\n⁣.\nJangan lupa, tidak semua daerah bisa langsung menerapkan new normal. Hanya daerah di zona hijau dan biru, yaitu daerah di mana penularan COVID-19 dianggap terkendali menurut beberapa kriteria, yang bisa mulai menerapkan AKB30. ⁣\n⁣.\nSimak infografisnya untuk mengetahui secara lengkap!⁣\n.\n.\n.\n#JabarKita #JabarJuaraLahirBatin\nInfografis by @jabardigitalservice .\n.\n#banggajadiwargajabar #jawabarat #jabar #HumasJabar #gedungsate #westjava #RidwanKamil #UuRuzhanulUlum #JabarSehatLahirBatin\n#JabarTanggapCovid19 ⁣','2020-06-05 01:27:13',6,1,1,1,'2020-06-06 10:00:20','2020-06-07 21:51:53'),
