	(239,'kumparancom','https://instagram.com/p/CBDNn9CFxN-',966113,4023,'Setelah dibebaskan dari penjara, baru-baru ini beredar video pengakuan YouTuber Ferdian Paleka betah di penjara.\n-\nMenanggapi video tersebut, kuasa hukum Ferdian Paleka, Rohman Hidayat, membenarkan adanya konten itu. Namun, dia mengatakan perkataan kliennya hanya candaan belaka, tidak perlu disikapi secara serius dan dipersoalkan.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanNEWS #ferdianpaleka #penjara #prank #trending #youtube #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-05 10:35:25',2,1,1,1,'2020-06-06 10:00:25','2020-06-07 21:48:52'),
	(240,'kumparancom','https://instagram.com/p/CBDDf1NFr_0',966113,4076,'Hingga Jumat (5/6) kasus positif COVID-19 di Indonesia mencapai 29.521 orang. Jumlah ini didapat dari penambahan 703 orang hasil pemeriksaan swab dahak metode PCR dan TB-Tes Cepat Molekuler (TCM) pengujian corona.\n-\nSementara itu, jumlah pasien positif COVID-19 yang meninggal pun bertambah 49 orang. Sehingga jumlah pasien meninggal menjadi 1.770 orang. Kabar baiknya, jumlah pasien virus corona yang sembuh bertambah 551 orang, menjadi 9.443 orang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #psbb #psbl #relaksasi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-05 09:05:09',2,1,1,1,'2020-06-06 10:00:25','2020-06-07 20:44:17'),
