	(243,'kumparancom','https://instagram.com/p/CBCt_SnlxqA',966113,3856,'Menyambut PSBB masa transisi, Gubernur DKI Jakarta @aniesbaswedan pun mulai mengizinkan tempat-tempat ibadah dibuka. Per hari ini, Jumat (5/6), warga muslim sudah bisa melaksanakan salat Jumat dengan mematuhi aturan kesehatan.\n-\nNah, bagaimana suasana ibadah di lingkunganmu? Ceritakan pengalamanmu kepada kami melalui foto, video, dan tulisan, yuk! Kirimkan kisahmu melalui email redaksi@kumparan.com.\n-\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #solatjumat #psbb #psbl #relaksasi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-05 05:57:12',1,1,1,1,'2020-06-06 10:00:26','2020-06-07 20:41:52'),
	(244,'kumparancom','https://instagram.com/p/CBCpRVNlhr3',966113,8517,'@muipusat51 mengeluarkan fatwa mengenai pedoman ibadah di masjid untuk mencegah penyebaran wabah COVID-19. Dalam fatwa yang ditandatangani Ketua Komisi Fatwa MUI Prof Dr Hasanuddin AF, salat Jumat di masa pandemi corona boleh merenggangkan saf dan menggunakan masker. Lantas, bagaimana dengan mereka yang khawatir bakal tertular corona jika salat Jumat?\n-\nAwal pandemi bulan April lalu, Sekretaris Komisi Fatwa MUI Asrorun Niam menyebut, mereka yang khawatir karena sakitnya atau takut tertular diperbolehkan tidak salat Jumat. Sekarang, Ketua Komisi Hukum MUI HM Baharun menegaskan ketentuan itu masih berlaku dengan pertimbangan ikhtiar menjaga jiwa.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #solatjumat #psbb #psbl #relaksasi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-05 05:15:58',1,1,1,1,'2020-06-06 10:00:26','2020-06-07 20:40:53'),
	(245,'kumparancom','https://instagram.com/p/CBCndTCFmIz',966113,11635,'Video ‘Keke Bukan Boneka’ turut membantu pendapatan harian Kekeyi di YouTube naik signifikan. Usai sempat trending, estimasi pendapatan @rahmawatikekeyiputricantikka23 dari YouTube bisa mencapai Rp 1 M. Sayang, video tersebut sudah di-take down alias dihapus oleh YouTube karena dinilai melanggar hak cipta Rinni Idol.\n-\nTerkait hal ini, melalui unggahan Instagram pribadinya, Rinni menjelaskan di-take down-nya lagu Keke Bukan Boneka merupakan di luar wewenangnya. Hal itu merupakan keputusan pihak label yakni Sony Music dan pencipta lagu Aku Bukan Boneka, Novi Umar.\n-\nSelain itu mengenai tulisan ‘Copyright claim by Rini Idol – Aku Bukan Boneka’ yang di-take down oleh YouTube,  Menurut Rinni, platform video tersebut selalu mencatut judul lagu dan penyanyi aslinya. Jadi, nama Rinni beserta judul lagunya akan tercantum di situ.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanHITS #kekeyi #akubukanboneka #kekebukanboneka #lagu #hits #viral #trending #youtube #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-05 05:01:55',1,1,1,1,'2020-06-06 10:00:26','2020-06-07 20:40:40'),
