	(247,'kumparancom','https://instagram.com/p/CBCWWI6FkHs',966113,3862,'Pernah lihat anjing kesayanganmu berputar-putar sebelum tidur?\n-\nTernyata, perilaku tersebut ada hubungannya dengan evolusi, lho. Berputar-putar sebelum berbaring dilakukan oleh leluhur anjing yang masih liar untuk mengusir ular atau serangga yang bisa mengganggu tidur mereka.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanSAINS #hewan #anjing #faktahewan #doglovers #anjinglucu #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-05 02:30:54',1,1,1,1,'2020-06-06 10:00:26','2020-06-07 20:37:39'),
