	(250,'faktanyagoogle','https://instagram.com/p/CBDbBkSBKj_',2357553,42520,'Gimana, pertemanan kamu kayak gini juga nggak, guys? Yap, anak medan punya cerita nih guys~ Beruntung sekali yaa berada di lingkungan pertemanan yang positif. Pertemanan para cowok ini juga solid abis, membantu temannya yang tengah kesulitan karena ponselnya rusak. Mereka ikut merasa sedih saat kumpul tetapi temannya itu hanya bisa memandangi yang sedang bermain ponsel.\n.\nAkhirnya, mereka bersama-sama menyisihkan uangnya untuk patungan membeli ponsel baru. Setelah uang terkumpul juga mereka bersama-sama menemui penjual. Saat ponsel sudah dibeli, mereka langsung memberikan pada teman yang ponselnya rusak tersebut. Tak disangka temannya ini terharu hingga menangis bahagia di depan teman-temannya. Wah salut sama pertemanan kayak gini!\n\nCredit: @fathirhrp \n#faktanyagoogle','2020-06-05 12:30:44',2,1,1,1,'2020-06-06 10:00:33','2020-06-07 20:34:21'),
	(251,'faktanyagoogle','https://instagram.com/p/CBC4pRrh702',2357553,22320,'Kehidupan new normal, masyarakat harus melakukan penyesuaian agar kasus Covid19 ini tak semakin menyebar. Salah satunya yang dilakukan oleh Dinas Perhubungan (Dishub) di Kota Tuban, Jawa Timur yang bekerja sama dengan kepolisian membuat garis putih di lampu merah.\n.\nGaris putih ini dibuat berjarak, pihak Dishub dan kepolisian memodifikasi kotak antrean lampu merah di perempatan simpang Kembang Ijo agar pengendara tak berkerumun. Para pengendara motor yang berhenti karena lampu merah diimbau untuk berada di garis putih yang telah dibuat.\n#faktanyagoogle','2020-06-05 07:30:19',1,1,1,1,'2020-06-06 10:00:33','2020-06-07 20:32:23'),
	(252,'faktanyagoogle','https://instagram.com/p/CBCuV_fhWlJ',2357553,23209,'Menyambut new normal, bioskop dengan konsep drive in tengah menjadi perbincangan. Yap, bioskop drve in telah dibuka oleh salah satu proyek properti Meikarta. Lokasinya yaitu di Sky Parking Distric 1, Meikarta, Cikarang, Jawa Barat.\n.\nBioskop ini telah digelar sejak 30 Mei dan rencananya akan terus berjalan hingga 30 Juni mendatang. Bioskop drive in juga dilakukan dengan protokol kesehatan untuk mencegah penularan virus Covid19. Inovasi ini disambut baik oleh banyak orang dan dipuji banyak pihak. Namun, bioskop drive in Meikarta ini justru tuai kritik dari produser film.\n.\nProduser film Susah Sinyal, Chand Parwez, melaporkan bahwa filmnya telah diputar tanpa izin dan sepengetahuannya. Produser DILAN 1990, Ody Mulya Hidayat, juga menyampaikan keluhan serupa. Pihak Meikarta kini telah meminta maaf atas penayangan film secara ilegal, namun Chand tetap akan mengajukan proses hukum terkait pemutaran film secara ilegal ini.\n#faktanyagoogle','2020-06-05 06:00:18',1,1,1,1,'2020-06-06 10:00:33','2020-06-07 20:29:51'),
	(253,'faktanyagoogle','https://instagram.com/p/CBCgBj0hImJ',2357553,22829,'Kejadian menyedihkan ini dibagikan oleh seorang penjaga hutan di India yang bernama Mohan Krishnan. Ia menemukan seekor gajah liar yang sedang hamil ini tewas karena jebakan yang dibuat oleh warga.\n.\nWarga di Desa Kerala, India memang kerap kali membuat jebakan buah berisi petasan untuk menjerat babi liar yang sering mengganggu warga. Dalam keadaan mulut yang terluka gajah berlari-lari untuk mencari makanan. Tapi, tak kunjung mendapat makanan dan luka yang ada di mulutnya semakin sakit. Ia pun berlari ke arah sungai dan mencoba meredam mulut dan belalainya ke dalam air hingga ia menghembuskan nafas terakhirnya di sungai.\n#faktanyagoogle','2020-06-05 03:55:11',1,1,1,1,'2020-06-06 10:00:33','2020-06-07 20:29:06'),
	(254,'faktanyagoogle','https://instagram.com/p/CBCcN8dh-DK',2357553,28543,'Wah jenius banget ya, guys! Biasanya, anak usia 13 tahun masih berada di jenjang SMP. Tapi, Jack Rico asal California ini justru sudah menyelesaikan gelar sarjana. Bahkan, dalam waktu 2 tahun ia bisa mendapatkan 4 gelar sekaligus.\n.\nTernyata, sejak usia 3 tahun Rico sudah menunjukkan tanda kalau ia bukan seperti anak biasanya. Ibunya Rico pun berinisiatif untuk menerapkan homeschooling untuk Rico karena kejeniusan Rico membuatnya kesulitan belajar di sekolah biasa.\n.\nLalu, ketika usia 11 tahun ia membutuhkan banyak tantangan, sehingga ia masuk ke Fullerton College\'s Bridge Progam. Yap, program tersebut memungkinkan siswa K-12 yang lulus ujian bisa ikut kelas universitas. Ia bisa mengambil banyak kelas dan menyelesaikannya dengan baik. Yap, ditengah pandemi corona kini ia sudah lulus dan mendapatkan 4 gelar sarjana. Wah keren~\n#faktanyagoogle','2020-06-05 03:21:55',1,1,1,1,'2020-06-06 10:00:33','2020-06-07 20:27:54'),
	(255,'kumparancom','https://instagram.com/p/CBFq6kDAxSb',966911,7447,'Sebuah helkopter jatuh di Kawasan Industri di Kendal, Jawa Tengah. Helikopter itu jatuh pada Sabtu (6/6) siang. Humas Basarnas Semarang Zulhawary membenarkan peristiwa tersebut. Kendati demikian, ia belum bisa mendetailkan kronologi kejadian, serta korban jiwa dari insiden tersebut.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #helikopter #kendal #jawatengah #helikopterjatuh #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-06 09:28:12',2,1,1,1,'2020-06-07 10:00:22','2020-06-07 20:26:43'),
	(256,'kumparancom','https://instagram.com/p/CBFnnDilbIk',966911,5265,'Per Sabtu, (6/6), penambahan kasus positif corona sebanyak 993 orang. Sehingga total pasien positif corona di Indonesia sebanyak 30.514 dari sebelumnya 29.521 orang.\n-\nSementara itu, pasien corona yang meninggal juga bertambah 31 orang, menjadi 1.801 orang. Kabar baiknya, pasien sembuh terus meningkat sebanyak 464 orang. Sehingga total pasien corona yang sembuh menjadi 9.907.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #pasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-06 08:59:11',2,1,1,1,'2020-06-07 10:00:22','2020-06-07 20:25:59'),
	(257,'kumparancom','https://instagram.com/p/CBFmcjUlSWt',966911,4224,'Selama pandemi ini, ada baiknya untuk menghindari bersantap di restoran yang terlihat kurang aman demi mengurangi risiko terpaparnya virus. Simak tips-tips berikut ini, yuk!\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanFOOD #kuatbersama #dirumahaja #restoran #rumahmakan #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-06 08:49:01',2,1,1,1,'2020-06-07 10:00:22','2020-06-07 20:20:43'),
	(258,'kumparancom','https://instagram.com/p/CBFeIF7FK7z',966911,11921,'Aksi protes terhadap kasus pembunuhan George Floyd dan rasisme atas kebrutalan polisi di Amerika Serikat (AS) masih terus terjadi.\n-\nSebagai aksi protes, dua blok jalan di dekat White House di Washington D.C. dilukis mural raksasa Black Lives Matter dengan huruf berwarna kuning, Jumat (5/6) siang waktu setempat. Berikut potretnya.\n-\nKredit foto: Reuters.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanNEWS #blacklivesmatter #as #demo #warga #floyd #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-06 07:36:19',1,1,1,1,'2020-06-07 10:00:22','2020-06-07 20:18:45'),
	(259,'kumparancom','https://instagram.com/p/CBFKSuAlMb-',966911,4927,'Pemprov DKI Jakarta menerbitkan Peraturan Gubernur Nomor 51 Tahun 2020 tentang Pelaksanaan PSBB masa transisi. Dalam pergub tersebut, aturan ganjil-genap akan berlaku untuk kendaraan pribadi. Namun tak hanya mobil, pengendara sepeda motor juga terkena aturan ini.\n-\nMeski begitu, Kasubdit Gakum Polda Metro Jaya, AKBP Fahri Siregar, mengungkapkan, sistem ganjil-genap masih tidak berlaku sepekan ke depan, atau setidaknya sampai perpanjangan PSBB DKI berakhir. Sehingga, belum diputuskan kapan aturan ini berlaku.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #lalulintas  #relaksasi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-06 04:43:00',1,1,1,1,'2020-06-07 10:00:22','2020-06-07 20:16:53'),
