	(262,'faktanyagoogle','https://instagram.com/p/CBGL2Ukhxm9',2357165,20492,'Kamu sering typo nggak nih kalau ngetik tulisan? Hehe, apalagi saat menulis tugas sekolah atau kuliah, tulisan yang berlembar-lembar itu bisa dicek dengan praktis menggunakan tutorial ini.\n.\nSaat mengunggah dokumen yang kamu butuhkan, website tersebut secara otomatis akan meng-highlight tulisan kamu yang typo. Jadi, nggak perlu repot liat satu per satu deh, guys. Hehe~\n#faktanyagoogle','2020-06-06 14:15:55',3,1,1,1,'2020-06-07 10:00:28','2020-06-07 20:15:07'),
	(263,'faktanyagoogle','https://instagram.com/p/CBFTMzthWb3',2357165,39021,'Siapa nih yang masih nyimpen foto jadul dalam bentuk klise film? Nah, kini kamu bisa menyimpan tumpukan film ini dengan album digital. Yap, kamu tak perlu repot-repot untuk mencuci film tersebut, ternyata ada aplikasi yang bisa membuat klise film tersebut langsung jadi foto dalam bentuk asli. Dengan menggunakan latar background putih, kamu bisa langsung memotretnya dan mengubah klise film jadi foto digital deh~\n\nCredit: @mchoi.29 \n#faktanyagoogle','2020-06-06 06:00:54',1,1,1,1,'2020-06-07 10:00:28','2020-06-07 20:13:46'),
	(264,'faktanyagoogle','https://instagram.com/p/CBFI5vqB8E1',2357165,23803,'Ibadah haji ditiadakan tahun ini, para calon jemaah kecewa mendengar kabar tersebut. Kekecewaan ini juga dirasakan oleh Habibah yang berusia 54 tahun. Ia dengan penuh sabar menjual gado-gado selama 30 tahun agar bisa berangkat haji. Tapi, tahun ini ia harus berlapang dada menerima keputusan tersebut demi kebaikan bersama.\n.\nHabibah yang tinggal di Klandasan, Balikpapan ini ternyata dulu pernah jualan cendol juga, tapi sekarang lebih fokus pada gado-gado. Habibah menabung sejak usia muda karena niatnya untuk menunaikan ibadah haji.\n#faktanyagoogle','2020-06-06 04:30:51',1,1,1,1,'2020-06-07 10:00:28','2020-06-07 15:07:52'),
	(265,'faktanyagoogle','https://instagram.com/p/CBFAwPLhWWJ',2357165,23287,'Berbakti kepada kedua orang tua memang perilaku yang sangat terpuji. Seperti Babil, bocah usia 12 tahun di Sulawesi Selatan ini yang merawat kedua orangtuanya yang sedang sakit. Tak seperti anak seusianya yang tengah asyik bermain, ia justru mendampingi dan merawat orang tuanya dengan sabar.\n.\nMelansir laman Brilio, diketahui ayah Babil menderita penyakit stroke dan ibunya mengidap penyakit alergi tulang. Penyakit tersebut juga membuat ibu Babil tak dapat beranjak dari tempat tidurnya. Ternyta, ibu Babil sakit sejak Babil berusia 4 tahun dan yak kunjung membaik hingga saat ini. Sementara, penyakit stroke ayah Babil membuat dirinya lumpuh dan tak bisa berbicara.\n.\nKondisi kedua orangtuanya yang lumpuh ini lah yang membuat Babil rela merawat orangtuanya. Setiap hari ia melakukan pekerjaan rumah seorang diri, mulai dari memasak, mecuci hingga mengurusi semua keperluan orang tuanya. Ia juga tetap sekolah dan mengurus keperluan orangtuanya sebelum berangkat sekolah. Semoga Babil sekeluarga bisa menghadapi cobaan ini dengan penuh ketabahan dan semoga cepat membaik..\n#faktanyagoogle','2020-06-06 03:19:39',1,1,1,1,'2020-06-07 10:00:29','2020-06-07 15:06:49'),
	(266,'kumparancom','https://instagram.com/p/CBITdMFgeEa',967716,6956,'Seorang bocah perempuan berusia 9 tahun di Deli Serdang, Sumut, berhasil menggagalkan usaha bunuh diri ayahnya, Rizky Nurham (40). Dalam sehari, Rizky sudah berusaha menghabisi nyawanya sendiri sebanyak tiga kali berturut-turut.⁠\n-⁠\nHingga saat ini, polisi masih menyelidiki penyebab Nurham ingin mengakhiri hidupnya. Namun, menurut keterangan saksi, Nurham diduga ingin bunuh diri karena memiliki penyakit yang tak kunjung sembuh.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #bocah #sumut #sumatra #deliserdang #polisi #saksi #bapak #anak #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-07 10:01:06',2,1,1,1,'2020-06-08 10:00:26','2020-06-08 10:43:37'),
	(267,'kumparancom','https://instagram.com/p/CBIK4sSFWAT',967716,3707,'Per hari ini (7/6) terdapat penambahan kasus positif corona sebanyak 672 orang. Sehingga total pasien positif corona di Indonesia sebanyak 31.186 dari sebelumnya 30.514 orang.\n-\nPasien yang meninggal bertambah 50 orang. Sehingga total kasus meninggal sebanyak 1851 orang dari sebelumnya 1.801 orang. Kabar baiknya, pasien sembuh terus meningkat sebanyak 591 orang. Sehingga total pasien corona yang sembuh menjadi 10.498 dari sebelumnya 9.907 orang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #pasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-07 08:45:55',2,1,1,1,'2020-06-08 10:00:26','2020-06-08 10:42:57'),
	(268,'kumparancom','https://instagram.com/p/CBH0f3AltaL',967716,5633,'Kebijakan PSBB transisi diambil Pemprov DKI Jakarta hingga akhir Juni 2020. Dalam masa ini, mal menjadi salah satu tempat yang diizinkan untuk dibuka pada 15 Juni 2020.\n-\nKetua Asosiasi Persatuan Pusat Belanja Indonesia (APPBI) Jakarta, Ellen Hidayat, memastikan semua mal di Jakarta akan buka pada 15 Juni. Operasionalnya akan menyesuaikan aturan yang ada, kapasitas mal maksimal diisi hanya 50 persen.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #maljakarta #psbb #lockdown #relaksasi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-07 05:30:17',1,1,1,1,'2020-06-08 10:00:26','2020-06-08 10:42:24'),
	(269,'kumparancom','https://instagram.com/p/CBHtPtWFuut',967716,7520,'Sejumlah calon pasangan pengantin terlihat melakukan prosesi akad nikah di Kantor Urusan Agama (KUA) Ciracas, Jakarta pada Sabtu (6/6). Berikut potretnya. -\nPernikahan di tengah pandemi virus corona di Indonesia mengharuskan calon pengantin melakukan prosesi akad nikah dengan mengikuti protokol kesehatan seperti wajib mengenakan masker dan mencuci tangan.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #newnormal #pernikahan #psbb #psbl #lockdown #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-07 04:26:54',1,1,1,1,'2020-06-08 10:00:26','2020-06-08 10:41:34'),
