	(274,'faktanyagoogle','https://instagram.com/p/CBIaULChlz8',2356806,29837,'Wah, sangat menyentuh hati melihat yang dilakukan bayi gajah ini. Saat seorang pria mengapung di tengah sungai, bayi gajah mengira pria ini tenggelam. Bayi gajah yang berada di pinggir sungai pun langsung menyebrangi sungai untuk menyelamatkan pria ini.\n.\nTerlihat bayi gajah berusaha untuk mengejar pria ini meski saat ia berjalan airnya semakin tinggi. Namun, ia berhasil menghampiri pria tersebut dan melidunginya dengan belalai dan kakinya. Bikin terharu lihatnya:\')\n#faktanyagoogle','2020-06-07 11:00:51',2,1,1,1,'2020-06-08 10:00:34','2020-06-08 10:38:01'),
	(275,'faktanyagoogle','https://instagram.com/p/CBIJJgxBnH_',2356806,18422,'Siapa nih yang penasaran menginap di hotel ini? Yap, Hotel Hanoi Golden Lake ini berlapis emang 24 karat. Hotel yang berada di tepi Danau Giang Vo, Vietnama ini bagian luar gedungnya dibalut oleh keramik berlapis emas seluar 5.000 meter persegi.\n.\nHotel tersebut mulai dibangun pada 2009, tingginya 25 lantai dan memiliki kolam renang yang berada di atap. Hotel tersebut menjadi hotel berlapis emas pertama di dunia dengan harga menginap per malam 50 dolar AS atau setara dengan Rp 3 juta.\n#faktanyagoogle','2020-06-07 08:30:44',2,1,1,1,'2020-06-08 10:00:34','2020-06-08 10:37:11'),
	(276,'faktanyagoogle','https://instagram.com/p/CBHchMIBgVM',2356806,30089,'Gimana, kamu sudah siap dengan kehidupan new normal? Yap, kini ruang publik tengah mempersiapkan new normal dengan protokol kesehatan. Tempat ibadah juga diberi jarak aman untuk mengantisipasi penularan Covid19.\n.\nTempat makan atau restoran juga diberi jarak antar meja. Hingga ruang sidang yang juga diwajibkan memakai face shield saat sidang di mulai. Wah, kita harus bersiap dengan kehidupan new normal ya, guys. Terutama masker dan handsanitizer yang wajib dibawa saat bepergian.\n#faktanyagoogle','2020-06-07 02:00:45',1,1,1,1,'2020-06-08 10:00:34','2020-06-08 10:36:20'),
	(277,'humasprovjatim','https://instagram.com/p/CBKcrDIpsHM',27574,291,'Upaya penekanan penyebaran Covid-19 di Jawa Timur kembali memberikan hasil positif. Per hari Minggu (7/6) malam, tercatat empat Kab/Kota Jatim, yaitu Lumajang, Ngawi, Kota Blitar dan Kota Madiun, telah berstatus Zona Kuning dari sebelumnya Zona Merah.\n.\n\"Dari 38 Kab/Kota di Jawa Timur, alhamdulilah yang sudah masuk kategori resiko rendah atau sudah masuk kategori zona kuning ada empat yaitu Kabupaten  Ngawi, Kabupaten  Lumajang, kota Madiun dan Kota Blitar,\" jelas Gubernur Jatim @khofifah.ip pada konferensi pers di Gedung Negara Grahadi pada Minggu (7/6) malam.\n.\nGubernur Khofifah menjelaskan, Zona Kuning atau zona beresiko rendah ini merupakan wilayah-wilayah yang dalam dua minggu terakhir terjadi penurunan  kasus konfirmasi positif Covid-19, PDP, ODP dan kematian hingga 50%. Selain itu, terjadi penurunan jumlah kasus konfirmasi positif, PDP dan ODP yang dirawat di Rumah Sakit sehingga kapasitas Rumah Sakit masih lebih dari cukup.\n.\nSedangkan untuk pemetaan metode baru ini, orang nomor satu Jatim ini menyebut bahwa telah mengacu pada 10 indikator dari Gugus Tugas Pusat dan BNPB (Badan Nasional Penanggulangan Bencana).\n.\n\"Jadi ini merupakan mekanisme yang merupakan pemetaan dari Gugus Tugas Pusat,\" imbuh Gubernur perempuan pertama Jatim ini.\n.\n#khofifah\n#emil\n#arumi\n#jawa timur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n#physicaldistancing\n@khofifah.ip \n@emildardak','2020-06-08 05:59:49',1,1,1,1,'2020-06-09 10:00:14','2020-06-10 22:51:11'),
