	(279,'kumparancom','https://instagram.com/p/CBK_Ib7H77Y',968669,10669,'Novella Putri dijanjikan Pemerintah Kabupaten Rohul beasiswa untuk melanjutkan pendidikannya ke Kedokteran Trisakti. Namun, karena ada pergantian kepala daerah, nasib Novella tak menentu. ⁠\n-⁠\nKisah Novella ini viral usai teman satu kampus dengannya membuat akun di laman web penggalangan dana, kitabisa.com. Novella belum membayar biaya kuliahnya. Akibatnya, co-assistant sebagai dokter terancam tak bisa lanjut dengan tagihan biaya kuliah mencapai Rp 500 juta. Utang ratusan juta rupiah itu mencuat saat Novella sudah berada di penghujung menyandang gelar dokter.⁠\n-⁠\nKonten ini merupakan hasil liputar partner resmi #1001MediaOnline kumparan, Selasar Riau.⁠\n-⁠\n#kumparanNEWS #riau #mahasiswa #beasiswa #trisakti #kedokteran #mahasiswakedokteran #beasiswakedokteran #selasarriau #kuliah #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan⁠','2020-06-08 11:01:22',2,1,1,1,'2020-06-09 10:00:21','2020-06-10 22:49:44'),
