	(281,'kumparancom','https://instagram.com/p/CBKjqHAnm6C',968669,6594,'Sejak Perang Dunia II usai, sebuah buku harian milik Nazi disimpan rapat-rapat oleh sekte rahasia selama beberapa dekade terakhir. Buku itu disebut-sebut memperlihatkan sebuah peta yang merinci lokasi harta karun berisi 30 ton emas yang disembunyikan Nazi selama perang dunia berlangsung. ⁠\n-⁠\nDalam buku harian itu, dicantumkan 11 situs tempat Nazi menyembunyikan bongkahan emas yang berhasil dijarah, permata, lukisan, dan benda-benda keagamaan. Harta karun ini diketahui milik para elite Yahudi yang dijarah dan dirampas oleh tentara Nazi pada saat Perang Dunia II berlangsung.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanSAINS #nazi #hartakarun #bukuharian #perangdunia #harta #yahudi #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-08 07:01:05',1,1,1,1,'2020-06-09 10:00:22','2020-06-10 22:48:32'),
