	(284,'nevertooweird','https://instagram.com/p/CBJ8p87A1XM',1565241,33275,'Not hungry, just bored.','2020-06-08 01:20:04',6,1,1,1,'2020-06-09 10:00:26','2020-06-10 22:46:18'),
	(285,'faktanyagoogle','https://instagram.com/p/CBLCiL9hG1m',2356370,17563,'Dua pramugari Philippine Airlines (PAL) dengan menggunakan APD membantu seorang penumpang yang melahirkan bayinya di pesawat. Dua pramugari ini membantu persalinan tersebut di atas ketinggian 30 ribu kaki saat pesawat membawanya terbang dari Dubai ke Manila.\n.\nSaat membantu persalinan, dua pramugari berbincang dengan seorang dokter melalui sambungan telepon satelit. Bayi yang berjenis kelamin laki-laki ini akhirnya selamat dalam proses kelahiran. PAL pun merilis foto yang memperlihatkan momen dua pramugi berpose dengan sang bayi. Momen langka yang tak akan terlupakan~\n#faktanyagoogle','2020-06-08 11:30:39',2,1,1,1,'2020-06-09 10:00:27','2020-06-10 22:45:48'),
	(286,'faktanyagoogle','https://instagram.com/p/CBK2hCGB8rz',2356370,30655,'Ketua Gugus Tugas Penanganan Covid19 di Cirebon melaporkan bahwa ada bayi yang terinfeksi virus corona. Seorang bayi yang berusia 50 hari ini dinyatakan positif usai dibawa ke tempat hajatan. Bayi ini menjadi kasus ke-14 di Kabupaten Cirebon.\n.\nBerikut fakta-fakta dari kasus bayi tersebut.\n1. Saat dibawa ke tempat hajatan, bayi tersebut memiliki riwayat kontak dengan paman yang baru saja datang dari zona merah.\n2. Memiliki gejala Covid19. Usai pulang dari hajatan, bayi mengalami demam hingga 38 derajat, batuk,sesak napas, hingga diare.\n3. Tes swab pada Kamis lalu hasilnya bayi tersebut positif Covid19.\n4. Setelah diketahui positif, tim melakukan penelusuran terkait riwayat kontak bayi dan sang paman.\n#faktanyagoogle','2020-06-08 09:45:38',2,1,1,1,'2020-06-09 10:00:27','2020-06-10 22:45:10'),
	(287,'faktanyagoogle','https://instagram.com/p/CBKyHrMBWSN',2356370,27640,'Wah, kabarnya para ilmuwan sudah mengembangkan vaksin virus corona dan akan diproduksi dua miliar dosis vaksin jika sudah disetujui. Para ilmuwan di University of Oxford merasa yakin 80 persen bahwa vaksin ini akan bekerja dengan baik.\n.\nMelansir laman suara.com, vaksin Covid19 diyakini bisa siap pada Agustus mendatang dan dalam bentuk inhaler. Melansir dari suara.com, uji coba vaksin dimulai pada April lalu dengan 10.260 orang dewasa berusia di atas 55 tahun dan anak-anak menjadi peserta dalam percobaan tersebut.\n#faktanyagoogle','2020-06-08 09:07:13',2,1,1,1,'2020-06-09 10:00:27','2020-06-10 22:44:30'),
	(288,'faktanyagoogle','https://instagram.com/p/CBKMpksByLJ',2356370,32049,'Di era digital ini semakin banyak aplikasi yang bisa menunjang penampilan kamu di sosial media, yap seperti aplikasi edit foto. Tak jarang, banyak pengguna Instagram yang mengedit ataupun memberikan effect saat memposting foto mereka. Namun, 2 orang influencer ini justru mengungkapkan kepada penggemar mereka penampilan saat di kehidupan nyata.\n.\nTerlihat dalam foto perbedaan penampilan antara keduanya. Yap, untuk foto yang di posting di Instagram diedit terlebih dahulu dan sedikit berbeda dengan aslinya.\n#faktanyagoogle','2020-06-08 03:39:48',1,1,1,1,'2020-06-09 10:00:27','2020-06-10 22:44:12'),
	(289,'kumparancom','https://instagram.com/p/CBN5dGaFI4S',969528,10674,'Konten ini merupakan hasil liputar partner resmi #1001MediaOnline kumparan, @tugujogja.id.\n-⁠\nYogyakarta dadi salah sawijining kutha sing tekan saiki dikenal kenthel budayane. Masarakat Yogyakarta uga nduweni kebiasaan sing unik, sing kadang nggawe wong liya mumet. Yaiku nduduhke dalan nganggo arang arah mata angin, lor, kulon, kidul, lan wetan. Kebiasaan iki kayane wis mendarah daging ing masarakat Yogyakarta.\n--\nYogyakarta menjadi salah satu daerah yang hingga kini terkenal kental dengan budayanya. Masyarakat Yogyakarta juga memiliki kebiasaan unik, yang kadang membuat orang kebingungan. Adalah menunjukkan jalan menggunakan arah mata angin, utara, barat, selatan, dan timur. Kebiasaan ini seolah sudah mendarah daging di masyarakat Yogyakarta.\n-\n#kumparanNEWS #yogyakarta #jogja #diy #kebiasaan #wargajogja #budaya #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 14:09:02',3,1,1,1,'2020-06-10 10:00:22','2020-06-10 22:43:43'),
	(290,'kumparancom','https://instagram.com/p/CBNgaOqnvkq',969528,13581,'Kenyataan enggak sesuai harapan..⁠\n-⁠\nPria asal Kediri yang berinisial MUH (31) di Lombok Barat, NTB ditipu lantaran MIT (25), istri yang dikenalnya dari media sosial adalah seorang pria. MUH kemudian melaporkan MIT ke Polres Lombok Barat atas kasus penipuan.⁠\n-⁠\nKasat Reskrim Polres Lombok Barat AKP Dhafid Shiddiq mengatakan MUH melakukan pernikahan sirih dengan MIT pada Kamis (4/6). Proses pernikahan MUH dan MIT terbilang cepat. MUH kenal di media sosial dengan MIT. Mereka selama ini berkomunikasi via media sosial dan juga aplikasi chat.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #pernikahan #lombok #lombokbarat #penipuan #chat #aplikasi #onlinedating #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 10:30:33',2,1,1,1,'2020-06-10 10:00:22','2020-06-10 22:43:09'),
	(291,'kumparancom','https://instagram.com/p/CBNdo3KHuZ0',969528,15474,'Menurut Ketua Tim Pakar Gugus Tugas Percepatan Penanganan COVID-19, Wiku Adisasmito, kehadiran dr. Reisa merupakan bagian dari upaya pemerintah untuk mengoptimalkan kampanye protokol kesehatan pencegahan corona kepada masyarakat.⁠\n-⁠\nSelain itu, dr. @reisabrotoasmoro juga dianggap bisa menyampaikan agenda kesehatan itu secara lebih luwes, substansial, namun mudah diterima masyarakat.⁠\n-⁠\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #drreisa #konferensipers #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan⁠','2020-06-09 10:10:59',2,1,1,1,'2020-06-10 10:00:22','2020-06-10 22:42:16'),
	(292,'kumparancom','https://instagram.com/p/CBNaRX-FUP5',969528,10543,'Dari 100 negara, Indonesia di urutan 97. Gimana pendapat kalian?\n-\nDalam laporan yang dibuat oleh Deep Knowledge Group di Majalah Forbes itu, disebutkan bahwa ada perubahan signifikan dalam urutan negara teraman selama berbulan-bulan terjadi pandemi virus corona.\n-\nAwalnya, negara-negara yang dapat bereaksi cepat terhadap krisis karena memiliki tingkat kesiapsiagaan darurat yang tinggi menempati peringkat tertinggi. Sekarang negara-negara dengan ekonomi tangguh berada pada peringkat yang lebih tinggi.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pasienpdp #bekasitimur #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 09:36:33',2,1,1,1,'2020-06-10 10:00:22','2020-06-10 22:41:41'),
	(293,'kumparancom','https://instagram.com/p/CBNUXT0lFtN',969528,11939,'Pasien positif virus corona di Indonesia hingga hari ini masih bertambah. Per Selasa (9/6) pukul 12.00 WIB, jumlah pasien positif bertambah 1.043 orang, sehingga total kini 33.076 orang telah terjangkit corona.\n-\nJumlah pasien positif COVID-19 yang meninggal bertambah 40 orang. Sehingga kini totalnya menjadi 1.923 jiwa. Kabar baiknya, jumlah pasien virus corona yang sembuh diumumkan bertambah 510 orang, dan kini menjadi 11.414 orang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 08:44:56',2,1,1,1,'2020-06-10 10:00:23','2020-06-10 22:41:14');
