VALUES
	(294,'kumparancom','https://instagram.com/p/CBND2WOHJMu',969528,11573,'Wakil Ketua Mahkamah Kehormatan Dewan (MKD) DPR Saleh Partaonan Daulay mengingatkan Krisdayanti agar tidak membawa urusan keluarga ke ranah publik. Saleh menyebut, persoalan keluarga seperti itu seharusnya bisa diselesaikan tanpa harus diungkap ke publik. Hal ini dilakukan demi menjaga marwah kehormatan @krisdayantilemos sebagai anggota DPR yang notabene wakil rakyat.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanNEWS #kd #krisdayanti #aurel #thehermansyah #raullemos #keluarga #dpr #politik #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan.','2020-06-09 06:25:40',1,1,1,1,'2020-06-10 10:00:23','2020-06-10 22:40:47'),
	(295,'kumparancom','https://instagram.com/p/CBM3ckkln8Z',969528,12967,'Tiga orang penumpang pesawat dari Jakarta yang tiba di Bandara Internasional Minangkabau, Sumatera Barat, dan Bandara Sam Ratulangi Manado dinyatakan positif virus corona. Padahal, ketiganya membawa surat keterangan yang menyatakan bahwa mereka bebas COVID-19.\n-\nDiketahui, ketiga penumpang tersebut ketahuan positif usai tes swab di bandara tujuan. Kini, lampiran rapid test calon para penumpang itu dipertanyakan keasliannya.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #pasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 04:34:00',1,1,1,1,'2020-06-10 10:00:23','2020-06-10 22:40:25'),
	(296,'kumparancom','https://instagram.com/p/CBMwSWPFI5i',969528,14802,'Nadhira Nuraini Afifa, mahasiswi asal Indonesia, terpilih menjadi mahasiswa yang menyampaikan pidato kelulusan di upacara wisuda S2 Harvard T.H. Chan School of Public Health pada 28 Mei 2020 lalu.\n-\nDalam pidatonya, @nadhiraafifa menyinggung pentingnya peran ahli kesehatan dalam masyarakat. Ia juga menyampaikan pentingnya kolaborasi dan dedikasi tenaga kesehatan untuk melawan pandemi COVID-19.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #pasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 03:31:19',1,1,1,1,'2020-06-10 10:00:23','2020-06-10 22:39:38'),
	(297,'nevertooweird','https://instagram.com/p/CBMhdBkKvqu',1565627,36464,'Tag that friend.','2020-06-09 01:20:08',6,1,1,1,'2020-06-10 10:00:28','2020-06-10 22:39:07'),
	(298,'faktanyagoogle','https://instagram.com/p/CBNJjUMBAIi',2355976,25249,'Kasus penyiksaan anak buah kapal (ABK) Indonesia kembali terjadi. Andri Juniansyah (30) asal Sumbawa, Nusa Tenggara Barat (NTB) dan Reynalfi (22) berasal dari Pematang Siantar, Sumatera Utara mendapat siksaan saat menjadi ABK di kapal tangkap ikan Lu Qing Yuan Yu 213 asal negara China.\n.\nTak kuat disiksa, dua ABK ini hingga nekat melompat ke laut. Mereka ditemukan mengapung di perairan STS Internasional oleh seorang nelayan yang melintas. Ternyata, mereka sudah mengapung selama 7 jam dengan menggunakan pelampung dan dalam keadaan lemas. Usai ditemukan, dua ABK ini langsung diamankan dan menjalani pemeriksaan rapid test.\n.\nDilansir dari kumparan.com, menurut pengakuan WNI tersebut, para Pekerja Migran Indonesia (PMI) yang berada di atas kapal tersebut kerap mendapat penyiksaan hingga tidak diizinkan untuk berkomunikasi bersama keluarga sejak 7 bulan lamanya.\n#faktanyagoogle','2020-06-09 07:10:27',1,1,1,1,'2020-06-10 10:00:30','2020-06-10 22:38:40'),
	(299,'faktanyagoogle','https://instagram.com/p/CBMv3lGBFHs',2355976,23388,'Seorang pria terlihat pulas di atas genangan banjir rob bersama motornya di kawasan Pluit, Jakarta Utara. Para warga yang berada di sekitar kejadian mengaku takut membangunkan pria tersebut karena dalam kondisi mabuk.\n.\nDalam rekaman video yang viral terlihat pria tersebut sesekali mengusap wajahnya. Ia juga tak sadar bahwa beberapa kamera merekam dirinya yang tengah tertidur pulas. Tak lama kemudian, pria tersebut bangun dan berjalan sempoyongan meninggalkan motornya.\n#faktanyagoogle','2020-06-09 03:26:02',1,1,1,1,'2020-06-10 10:00:30','2020-06-10 22:38:19'),
	(300,'kumparancom','https://instagram.com/p/CBNxbWWlB99',970459,2361,'Ada kabar baik hari ini yang layak kamu ketahui. Geser, yuk!\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #beritabaik #beritapositif #goodnews #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 12:58:54',2,1,1,1,'2020-06-11 05:54:41','2020-06-11 07:01:20'),
	(301,'kumparancom','https://instagram.com/p/CBNjsNBFegi',970459,3012,'Pemprov Jawa Timur secara resmi tidak memperpanjang PSBB di Surabaya Raya (Surabaya, Gresik, dan Sidoarjo). Hal ini disampaikan Gubernur Jatim Khofifah Indar Parawansa, Senin (8/6) malam.\n-\nPadahal, dilihat dari data kondisi epidemiologi, kondisi di Surabaya Raya saat ini masih mengkhawatirkan. Bahkan, penambahan kasus harian di Jatim hingga Senin (8/6) pun masih terus terjadi.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #surabaya #jatim #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 10:58:52',2,1,1,1,'2020-06-11 05:54:41','2020-06-11 07:01:04'),
	(302,'kumparancom','https://instagram.com/p/CBNXNKrl8PL',970459,8023,'Menhub Budi Karya Sumadi menerbitkan Peraturan Menteri Perhubungan Nomor 41 Tahun 2020. Aturan ini merupakan perubahan dari Permenhub sebelumnya tentang pengendalian transportasi dalam rangkap pencegahan penyebaran COVID-19.\n-\nTerdapat sejumlah perubahan dalam Permenhub yang diterbitkan pada 8 Juni 2020 ini. Salah satunya, menghapus ketentuan soal batas maksimal jumlah penumpang kendaraan umum maupun pribadi.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #menhub #psbb #permehub #psbbtransisi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 09:09:46',2,1,1,1,'2020-06-11 05:54:42','2020-06-11 07:00:21'),
	(303,'kumparancom','https://instagram.com/p/CBNSoh9g0UC',970459,2109,'Peristiwa pengambilan paksa terhadap jenazah pasien dalam pengawasan (PDP) COVID-19 oleh warga kembali terjadi. Setelah sebelumnya terjadi di Makassar, Sulawesi Selatan, kini peristiwa yang sama terjadi di Bekasi, Jawa Barat.⁠\n-⁠\nTerlihat sejumlah warga mendatangi RS Mekar Sari, rumah sakit yang berada di daerah Bekasi Timur. Warga sempat meluapkan emosi kepada pihak rumah sakit dan menyatakan jika jenazah itu bukanlah pasien corona. Tidak lama setelah itu, mereka mengambil paksa jenazah PDP virus corona tersebut.⁠\n-⁠\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pasienpdp #bekasitimur #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 08:34:51',2,1,1,1,'2020-06-11 05:54:42','2020-06-11 06:59:54'),
	(304,'kumparancom','https://instagram.com/p/CBNPGVxlnqe',970459,2115,'Senior Executive Vice President Bisnis dan Pelayanan Pelanggan PLN Yuddy Setyo Wicaksono mengakui jika banyak pelanggan yang tagihan listriknya membengkak pada rekening bulan ini.\n-\nKenaikan itu terjadi karena konsumsi pelanggan yang naik seiring dengan masih bekerja dan belajar di rumah. Namun menurut Yuddy, dari 34,5 juta pelanggan pascabayar, hanya 4,3 juta pelanggan saja yang mengalami kenaikan signifikan.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanBISNIS #kuatbersama #dirumahaja #updatepasien #pasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 07:58:56',1,1,1,1,'2020-06-11 05:54:42','2020-06-11 06:59:30'),
	(305,'kumparancom','https://instagram.com/p/CBM9gPFlHdK',970459,3506,'Per Senin, (8/6), ojek online mulai bisa mengangkut penumpang setelah sebelumnya hanya diperbolehkan mengantar barang demi mencegah penyebaran virus corona. Meski begitu, para pengemudi dan penyedia jasa tersebut tetap harus mengikuti sejumlah protokol kesehatan. Berikut potretnya.\n-\nKredit foto: Antara.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #pasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 05:25:11',1,1,1,1,'2020-06-11 05:54:43','2020-06-11 06:58:50'),
	(306,'kumparancom','https://instagram.com/p/CBMvRuRorIB',970459,5540,'Kabar duka datang dari industri musik Tanah Air. Musisi jazz senior Benny Likumahuwa meninggal dunia. Benny mengembuskan napas terakhir pada usia 73 tahun.\n-\nDari informasi yang diterima kumparan, Benny Likumahuwa diketahui sedang mengidap penyakit sejak lama sebelum meninggal dunia. Namun, belum diketahui sakit apa yang dideritanya.⁠\n-\nSelamat jalan, Benny Likumahuwa...\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠⠀⁠\n#kumparanHITS #beritaduka #meninggaldunia #bennylikumahuwa #artis #musisi #penyanyi #trendingtopic #info #videoviral #videooftheday #beritaharcdiini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-09 03:21:08',1,1,1,1,'2020-06-11 05:54:43','2020-06-11 06:58:24'),
	(307,'faktanyagoogle','https://instagram.com/p/CBN4eHXBkdc',2355548,9496,'Seorang ibu dan anaknya ini berkuliah dengan jurusan yang sama dan lulus bareng juga lho, guys. Yap, ibunya kuliah kodekteran pada usianya yang menginjak 43 tahun. Pasangan ibu dan anak ini sama-sama lulus dari University of Medicine and Health Sciences, Karibia.\n.\nIbunya yang bernama Cynthia memang bermimpi untuk menjadi seorang dokter, ia baru bisa mendaftarkan dirinya kuliah kedokteran pada usia 43 tahun. Lalu, 2 tahun kemudian anaknya yang bernama Jasmine mengikuti jejak sang ibu untuk berkuliah di tempat dan jurusan yang sama. Wah inspiratif banget ya~\n#faktanyagoogle','2020-06-09 14:00:26',3,1,1,1,'2020-06-11 05:54:52','2020-06-11 06:58:02'),
	(308,'faktanyagoogle','https://instagram.com/p/CBNxmyfBZH_',2355548,14637,'Tag temen kamu yang hobi main layangan! Yap, layangan yang satu ini berbeda dari biasanya dengan bentuk yang cukup unik. Layangan ini bentuknya sangat mirip dengan kuntilanak dan sempat membuat warganet heboh.\n.\nTerlihat seorang pria yang sedang bermain dengan layangan tersebut dan ukurannya juga cukup besar. Layangan yang bentuknya mirip kuntilanak ini di desain dengan rambut yang panjang dan baju putih yang menjuntai panjang juga. Banyak warganet yang usul untuk menerbangkan layangan tersebut di malam hari. Waduh seru sekaligus serem sih hahaha:\')\n#faktanyagoogle','2020-06-09 13:00:27',3,1,1,1,'2020-06-11 05:54:52','2020-06-11 06:54:57'),
	(309,'faktanyagoogle','https://instagram.com/p/CBNj3vnhqwg',2355548,12867,'Sejumlah maskapai penerbangan, Lion Air, Wings Air dan Batik Air, rencanannya akan kembali beroperasi pada 10 Juni 2020. Namun, layanan penumpang ini hanya untuk penerbangan domestik. Kembalinya pesawat beroperasi, lantaran calon penumpang pesawat dianggap sudah memahami dan memenuhi persayaratan untuk perjalanan udara selama pandemi corona.\n.\nMelansir dari kompas.com, bagi calon penumpang Lion Air Group yang akan bepergian mulai 10 Juni 2020 agar memperhatikan hal-hal berikut:\n\n1. Jika tes kesehatan yang digunakan Rapid Test, maka masa berlaku adalah 3 hari, atau jika tes kesehatan yang digunakan Reverse Transcription – Polymerase Chain Reaction (RT-PCR), maka masa berlaku ialah 7 hari, atau\n2. Apabila kedua metode tes di atas tidak tersedia di daerah asal, maka calon penumpang harus mendapatkan surat keterangan bebas gejala seperti influensa (influenza-like illness) dari dokter rumah sakit/ Puskesmas.\nUntuk itu calon penumpang Lion Air Group harus mencermati masa berlaku dari dokumen kesehatan yang digunakan.\n.\nLion Air Group mewajibkan dan meminta bagi calon penumpang agar mematuhi ketentuan penerbangan Lion Air Group, yakni:\n1. Tiba lebih awal di terminal keberangkatan yakni empat jam sebelum keberangkata. Penerbangan Lion Air Group domestik tetap di Terminal 2E dan internasional di Terminal 3 Bandar Udara Internasional Soekarno-Hatta, Tangerang. Untuk bandara udara lainnya yang beroperasi tetap di terminal yang sama.\n2. Menunjukkan kartu identitas diri yang sah (KTP atau tanda pengenal lainnya),\n3. Mengenakan masker sebelum penerbangan, saat di dalam pesawat hingga mendarat dan saat kedatangan serta keluar dari bandar udara.\n4. Mencuci tangan dengan sabun atau menggunakan cairan pembunuh kuman (hand sanitizer).\n5. Mengikuti aturan jarak aman (physical distancing) selama di terminal bandar udara\n6. Menjaga kebersihan selama berada di dalam pesawat\n7. Mengikuti petunjuk awak pesawat.\n#faktanyagoogle','2020-06-09 11:00:26',2,1,1,1,'2020-06-11 05:54:52','2020-06-11 06:54:34'),
	(310,'faktanyagoogle','https://instagram.com/p/CBNesdDDKSl',2355548,14936,'tag temen lo yang iphone user\ncredit tiktok/irvingtan\n#tiktokviral @tiktokofficialindonesia\n.\nDownload TikTok : https://go.onelink.me/BAuo/8e43d989','2020-06-09 10:15:40',2,1,1,1,'2020-06-11 05:54:52','2020-06-11 06:53:36'),
	(311,'faktanyagoogle','https://instagram.com/p/CBNbSotBLac',2355548,13260,'Hasil rapat Disdikbud Jawa Tengah dan Gubernur Jawa Tengah menyatakan bahwa Kota Tegal Dan Kabupaten Rembang diperbolehkan kembali untuk membuka sekolah. Seluruh sekolah di wilayah tersebut boleh dibuka karena dinyatakan sebagai zona hijau. Kota Tegal dan Kabupaten Rembang, Jawa Tengah ini dinyatakan sebagai zona hijau Covid19 atau nol kasus penularan virus corona.\n.\nAktivitas belajar mengajar akan diizinkan jika telah memenuhi persyaratan dan melaksankan protokol kesehatan. Gubernur Jateng, Ganjar Pranowo, mengaku tengah menyusun penerapan new normal pada sektor pendidikan. Rencananya, kegiatan sekolah di Jateng akan dibuka pada 13 Juli mendatang meski belum tentu dibuka secara fisik.\n#faktanyagoogle','2020-06-09 09:45:28',2,1,1,1,'2020-06-11 05:54:52','2020-06-11 06:53:23'),
	(312,'faktanyagoogle','https://instagram.com/p/CBNStHpBXiG',2355548,12065,'Warga Desa Kedak, Kabupaten Kediri mengklaim sehat sehingga menolah untuk rapid test Covid19. Ratusan warga Desa Kedak unjuk rasa membentangkan spanduk dengan beragam tulisan. Mereka berteriak, mengatakan bahwa semua warga sehat dan sudah menjalani isolasi mandiri selama dua pekan.\n.\nDalam unjuk rasa tersebut juga warga meminta portal menuju dusun mereka dibuka karena selama ini perjalanan terkendala. Sebagai gantinya, di pintu masuk desa akan didirikan posko Covid19. Pihak kepolisian, unjuk rasa ini karena salah paham, namun kini warga sudah bisa menahan diri dan saling mengingatkan untuk menjaga kesehatan selama pandemi Covid19.\n#faktanyagoogle','2020-06-09 08:30:26',2,1,1,1,'2020-06-11 05:54:52','2020-06-11 06:52:43'),
	(313,'faktanyagoogle','https://instagram.com/p/CBNCZo5hpva',2355548,15365,'Kerumunan masyarakat di Malioboro membuat Gubernur DIY, Sri Sultan Hamengku Buwono X angkat bicara. Ia mengancam akan membubarkan kerumunan di Malioboro dan pusat keramaian Yogya selama pandemi corona.\n.\nMelansir laman cnnIndonesia, pada malam hari terlihat masyarakat berkurumun di Malioboro tanpa masker dan tak menjaga jarak. Ia mengkhawatirkan hal ini karena risiko penularan virus corona masih tinggi. Jika tak menerapkan protokol kesehatan, ia akan membubarkan kerumunan di pekan depan.\n#faktanyagoogle','2020-06-09 06:07:58',1,1,1,1,'2020-06-11 05:54:52','2020-06-11 06:52:20'),
