	(316,'kumparancom','https://instagram.com/p/CBQS_Q6l9JL',970462,2265,'Belakangan ini, enggak sedikit masyarakat yang beraktivitas di luar, termasuk berolahraga menggunakan masker. Tapi, kira-kira aman untuk kesehatan enggak, ya? Coba perhatikan hal ini.\n-\nMenurut Grayson Wickham, seorang ahli terapi fisik dan spesialis di Movement Vault, orang yang memiliki kondisi kardiovaskular atau gangguan pernapasan yang mendasarinya harus berhati-hati saat berolahraga menggunakan masker.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanSAINS #kuatbersama #dirumahaja #masker #olahraga #psbbtransisi #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan.','2020-06-10 19:30:38',5,1,1,1,'2020-06-11 12:59:01','2020-06-11 06:51:01'),
	(317,'kumparancom','https://instagram.com/p/CBQMFZOFeAH',970462,7627,'DAW, seorang driver ojek online (ojol) yang meninggal dan dimakamkan tanpa protokol COVID-19 ternyata positif corona. Hal itu dipastikan Ketua Gugus Kuratif Penanganan COVID-19 Jatim dr. Joni Wahyuhadi.\n-\ndr Joni menjelaskan, sebelum meninggal, wanita itu mengalami patah tulang karena kecelakaan. Saat rapid test, wanita itu nonreaktif. Lalu dilakukan tes swab dengan hasil lebih sensitif. dr Joni menyebut, pihak keluarga sebenarnya mengerti bahwa pasien ini positif COVID-19. Namun keluarga pasien ngotot hasil rapid test nonreaktif.\n-\nKonten ini merupakan hasil liputar partner resmi #1001MediaOnline kumparan, @jatimnow.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #ojol #positifcorona #jatim #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-10 18:30:18',5,1,1,1,'2020-06-11 12:59:01','2020-06-11 06:50:33'),
