	(321,'kumparancom','https://instagram.com/p/CBP5GgSlMNB',970462,2879,'Pasien positif virus corona di Indonesia masih bertambah. Per Rabu (10/6) pukul 12.00 WIB, jumlah pasien positif bertambah 1.241 orang, sehingga total kini ada 34.316 terjangkit corona.\n-\nJumlah pasien positif COVID-19 yang meninggal pun bertambah 36 orang. Sehingga jumlah pasien meninggal menjadi 1.959 orang. Kabar baiknya, jumlah pasien virus corona yang sembuh bertambah 715 orang, menjadi 12.129 orang. -\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #updatepasien #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-10 15:44:26',3,1,1,1,'2020-06-11 12:59:02','2020-06-11 06:47:54'),
	(322,'kumparancom','https://instagram.com/p/CBP25t4H-Ek',970462,11055,'Seorang pendeta asal Indonesia menuai kecaman karena pidatonya dalam sebuah aksi protes atas kematian George Floyd di Amerika Serikat. Dalam aksi tersebut, dia menyinggung soal diskriminasi di Indonesia.⁠\n-⁠\nPendeta tersebut adalah Oscar Suryadi dari Portland, Oregon. Dalam pidatonya di tengah aksi di Pioneer Square, Suryadi mendapatkan sambutan positif dari warga karena orasi dan doanya soal keadilan bagi seluruh manusia. Namun, video pidatonya yang beredar di Youtube dan Twitter menuai kecaman dari publik di Tanah Air.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #amerika #as #georgefloyd #pendeta #diskriminasi #pidato #amerikaserikat #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-10 15:30:14',3,1,1,1,'2020-06-11 12:59:02','2020-06-11 06:47:34'),
	(323,'kumparancom','https://instagram.com/p/CBPz-1ElOKa',970462,5898,'Mantan dokter Belgia bernama Alfons Leempoels melakukan aksi berjalan maraton di sekitar kebunnya di Rotselaar, Belgia. Aksi ini sebagai bentuk penggalangan dana untuk penelitian tentang virus corona.\n-\nPensiunan dokter umum berumur 103 tahun itu memulai perjalanan sejauh 42,2 km di Rotselaar, timur laut Brussels, Belgia, pada 1 Juni. Ia berencana untuk menyelesaikannya pada 30 Juni mendatang. Berikut potretnya.\n-\nKredit foto: Reuters.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #dokter #belgia #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-10 14:59:42',3,1,1,1,'2020-06-11 12:59:02','2020-06-11 06:47:05'),
