	(328,'kumparancom','https://instagram.com/p/CBPbkBcllFH',970462,2369,'Pemprov Sumatera Barat akan menggratiskan tes swab atau polymerase chain reaction kepada seluruh wisatawan saat tiba di bandara. Bahkan kebijakan ini akan terus diterapkan hingga pandemi COVID-19 berakhir.\n-\nGubernur Sumatera Barat Irwan Prayitno menuturkan, pemeriksaan gratis kepada wisatawan di bandara ini merupakan ikhtiar Pemprov Sumbar dalam melindungi warganya dari risiko penularan COVID-19 dari luar daerah.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #sumbar #wisata #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-10 11:26:19',2,1,1,1,'2020-06-11 12:59:02','2020-06-11 06:02:03'),
