	(330,'faktanyagoogle','https://instagram.com/p/CBQIsMFh66Z',2355547,13788,'Presiden Jokowi memberikan arahan kepada Gugus Tugas Covid19 untuk rutin mengevaluasi penerapan new normal. Meski dalam suatu daerah kasusnya menurun, Gugus Tugas jangan sampai lengah karena keadaan di lapangan masih sangat dinamis. Keberhasilan pengendalian Covid19 ini juga sangat ditentukan oleh kedisiplinan masyarakat dalam menerapkan protokol kesehatan.\n.\nMelansir laman kumparan, Jokowi mengatakan bahwa saat penerapan new normal, ada kenaikan kasus positif corona, maka bukan mustahil pengetatan kembali diterapkan. Semua pihak diharapkan untuk tetap bersikap optimis dalam menghadapi pandemi virus corona ini.\n#faktanyagoogle','2020-06-10 18:00:39',5,1,1,1,'2020-06-11 12:59:10','2020-06-11 06:01:07'),
	(331,'faktanyagoogle','https://instagram.com/p/CBPq-LchBfu',2355547,17846,'Siapa nih yang suka banget minum milk tea? Yap, milk tea belakangan ini memang sedang menjadi tren, terutama di kalangan anak muda. Hal tak diinginkan terjadi pada remaja perempuan yang bernama Tian karena terlalu sering mengonsumsi milk tea.\n.\nTian sangat terobsesi dengan milk tea, setiap hari selama satu bulan ia minum milk tea hingga koma selama 5 hari. Remaja asal Shanghai ini memang tak pernah berolahraga dan berat badannya 125 kg. Hal ini diperparah saat ia kecanduan milk tea, lalu tanpa disadari diabetes dan berat badannya meningkat. Kini, hidup Tian bergantung pada seutas benang dan ventilator untuk bernapas.\n#faktanyagoogle','2020-06-10 13:40:58',3,1,1,1,'2020-06-11 12:59:10','2020-06-11 06:00:36'),
	(332,'faktanyagoogle','https://instagram.com/p/CBPmZOOh7JT',2355547,11332,'Salah satu keluarga di Batam membuat keributan karena tak terima pasien PDP yang merupakan keluarganya ini dikuburkan sesuai protokol Covid19. Melansir laman suara.com, keluarga tersebut berusaha merebut jenazah positif corona saat ingin dikuburkan di pemakaman. Pasien positif corona tersebut dinyatakan meninggal dunia di Rumah Sakit Badan Pengusahaan Batam pada Selasa malam pada pukul 21.00 (9/6).\n.\nDiketahui, keluarganya tak terima jika jenazah dikuburkan sesuai protokol Covid19 karena keluarganya asal Makassar. Sebelumnya, dari pemeriksaan hasilnya pasien tersebut memiliki pneumonia dan ditetapkan sebagai PDP. Karena sejak awal pasien tersebut berstatus PDP, walaupun hasil swabnya belum keluar dan dinyatakan meninggal dunia tetap dilakukan pemakaman sesuai protokol Covid19.\n#faktanyagoogle','2020-06-10 13:00:58',3,1,1,1,'2020-06-11 12:59:10','2020-06-11 06:00:12'),
