	(334,'faktanyagoogle','https://instagram.com/p/CBQXkNdBB3u',2355485,10207,'Duh, ada-ada aja ya guys.. Seorang pria asal China ini mengalami kejadian yang unik sekaligus langka. Seekor ikan yang memiliki panjang 40 cm masuk ke dalam tubuh pria ini tepatnya pada bagian dubur. Ia tak sengaja duduki ikan tersebut hingga masuk ke dalam duburnya.\n.\nPria ini pun harus menjalani operasi lantaran ikan tilapia yang nyangkut di tubuhnya ini. Dokter di rumah sakit hingga kaget setelah melihat pemindaian sinar-X pria ini.\n#faktanyagoogle','2020-06-10 20:10:38',5,1,1,1,'2020-06-11 17:00:28','2020-06-12 09:56:01'),
