	(336,'kumparancom','https://instagram.com/p/CBS0YknnqTE',972467,11973,'Ada kabar baik untuk pelanggan Telkomsel dan IndiHome~\n-\nPemblokiran Netflix oleh Telkom, yang sudah dilakukan sejak 2016, kemungkinan akan dibuka dalam waktu dekat. Dengan begitu, pelanggan jaringan Telkom Group, seperti Telkomsel dan IndiHome, akhirnya bakal bisa mengakses layanan streaming film di Netflix.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.\n-\n#kumparanNEWS #telkom #netflix #aksesnetflix #blokir #bukablokir #netflixtelkom #indihome #trending #internet #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily','2020-06-11 19:01:17',5,1,1,1,'2020-06-12 17:00:21','2020-06-12 10:05:34'),
	(337,'kumparancom','https://instagram.com/p/CBSvlt7nMis',972467,16334,'Terdakwa kasus penyiraman air keras terhadap penyidik senior KPK Novel Baswedan, Ronny Bugis dan Brigadir Rahmat Kadir dituntut hukuman 1 tahun penjara. Jaksa menilai anggota Polri tersebut terbukti melakukan penganiayaan berat terhadap Novel. ⁠\n-⁠\nJaksa meyakini Ronny dan Rahmat bersalah melanggar Pasal 353 ayat 2 KUHP Jo Pasal 55 ayat (1) ke-1 KUHP. Hal yang memberatkan, Ronny dinilai jaksa mencederai institusi Polri. Sedangkan hal yang meringankan tuntutannya adalah berlaku sopan selama persidangan dan mengabdi di institusi Polri.⁠ Adapun, hal yang memberatkan tuntutan jaksa pada Rahmat, ia dinilai telah melakukan perbuatan yang mencederai institusi Polri. Sedangkan hal yang meringankan tuntutan ialah Rahmat belum pernah dihukum dan telah mengabdi di Polri selama 10 tahun.\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #novelbaswedan #terdakwa #pelaku #ronnybugis #polri #jaksa #hukum #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-11 18:19:20',5,1,1,1,'2020-06-12 17:00:21','2020-06-12 10:04:58'),
	(338,'faktanyagoogle','https://instagram.com/p/CBStb3phxn0',2355100,25455,'Wah congrats! Beberapa public figure Indonesia berhasil masuk dalam daftar 100 artis pria paling tampan dan wanita paling cantik se-Asia. Peringkat ini baru-baru dirilis oleh situs starmometer.com. Meskipun yang masuk ke dalam daftar tersebut didominasi oleh artis Korea Selatan, tapi ada 3 public figure Indonesia yang masuk, lho.\n.\n1. Jefri Nichol; ia menduduki posisi ke-85 di daftar 100 Pria Paling Rupawan Se-Asia 2020 ini. Ternyata, ia berada di posisi yang sejajar dengan aktor drama korea Seo Kang Joon. Namun, posisi Jefri Nichol ini turun 9 peringkat dari tahun sebelumnya.\n.\n2. Mavin; ia menduduki peringkat 45 dan berhasil mengalahkan artis-artis ternama seperti model dan aktor asal China Dylan Wang serta idola K-pop dari grup EXO Park Chanyeol. Mavin merupakan jebolan ajang pencarian bakat The Next Boy/Girl Band musim pertama di sebuah televisi swasta.\n.\n3. Frederika Cull; menduduki peringkat ke-88 dan menjadi satu-satunya wanita dari Indonesia yang masuk ke daftar 100 Wanita Paling Cantik Di Dunia 2020. Ia berhasil mengalahkan penyanyi Rihanna yang berada di posisi 90 dan model Taylor Hill di posisi 94. Yap, ia juga merupakan pemenang kontes Putri Indonesia 2019 dan mewakili Indonesia di Miss Universe 2019.\n#faktanyagoogle','2020-06-11 18:00:13',5,1,1,1,'2020-06-12 17:00:28','2020-06-12 10:03:35'),
	(339,'faktanyagoogle','https://instagram.com/p/CBSY4H1hCZw',2355100,32079,'Kasus kematian Goerge Floyd membuat empat polisi didakwa atas laporan pembunuhan. Namun, satu dari empat polisi yang bernama Lane telah dibebaskan dari tahanan karena telah membayar jaminan sebesar USD 750.000 atau sekitar Rp 10,5 miliar. Menurut pengacara Lane, kasus Lane ini \'lemah\', karena saat kejadian justru Lane membantu memompa dada Floyd agar tak kehilangan nafasnya.\n.\nMelansir dari okezone.com, Lane didakwa membantu dan bersekongkol dalam pembunuhan tingkat dua dan pembunuhan tak disengaja sehubungan dengan kematian Floyd pada 25 Mei. Floyd terbunuh setelah rekan Lane, petugas kepolisian Derek Chauvin menekan lututnya ke leher pria berusia 46 tahun itu selama hampir sembilan menit selama penangkapan.\n#faktanyagoogle','2020-06-11 15:00:34',3,1,1,1,'2020-06-12 17:00:28','2020-06-12 10:01:49'),
	(340,'kumparancom','https://instagram.com/p/CBVjgALn7EW',975720,32820,'Ronny Bugis dan Rahmat Kadir Mahulette selaku dua orang terdakwa penyerang penyidik KPK Novel Baswedan dinilai terbukti melakukan penganiayaan terencana, sehingga mengakibatkan luka-luka berat. Atas hal tersebut, keduanya pun dituntut satu tahun penjara.\n-\nHmm... Kira-kira tuntutan itu setimpal enggak, ya, dengan perbuatan mereka?\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #novelbaswedan #kasus #airkeras #pengadilan #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-12 20:31:29',5,0,0,0,'2020-06-13 17:00:26','2020-06-13 10:00:26'),
	(341,'kumparancom','https://instagram.com/p/CBVH8C1AqUp',975720,13323,'Menurut laporan Washington Post, banyak perempuan China yang saat ini cenderung lebih ingin berkarier dan  menunda pernikahan serta memiliki anak. Hal tersebut pun memicu minimnya angka kelahiran, dan dianggap bisa menciptakan sebuah krisis yang menghambat pertumbuhan ekonomi selama beberapa dekade ke depan. ⁠\n-⁠\nPemerintah China sendiri sudah melakukan berbagai upaya untuk mendorong angka kelahiran. Mulai dari meringankan iuran pajak dan biaya pendidikan, memberikan waktu cuti melahirkan lebih lama, hingga mempersulit proses aborsi dan perceraian. Namun tampaknya usaha tersebut belum membuahkan hasil.\n-\nAtas dasar tersebut, seorang profesor ekonomi dari Universitas Fudan di Shanghai China, Yew-Kwang Ng. Profesor Yew-Kwang pun memberikan sebuah solusi yang kini menjadi kontroversi, yaitu agar perempuan diperbolehkan untuk memiliki lebih dari satu suami supaya bisa melahirkan beberapa anak.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanWOMAN #china #menikah #suami #angkakelahiran #bayi #profesor #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-12 16:30:26',4,0,0,0,'2020-06-13 17:00:26','2020-06-13 10:00:26'),
	(342,'kumparancom','https://instagram.com/p/CBU6JUNnLR8',975720,17030,'@kemdikbud.ri berencana mengubah lama pendidikan Sekolah Menengah Kejuruan (SMK) yang sebelumnya tiga tahun menjadi empat tahun.\n-\nDirektur Jenderal Pendidikan Vokasi Kemendikbud Wikan Sakarinto menuturkan, dengan lamanya SMK jadi empat tahun, maka siswa memiliki cukup waktu untuk mendapatkan bekal sebelum terjun ke dunia usaha dan industri. Siswa SMK juga diwajibkan mengikuti program praktik kerja di industri. Kalau tidak ikut, maka belum bisa lulus.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#MILLENNIAL #sekolah #smk #pelajar #kemendikbud #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-12 14:29:59',3,0,0,0,'2020-06-13 17:00:27','2020-06-13 10:00:27'),
	(343,'kumparancom','https://instagram.com/p/CBUpF38F8wR',975720,9722,'Ada kabar gembira buat pecinta @playstation, nih, gaes! PlayStation 5 dikabarkan akan segera dirilis. Kira-kira harganya berapa, ya?⁠\n-⁠\nTampilan konsol generasi masa depan (next-gen) ini dipamerkan dalam video presentasi game perdana PlayStation 5 yang digelar lewat platform YouTube dan Twitch pada Jumat (12/6) dini hari WIB. ⁠\n-⁠\nBentuk PS5 jauh berbeda dibanding konsol sebelumnya, PlayStation 4. Ada eksterior warna putih di bagian luar bodi, sementara di dalamnya ada kotak hitam sebagai mesinnya. Kombinasi warnanya mirip dengan DualSense, sebutan controller PlayStation 5 yang diperkenalkan pertama kali pada April lalu.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanTECH #ps #playstation #ps5 #game #gameconsole #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-12 12:00:57',2,0,0,0,'2020-06-13 17:00:27','2020-06-13 10:00:27'),
