	(348,'faktanyagoogle','https://instagram.com/p/CBVm1_whI1u',2354693,16277,'Para perempuan di beberapa desa di India menyembah virus corona sebagai dewi. Sesembahan baru ini disebut \"Corona Mai\" dan para pemuja berdoa untuk keselamatan hidupnya.\n.\nMelansir laman merdeka, para perempuan menggali sebuah lubang di tanah dan mengisinya dengan air dan mempersembahkan sembilan biji cengkeh dan sembilan laddos atau manisan khas India, kepada dewi mereka. Namun, tak semua menerima penyembahan dewi baru ini. Beberapa orang melihat hal ini sebagai takhayul dan meminta pihak berwenang untuk menghentikan pemujaan ini.\n#faktanyagoogle','2020-06-12 21:00:20',5,0,0,0,'2020-06-13 17:00:33','2020-06-13 10:00:33'),
	(349,'faktanyagoogle','https://instagram.com/p/CBVZHVQhlEn',2354693,13786,'Kesetiaan seekor anjing kepada pemiliknya memang sudah menjadi hal yang lumrah. Seekor anjing ini benar-benar menjadi sahabat manusia, ia rela menunggu berhari-hari di tempat sang pemilik melakukan bunuh diri. Anjing tersebut berada di Jembatan Yangtze, Wuhan meratapi kesedihannya karena kehilangan sang pemilik.\n.\nAnjing tersebut selama berhari-hari memandang ke arah sungai. Beberapa orang yang melihat kejadian ini mencoba untuk mengeluarkan anjing itu dari jembatan, tapi anjing tersebut tetap kembali lagi ke jembatan tersebut. Sedih banget, guys:(\n#faktanyagoogle','2020-06-12 19:00:22',5,0,0,0,'2020-06-13 17:00:33','2020-06-13 10:00:33'),
	(350,'faktanyagoogle','https://instagram.com/p/CBVSPvphdBQ',2354693,14337,'Kementrian Dalam Negeri (Kemendagri) telah memberi akses kepedudukan kepada beberapa perusahaan pinjaman online (pinjol). Kemendagri menjelaskan bahwa data nasabah dijamin aman dan tak akan disalahgunakan. .\nMenurut Ditjen Kependudukan dan Pencatatan Sipil Kemendagri, Zudan Arif mengatakan bahwa akses ini diberikan agar para lembaga yang bekerja sama dapat memverifikasi kecocokan data nasabah dengan yang ada di catatan kependudukan. Verifikasi tersebut antara lain, Nomor Induk Kependudukan (NIK) di Kartu Tanda Penduduk (KTP), alamat, pekerjaan, jumlah anggota keluarga, dan lainnya.\n.\nMelansir dari CNN Indonesia, Kemendagri memberikan akses data kependudukan ke perusahaan pinjol, seperti PT Digital Alpha Indonesia alias UangTeman, PT Pendanaan Teknologi Nusa atau pendanaan.com, dan PT Ammana Fintek Syariah. Lalu, PT Visionet Internasional (OVO), PT Astrido Pasific Finance, dan PT Commerce Finance (ShopeePayLater).\n#faktanyagoogle','2020-06-12 18:00:21',5,0,0,0,'2020-06-13 17:00:33','2020-06-13 10:00:33'),
	(351,'faktanyagoogle','https://instagram.com/p/CBVEfwsBMgk',2354693,17519,'Heartwarming.. Sebuah video memperlihatkan bayi yang memiliki gangguan penglihatan namun tetap memiliki hati yang kuat. Yap, ia tersenyum bahagia saat orang tuanya memakaikan kacamata sehingga ia bisa melihat dengan jelas.\n.\nSetiap anak memiliki kekurangan masing-masing, tapi terlihat peran orang tua di sini mempengaruhi tumbuh kembang anak. Postingan ini pun tuai perhatian warganet dan banyak yang mendukung bayi ini untuk tetap kuat dan ceria.\n#faktanyagoogle','2020-06-12 16:00:18',4,0,0,0,'2020-06-13 17:00:33','2020-06-13 10:00:33'),
	(352,'faktanyagoogle','https://instagram.com/p/CBUzVGthJTe',2354693,20563,'Pandemi corona membuat brand yang sebesar dan seterkenal Zara juga ikut merugi. Inditex, perusahaan yang menaungi Zara melaporkan bahwa pandemi corona membuat Zara rugi hingga Rp 6,4 triliun kerugian bersihnya.\n.\nAkibatnya, pemilik Zara akan menutup 1.200 tokonya yang tersebar di berbagai belahan dunia. Penutupan Zara akan diprioritaskan pada wilayah Asia dan Eropa. Dampak corona luar biasa banget ya :(\n#faktanyagoogle','2020-06-12 13:30:12',3,0,0,0,'2020-06-13 17:00:33','2020-06-13 10:00:33'),
	(353,'faktanyagoogle','https://instagram.com/p/CBUn7T8hXsC',2354693,18368,'Dua terdakwa pelaku penyiraman air keras terhadap penyidik KPK Novel Baswedan, yaitu Rahmat Kadir Mahulette dan Ronny Bugis dituntut pidana satu tahun penjara. Dua terdakwa ini melakukan penganiayaan berat dan dilakukan terlebih dahulu dengan rencana.\n.\nJaksa mengatakan hal terberat dari terdakwa yaitu perbuatan mereka mencederai kehormatan institusi Polri. Namun, hal yang meringankan yaitu terdakwa belum pernah dihukum sebelumnya, terdakwa mengakui perbuatannya dipersidangan, terdakwa kooperatif dalam persidangan, dan terdakwa telah mengabdi sebagai anggota Polri selama 10 tahun.\n.\nMenanggapi tuntutan tersebut, Novel Baswedan mengaku kecewa dan geram dengan kerusakan hukum di Indonesia. Novel juga minta Presiden Jokowi membentuk Tim Pencari Fakta Independen untuk membuka \'sandiwara hukum\' tersebut. Dalam akun Twitternya Novel mengungkapkan rasa kekecewaannya kepada Jokowi.\n.\n\"Keterlaluan memang, sehari-hari bertugas memberantas mafia hukum dengan UU Tipikor tetapi jadi korban praktek lucu begini, lebih rendah dari orang menghina. Pak @jokowi, selamat atas prestasi aparat bapak. Mengagumkan...,\" tulis Novel.\n#faktanyagoogle','2020-06-12 11:50:34',2,0,0,0,'2020-06-13 17:00:33','2020-06-13 10:00:33'),
	(354,'faktanyagoogle','https://instagram.com/p/CBUUbedhyCu',2354693,11245,'Gimana, kamu udah siap beradaptasi dengan new normal? Hehe~\nNah, sepertinya kita harus siap menyesuaikan diri dengan kebiasaan-kebiasaan baru seperti  ini. Meskipun nongkrong di tempat kopi jadi ada pembatasan, tapi kita harus tetap mengikuti protokol kesehatan, guys. Demi mencegah penularan Covid19 pastinya! Hehe~\n#faktanyagoogle','2020-06-12 09:00:11',2,0,0,0,'2020-06-13 17:00:33','2020-06-13 10:00:33'),
	(355,'humasprovjatim','https://instagram.com/p/CBW0nGCpcS5',27941,272,'Selamat Pagi #WargaJatim\n.\nSekarang ini masa transisi menuju new normal sudah diberlakukan di Kota Surabaya, Kabupaten Sidoarjo dan Kabupaten Gresik. Tepatnya mulai Selasa (9/6/2020) hingga 14 hari ke depan.\n.\nNah menurut WargaJatim, Jawa Timur wis siap new normal? Karena itu, Yuk mari kita bareng-bareng tetap tertib dalam menjalankan aktivitas sesuai dengan protokol kesehatan yang ada.\n.\nSalam Jatim Sehat !!!\n.\n#khofifah\n#emil\n#arumi\n#jawatimur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n#physicaldistancing\n#masatransisi\n@khofifah.ip \n@emildardak','2020-06-13 08:19:53',2,0,0,0,'2020-06-14 17:00:17','2020-06-14 10:00:17'),
