	(361,'kumparancom','https://instagram.com/p/CBXe0dilvNo',977820,8556,'Imigrasi Bogor bersama petugas kepolisian menggerebek sebuah vila yang berada di Desa Tugu Utara, Kecamatan Cisarua, Kabupaten Bogor, Jumat (12/6) malam. Sebanyak 21 orang WN China diamankan dalam penggerebekan tersebut.\n-\nSaat penggerebekan, para WN China itu tidak memiliki kelengkapan dokumen keimigrasian. Mereka pun kemudian langsung menjalani rapid test COVID-19, dan seluruh hasil rapid testnya dinyatakan negatif.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #wna #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-13 14:28:42',3,0,0,0,'2020-06-14 17:00:26','2020-06-14 10:00:26'),
