	(364,'faktanyagoogle','https://instagram.com/p/CBYLqCeB8nR',2354353,14333,'Wah kreatif ya! Anjing yang satu ini penurut banget untuk membantu konten sang pemilik anjing. Haha:\')\n.\nVideo ini diunggah oleh akun TikTok @/lifeofkaix dan mencuri perhatian warganet. Yap, idenya menarik banget dengan membuat anjingnya terlibat dalam parodi intro Pixar ini. Sang anjing juga menggunakan properti yang seolah-olah seperti lampu dan anjing ini langsung duduk menghadap kamera. Video parodi ini juga semakin terlihat bagus karena penambahan backsound yang cocok dengan aslinya. Wah kreatif banget ya~\n#faktanyagoogle','2020-06-13 21:00:33',5,0,0,0,'2020-06-14 17:00:33','2020-06-14 10:00:33'),
	(365,'faktanyagoogle','https://instagram.com/p/CBXzntlhBcX',2354353,15670,'Postingan ini diunggah oleh akun Instagram @ dean.schneider dan tuai perhatian warganet. Terekam dalam video ia menemukan ikan yang tergeletak mati dan ia mencoba untuk membedah isi perutnya.\n.\nTak disangka, saat ia mengeluarkan isi perut ikan tersebut di dalamnya sampah plastik semua. Banyak sekali sampah plastik yang ada di isi perut ikan tersebut. Video tersebut membuktikan masih banyak orang yang menggunakan material plastik, bahkan sampah plastik tersebut menumpuk di laut. Yuk kurangi sampah plastik lautan! #saveourearth \n#faktanyagoogle','2020-06-13 17:30:35',4,0,0,0,'2020-06-14 17:00:33','2020-06-14 10:00:33'),
	(366,'faktanyagoogle','https://instagram.com/p/CBXpUpuh7hm',2354353,15565,'Jadi, guys, mantan perwira polisi Minneapolis Derek Chauvin kabarnya masih bisa mendapatkan uang pensiun yang sebagian besar didanai oleh pajak masyarakat. Besarannya sekitar US$1 juta atau senilai Rp12,2 miliar. Hal ini berlaku bahkan jika ia diputuskan bersalah membunuh George Floyd.\n\nMelansir laman cnnIndonesia, berbeda dengan negara bagian lain yang menerapkan undang-undang tak akan memberikan uang pensiun bagi pegawai negeri yang dihukum karena melakukan kejahatan berat saat bertugas, Minnesota tak menerapkan aturan tersebut. Minnesota Public Employees Retirement Association mengonfirmasi bahwa Chauvin yang saat ini berusia 44 tahun ini tetap memenuhi syarat untuk mengajukan pensiunnya di usia 50 tahun. Namun mereka tak merinci jumlah pasti yang akan diterimanya.\n#faktanyagoogle','2020-06-13 16:00:29',4,0,0,0,'2020-06-14 17:00:33','2020-06-14 10:00:33'),
	(367,'faktanyagoogle','https://instagram.com/p/CBXLDp2hufZ',2354353,22598,'Sebuah eksperimen pakar kesehatan di Jepang memperlihatkan penyebaran virus corona yang sangat cepat di tempat makan. Eksperimen ini dilakukan dalam sebuah program televisi pada jaringan NHK Jepang bersama pakar kesehatan Jepang.\n.\nNHK melibatkan 10 orang peserta dan satu orang ditunjuk sebagai orang yang seolah terinfeksi Covid19. Peserta yang dianggap terinfeksi itu dilumuri dengan cat neon di bagian tangannya. Lalu, 10 peserta dipersilahkan untuk makan prasmanan selama 30 menit.\n.\nSetelah 30 menit berlalu, tim NHK menyalakan lampu khusus untuk melihat cat neon. Hasilnya, cat neon tersebut telah menyebar di seluruh ruangan, mulai dari piring, meja makan, sendok, garpu, penjepit makanan dan tempat minum. Wah, secepat itu guys~\n#faktanyagoogle','2020-06-13 11:36:06',2,0,0,0,'2020-06-14 17:00:33','2020-06-14 10:00:33'),
