	(369,'kumparancom','https://instagram.com/p/CBZrw3HFK55',978794,7603,'Pria Amerika Serikat yang hampir meninggal karena COVID-19, menerima tagihan biaya perawatan sebesar USD 1,1 juta atau setara Rp 15.6 miliar. Michael Flor (70) dilarikan ke rumah sakit pada 4 Maret 2020. Ia dirawat karena terinfeksi virus corona selama 62 hari, kemudian pada 5 Mei 2020 diizinkan keluar rumah sakit.\n-\nSetelah menerima tagihan rumah sakit, Flor menyatakan dirinya dilindungi oleh asuransi yang merupakan program pemerintah untuk lansia. Flor merasa dirinya  tidak harus mengeluarkan uang.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #amerikaserikat #medis #pasiencorona #masker #newnormal #rumahsakit #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-14 11:00:17',2,0,0,0,'2020-06-15 17:00:25','2020-06-15 10:00:25'),
	(370,'kumparancom','https://instagram.com/p/CBZjGPqnC3Z',978794,7067,'Penasaran kan, kenapa kucing suka merenggangkan badannya?⁠\n-⁠\nNah, karena kucing menghabiskan sebagian besar waktunya untuk tidur atau duduk diam, hal ini membuat aliran darahnya menjadi tidak lancar. Jadi, meregangkan badan dapat melancarkan peredaran darah dan mengaktifkan otot. Selain itu, meregangkan badan juga membantu kucing untuk mengeluarkan racun dan kotoran yang menumpuk karena terlalu lama berdiam diri.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanSAINS #kucing #anjing #kucinglucu #hewan #binatang #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-14 09:44:44',2,0,0,0,'2020-06-15 17:00:26','2020-06-15 10:00:26'),
