	(372,'faktanyagoogle','https://instagram.com/p/CBawcCQhXvo',2353998,14852,'Sebuah video yang merekam seekor anjing yang membantu anak disabilitas ini viral di sosial media. Anjing ini memperlihatkan aksi luar biasa yang membuat orang sekitarnya terenyuh.\n.\nTerlihat anjing tersebut memgang pegangan kursi roda dan mendorong kursi roda tersebut di tengah keramaian. Ia menggunakan kedua kakinya untuk mendorong dan kedua kakinya lagi untuk melangkah sehingga posisi tubuhnya seperti berdiri. Terharu:\')\n#faktanyagoogle','2020-06-14 21:00:27',5,0,0,0,'2020-06-15 17:00:31','2020-06-15 10:00:31'),
	(373,'faktanyagoogle','https://instagram.com/p/CBapkZBByKt',2353998,21653,'Gimana, kamu udah tau cara ini belum, guys? Untuk yang belum tahu, jadi begini cara membuat Ms.Word dan Power Point bersebelahan pada satu layar. Jadi, kamu gak perlu repot bolak-balik lagi deh buat bikin ppt. Caranya cukup simple hehe~\n\nCredit: tiktok/bgsya\n#faktanyagoogle','2020-06-14 20:00:26',5,0,0,0,'2020-06-15 17:00:31','2020-06-15 10:00:31'),
	(374,'faktanyagoogle','https://instagram.com/p/CBab1lTB9GG',2353998,16902,'Biasanya, hewan peliharaan saat dibersihkan bagian kukunya terkadang memberontak. Tapi, kucing yang satu ini anteng banget dong:\')\n.\nSang pemilik kucing sepertiny memiliki trik khusus untuk mengalihkan perhatian si kucing. Ia meletakkan sesuatu di kepalanya sehingga kucing fokus pada kepala pemilik kucing. Saat kucing lengah pun, sang pemilik dengan mudah menggunting kuku si kucing ini, guys~\n#faktanyagoogle','2020-06-14 18:00:25',5,0,0,0,'2020-06-15 17:00:31','2020-06-15 10:00:31'),
	(375,'faktanyagoogle','https://instagram.com/p/CBaAcPqBKct',2353998,14047,'Hal ini diumumkan oleh Pemerintah Provinsi DKI Jakarta, pada Sabtu (13/6/2020) lewat Humas Perumda Pasar Jaya Amanda Gita.\n\nMelansir laman suara.com, ia mengatakan pihaknya akan menerapkan sejumlah protokol kesehatan guna pencegahan penyebaran Covid-19. Nantinya, pasar hanya beroperasi sejak pukul 06.00 WIB hingga pukul 14.00 WIB. Selain itu, Amanda akan ada pengecekan suhu tubuh di setiap pasar. Jika suhu tubuh pengunjung diatas 38 derajat celcius, maka dilarang masuk ke area pasar. Selain itu, bagi pengunjung lanjut usia, balita, dan ibu hamil, sangat tidak disarankan untuk berkunjung ke area pasar. \nLebih lanjut, Amanda menyebut, baik pengunjung maupun pedagang wajib untuk jaga jarak aman minimal satu meter dan menghindari kerumunan. Selanjutnya, pengunjung dan pedagang wajib untuk mematuhi alur mobilitas sesuai ketentuan yang telah ditetapkan.\n#faktanyagoogle','2020-06-14 14:00:58',3,0,0,0,'2020-06-15 17:00:31','2020-06-15 10:00:31'),
	(376,'faktanyagoogle','https://instagram.com/p/CBZ1hJAhRMd',2353998,11061,'Melansir laman liputan6, Ketua Asosiasi Persatuan Pusat Belanja Indonesia (APPBI) DKI Jakarta Ellen Hidayat memastikan seluruh mal di bawah APBBI akan buka besok pada Senin, 15 Juni 2020. Adapun, terdapat 80 mal yang siap beroperasi lagi dengan protokol kesehatan yang ketat.\n\nProtokol ini meliputi pemakaian masker, jarak antri 1 meter, suhu tubuh di bawah 37,5 derajat, lift maksimum 6 orang, hingga pembayaran yang diusahakan cashless. Tak lupa, mal akan selalu dibersihkan dengan disinfektan setiap hari dan restoran di dalam mal kapasitasnya dibatasi hanya 50 persen. \nUntuk jumlah pekerja dan jam operasional, Ellen bilang terdapat pemangkasan mengacu pada protokol kesehatan tersebut. \"Saat ini karyawan yang bisa diserap hanya sekitar 50 persen karena mall belum beroperasi penuh. Baru start dengan 50 persen. Sedangkan jam buka saat awal dari pukul 11.00 WIB (siang) sampai dengan pukul 08.00 malam. Saat normal dulu kan pukul 10.00 WIB (siang) ke 10.00 WIB (malam),\" jelasnya.\n#faktanyagoogle','2020-06-14 12:25:31',2,0,0,0,'2020-06-15 17:00:31','2020-06-15 10:00:31'),
	(377,'faktanyagoogle','https://instagram.com/p/CBZvNO5Bh0c',2353998,10978,'Full Metal Jacket diklaim dapat tahan dari penyakit. Jaket ini dibuat oleh perusahaan pakaian berteknologi tinggi Vollebak dan terbuat dari tembaga.\n.\nJaket ini dapat membunuh kuman dan penyakit yang salah satunya bisa menyebabkan Covid19. Bahan tembaga yang digunakan ini tentu saja tak murah, jaket ini dibanderol seharga 895 poundsterling atau sekitar Rp 16 jutaan. Mantep harganya~\n#faktanyagoogle','2020-06-14 11:30:23',2,0,0,0,'2020-06-15 17:00:31','2020-06-15 10:00:31'),
	(378,'kumparancom','https://instagram.com/p/CBdAtPpH8rU',980259,7575,'Wali Kota Surabaya Tri Rismaharini dan Gubernur Jawa Timur Khofifah Indar Parawansa sempat berkonfrontasi. Pada November 2019, soal seringnya Risma dinas luar negeri. Khofifah mengatakan kebanyakan kepala daerah di Jatim pakai APBD untuk perjalanan dinas luar negeri.⁠\n-⁠\nSatu lagi terjadi di tengah pandemi. Ini saat Risma mengeluh mobil tes PCR di Surabaya dipindahkan ke kota lain. Pemprov beralasan, mobil itu memang dikirim BNPB ke Pemprov Jatim dan sudah waktunya dipindahkan ke kota lain.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #jawatimur #surabaya #gubernurjatim #walikotasurabaya #trirismaharini #khofifahindar #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-15 18:01:28',5,0,0,0,'2020-06-16 17:00:21','2020-06-16 10:00:21'),
