	(380,'kumparancom','https://instagram.com/p/CBc_YR7FRcj',980259,27674,'Mendikbud Nadiem Makarim menegaskan, perguruan tinggi belum akan dibuka seperti layaknya sekolah di zona hijau. Seluruh perguruan tinggi masih akan menerapkan kegiatan belajar dari rumah.\n-\n\"Alasannya adalah universitas punya potensi mengadopsi belajar jarak jauh lebih mudah daripada pendidikan menengah dan dasar. Semua perguruan tinggi masih online,\" jelas Nadiem.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pendidikan #sekolah #menteri #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-15 17:49:25',4,0,0,0,'2020-06-16 17:00:21','2020-06-16 10:00:21'),
	(381,'kumparancom','https://instagram.com/p/CBc7UZoFl0B',980259,6593,'Pemerintah berencana membuka kembali sekolah-sekolah di zona hijau penularan virus corona pada Juli mendatang. Namun Mendikbud Nadiem Makarim memastikan untuk sekolah-sekolah di zona merah, kuning, dan oranye tetap dilarang untuk buka kembali.\n-\nNadiem menjelaskan tiga zona itu masih berpotensi besar terhadap penularan virus corona. Nadiem lantas menyebut jumlah siswa di zona merah, kuning, oranye ada sebanyak 94 persen dan diminta untuk tetap belajar dari rumah.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pendidikan #sekolah #menteri #virus #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-15 17:13:56',4,0,0,0,'2020-06-16 17:00:21','2020-06-16 10:00:21'),
