	(385,'kumparancom','https://instagram.com/p/CBcC3XvJsKk',980259,7601,'Sudah tahu fakta ini? Meski terlihat sebagai hewan yang jinak, kecebong bisa juga bersikap buas jika sedang merasa lapar, lho! Bahkan, kecebong ternyata juga bisa menjadi hewan kanibal yang memangsa sesamanya.⁠\n-⁠\nHasil sebuah penelitian mengungkapkan, secara alamiah kecebong bukanlah hewan buas yang biasa memangsa sesama kecebong lainnya. Akan tetapi, mereka sewaktu-waktu memang bisa jadi hewan kanibal jika sumber makanan bagi mereka sangatlah langka.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanSAINS #kecebong #faktahewan #buas #hewan #binatang #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-15 09:01:00',2,0,0,0,'2020-06-16 17:00:23','2020-06-16 10:00:23'),
