	(388,'faktanyagoogle','https://instagram.com/p/CBdAvLPBuE9',2353547,24254,'Michel Flor, lansia berusia 70 tahun ini dapat sembuh dari Covi19 setelah menjalani perawatan di rumah sakit. Namun, ia kaget saat melihat jumlah tagihan rumah sakit sebanyak 181 halaman yang harus ia lunasi.\n.\nPengobatan rumah sakit yang telah dijalaninya ternyata mencapai US$1,1 juta atau sekitar Rp15,6 miliar. Ia telah menjalani perawatan sejak 4 Maret lalu, dan sudah menghabiskan waktu 62 hari di rumah sakit untuk bisa sembuh. Beruntung, Michael telah dilindungi asuransi kesehatan tapi ia tetap merasa bersalah lantaran pihak membayar pajak harus menanggung biayanya.\n#faktanyagoogle','2020-06-15 18:01:17',5,0,0,0,'2020-06-16 17:00:28','2020-06-16 10:00:28'),
	(389,'faktanyagoogle','https://instagram.com/p/CBctUZjhDfQ',2353547,20117,'Gaya hidup sehat dengan mengayuh sepeda atau gowes ini menjadi tren baru di kalangan masyarakat. Namun, kejadian tak diinginkan terjadi di lampu merah APILL saat pesepeda menorobos lampu merah.\n.\nRombongan pesepeda yang menorobos lampu merah ini mengakibatkan pengendara motor celaka. Bahkan, pengendara motor bersama dengan keluarganya hingga terjatuh ke persawahan. Diduga pengendara motor ini berusaha menghindari rombongan sepeda yang menerobos lampu merah. Meski begitu, tak semua pesepeda berlaku sembarangan, hanya saja setiap pengendara kendaraan juga harus patuhi peraturan lalu lintas ya, guys, termasuk sepeda~\n#faktanyagoogle','2020-06-15 15:11:36',3,0,0,0,'2020-06-16 17:00:28','2020-06-16 10:00:28'),
	(390,'faktanyagoogle','https://instagram.com/p/CBcoU6nBaTl',2353547,21222,'Pak Ambo, pria asal Bontang Kalimantan Timur ini akrab dengan seekor buaya muara yang berukuran 4 meter. Bahkan, ia memberi sendiri nama buaya tersebut dengan nama \'Riska\'. Ia sudah menganggap Riska sebagai anaknya sendiri karena ia merasa memiliki ikatan batin dengan buaya tersebut.\n.\nSelama 23 tahun merawat Riska, Pak Ambo mengaku tak pernah diserang oleh Riska. Maka dari itu Pak Ambo rutin memberi makan dan memandikan Riska. Ia juga mengimbau teman-teman nelayannya agar Riska tak dikasari.\n#faktanyagoogle','2020-06-15 14:27:59',3,0,0,0,'2020-06-16 17:00:28','2020-06-16 10:00:28'),
	(391,'faktanyagoogle','https://instagram.com/p/CBcLo0lhZUD',2353547,24877,'Terlihat sampah yang dibawa bocah ini melayang tinggi ke atas dan dengan cepat ia membuka penutup tempat sampah. Sungguh skill luar biasa yang dimiliki bocah ini.\n.\nSambil menenteng tas sekolahnya, ia pergi meninggalkan tempat sampah tersebut. Tak sedikit warganet yang mengatakan bahwa tingkah bocah ini tengil dan \'like a boss\'. Haha tapi emang keren sih, guys~\n#faktanyagoogle','2020-06-15 10:17:20',2,0,0,0,'2020-06-16 17:00:28','2020-06-16 10:00:28'),
	(392,'faktanyagoogle','https://instagram.com/p/CBcJsw9BO7s',2353547,16120,'Tag temen kamu yang suka main skate board! Yap, memang semua tak ada yang instan, butuh proses dan perjuangan untuk menggapai sesuatu. Seperti bocah yang berusia 3 tahun ini, pantang menyerah untuk bisa lancar bermain skate board. Bocah dengan akun Instagram @r.i1116 ini seringkali mengunggah rekaman videonya saat berlatih skate board di Instagram.\n.\nMeskipun beberapa kali terjatuh, ia tak mudah menyerah dan terus bangkit kembali. Ia berlatih di atas anak tangga dan mencoba menyeimbangkan diri agar tak terjatuh. Setelah sekian lama berlatih, ia pun bisa dengan lancar melewati rintangan skate board tersebut. Wah keren banget, guys~\n#faktanyagoogle','2020-06-15 10:00:28',2,0,0,0,'2020-06-16 17:00:28','2020-06-16 10:00:28'),
