	(394,'kumparancom','https://instagram.com/p/CBfRmA7nu31',981931,21402,'Kasus penusukan terhadap mantan Menteri Koordinator bidang Politik Hukum dan Keamanan Wiranto sudah masuk dalam sidang tuntutan. Ada tiga terdakwa yang sudah menjalani sidang tuntutan. Ketiganya dituntut dengan pidana yang berbeda.⁠\n-⁠\nTerdakwa pertama, Syahrial Alamsyah alias Abu Rara adalah orang yang menusuk Wiranto dengan menggunakan kunai. Abu Rara dituntut dengan pidana selama 16 tahun penjara. Peristiwa terjadi di Alun-Alun Menes, Pandeglang, Banten, pada Kamis, 10 Oktober 2019. Saat itu, Abu Rara juga sempat menyerang Pemimpin Pesantren Mathla\'ul Anwar, Fuad Syauqi. ⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #wiranto #menkumham #sidang #tuntutan #penusuk #terdakwa #hukuman #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-16 15:07:12',3,0,0,0,'2020-06-17 17:00:28','2020-06-17 10:00:28'),
	(395,'kumparancom','https://instagram.com/p/CBe_77VAIyU',981931,29916,'Penyidik senior KPK, Novel Baswedan, kembali berkomentar mengenai 2 penyerangnya. Novel menilai keduanya lebih baik dibebaskan saja. Ia tak yakin kedua polisi aktif berpangkat Brigadir itu pelaku sebenarnya.⁠\n-⁠\nNovel menyatakan demikian menanggapi ucapan Pakar Hukum Tata Negara, Refly Harun, dalam sebuah berita. Dalam berita itu, Refly menyatakan jika kedua orang itu bukan pelaku sebenarnya lebih baik dibebaskan.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #novelbaswedan #kasus #airkeras #pengadilan #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-16 12:33:01',2,0,0,0,'2020-06-17 17:00:28','2020-06-17 10:00:28'),
	(396,'kumparancom','https://instagram.com/p/CBevDwDFgrB',981931,17525,'Penyiraman air keras yang dialami Novel Baswedan membuat mata kiri Novel kini sudah tak bisa diperbaiki lagi dan hanya bisa melihat cahaya. Sementara pengelihatan mata kanan Novel hanya 60 persen. Namun menurut pengacara Rahmat Kadir yang merupakan salah satu penyerang Novel, kerusakan mata yang dialami Novel sesungguhnya bukan diakibatkan tindakan langsung penyiraman air keras.⁠\n-⁠\nPengacara Rahmat menyatakan, air yang disiramkan kliennya merupakan air aki yang sudah dicampur dengan air biasa. Dampak air aki yang disiram kliennya dan mengenai wajah Novel menurutnya sudah bisa diatasi dengan penanganan di RS Mitra Keluarga dan Jakarta Eye Center. Namun menurut pengacara Rahmat, sikap Novel yang terburu-buru ingin menjalani perawatan di Singapura membuat matanya menjadi rusak.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #novelbaswedan #kasus #airkeras #pengadilan #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-16 10:05:30',2,0,0,0,'2020-06-17 17:00:28','2020-06-17 10:00:28'),
