	(398,'faktanyagoogle','https://instagram.com/p/CBfzKbJBfC1',2353040,24037,'Postingan ini diunggah oleh akun Facebook Friska Mdan mendapat banyak kecaman dari warganet. Wanita asal Blitar ini tega menjual ibunya sendiri karena dianggap menyusahkan dirinya dan tak berguna.\n.\nIa hendak menjual ibunya sendiri dengan harga Rp 10 ribu. Ia mengaku iri dengan anak lain dimanjain oleh orang tuanya yang kaya. Namun, akun Friska kini sudah tak lagi bisa dicari di Facebook. Belum ada kejelasan mengenai kasus ini, pihak kepolisian tengah menyelidiki kasus ini.\n#faktanyagoogle','2020-06-16 20:00:23',5,0,0,0,'2020-06-17 17:00:36','2020-06-17 10:00:36'),
	(399,'faktanyagoogle','https://instagram.com/p/CBfXsl8h2cT',2353040,29899,'Saat ini sebuah strain atau varian virus corona yang bermutasi sedang mewabah di Amerika Serikat, Inggris dan Italia. Diketahui, mutasi baru virus corona ini hampir 10 kali lebih menular dibandingka virus yang muncul dari Wuhan, China.\n.\nMelansir dari detik.com, Strain D614G, demikian para peneliti menamainya, sejauh ini disebut sebagai versi kuat dari SARS-CoV-2. Dilihat dari bentuknya, D614G punya jumlah mahkota menonjol empat hingga lima kali lebih dibandingkan COVID-19.\n.\nPara peneliti juga berpendapat bahwa jumlah tonjolan mahkota yang lebih banyak ini yang membuat virus lebih cepat menginfeksi sel manusia. Sifat ini tak hanya membuatnya menjadi lebih menular, tetapi juga membuat virus lebih stabil dan tangguh.\n#faktanyagoogle','2020-06-16 16:00:23',4,0,0,0,'2020-06-17 17:00:36','2020-06-17 10:00:36'),
	(400,'faktanyagoogle','https://instagram.com/p/CBe6zvjhhY3',2353040,20892,'Postingan ikan arwana yang digoreng ini viral di sosial media. Yap, ikan arwan tersebut milik pria asal Sukoharjo yang bernama Bayu. Dalam postingan tersebut ia menjelaskan bahwa ikan arwana miliknya yang seharga Rp 2 juta digoreng oleh ayahnya.\n.\nAwalnya, ia membeli ikan arwana itu seharga RP 800 ribu di Jatinegara tapi kini sudah berumur 4 tahun jadi kalau di jual bisa mencapai RP 2 juta. Ia merawat sendiri ikan tersebut, tapi karena semakin besar, membawa pulang kampung ke Solo untuk dipindahkan ke akuarium yang lebih besar.\n.\nNamun, selama dipindahkan ke Solo ikan tersebut tak terawat hingga sempat dibawa ke dokter untuk menjalani operasi mata. Sampai pada akhirnya karena tak terawat, ikan tersebut digoreng oleh sang ayah. Waduh:((\n#faktanyagoogle','2020-06-16 11:47:57',2,1,1,1,'2020-06-17 17:00:36','2020-06-18 08:27:30'),
	(401,'kumparancom','https://instagram.com/p/CBiRJyvnsoB',982883,22483,'Apa arti \'Ada Tukang Bakso\' di akhir video viral Bintang Emon? Ini penjelasannya menurut pengamat intelijen Ridlwan Habib.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparantech #bintangemon #trendingtopic #info #viral #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan⁠','2020-06-17 19:01:21',5,1,0,0,'2020-06-18 17:00:21','2020-06-19 19:47:40'),
	(402,'kumparancom','https://instagram.com/p/CBhkcCOHrgD',982883,18271,'Sabar ya, Bay.. :(⁠\n-⁠\nBayu warga Sukoharjo merasa sedih dan menyesal karena ikan Arwana kesayangannya digoreng oleh sang ayah tanpa sepengetahuan dirinya. Bayu mengungkapkan ikan itu dibeli saat ikan masih kecil seharga Rp 800.000, dan kini harganya senilai Rp 2 juta.⁠\n-⁠\nMenurutnya, Ikan Arwana itu dibawa pulang ke Sukoharjo untuk dititipkan ayahnya. Lama kelamaan, ayahnya malas mengurus ikan Arwana tersebut sampai akhirnya menggoreng ikan itu. Bayu mengetahui kejadian itu dari adiknya, dengan mengirimkan dua foto kondisi ikan Arwana di wajan saat sedang digoreng.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanNEWS #arwana #ikanarwana #ikan #sukoharjo #cikarang #ikanhias #viralikanarwana #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-17 12:30:26',2,1,0,0,'2020-06-18 17:00:21','2020-06-19 20:12:49'),
