	(404,'faktanyagoogle','https://instagram.com/p/CBie0xMhJWg',2352572,20075,'Pandemi corona membuat siswa belajar dari rumah karena aktivitas sekolah ditutup sementara. Belajar dari rumah ini membutuhkan koneksi internet untuk dapat mengakses sekolah online. Salah satu pelajar di Malaysia ini hingga naik ke atas pohon untuk mendapatkan koneksi internet yang baik.\n.\nYap, pelajar yang bernama Veveonah Mosibin ini mengahabiskan waktu 24 jam di pohon untuk menyelesaikan ujian sekolahnya. Ia menjalani ujian online dengan membawa beberapa makanan, minuman, powerbank, kelambu, dan lotion untuk menghindari gigitan nyamuk. Wah semangat belajarnya patut dicontoh guys, tapi tetap utamakan keselamatan juga yah..\n#faktanyagoogle','2020-06-17 21:00:23',5,0,0,0,'2020-06-18 17:00:27','2020-06-18 10:00:27'),
	(405,'faktanyagoogle','https://instagram.com/p/CBiTYikhI-3',2352572,20979,'Transisi new normal, kini masjid diperbolehkan salat berjemaah kembali dengan protokol kesehatan. Dewan Masjid Indonesia (DMI) mengimbau jemaah untuk salat jumat dua gelombang untuk menghindari penularan Covid-19.\n.\nPenerapan 2 gelombang ini dengan menggunakan ganjil genap nomor hp jemaah. Misalnya, hari ini tanggal 17 Juni maka jemaah yang memiliki nomor hp yang ujungnya ganjil dapat gelombang pertama. Lalu, yang ujung nomor hp-nya genap masuk ke geombong kedua sekitar pukul 13.00. Hal ini sudah tertuang dalam Surat Edaran DMI pada tanggal 16 Juni kemarin.\n#faktanyagoogle','2020-06-17 19:20:25',5,0,0,0,'2020-06-18 17:00:27','2020-06-18 10:00:27'),
	(406,'faktanyagoogle','https://instagram.com/p/CBiDdMWhLv3',2352572,18458,'Zhoe, pria berusia 26 tahun asal Wuhan, China ini berat badannya naik 101 kg selama lockdown. Kini, ia harus dilarikan ke rumah sakit karena berat badannya sudah mencapai 279 kg.\n.\nSebelumnya Zhoe memang mengalami masalah berat badan dan ia berjuang untuk lepas dari obesitas. Namun, saat lockdown dan di rumah aja, berat badan Zhoe justru semakin meningkat karena ia tak beraktivitas di luar rumah.\n#faktanyagoogle','2020-06-17 17:01:15',4,0,0,0,'2020-06-18 17:00:27','2020-06-18 10:00:27'),
	(407,'faktanyagoogle','https://instagram.com/p/CBhZBFBhhua',2352572,19286,'Gadis berusia 14 tahun ini tewas karena tersetrum kabel listrik saat membuat konten video. Pelajar SMP di Cibitung, Bekasi, Jawa Barat ini meninggal di lantai 3 rumahnya. Kapolsek Cikarang Barat tengah menyelidiki lebih lanjut tewasnya gadis ini pada (15/06) sore.\n.\nKronologi tewasnya korban terjadi saat korban dan 2 temannya membuat konten video untuk sosial medianya. Tiba-tiba ponselnya terjatuh dan tersangkut kabel listrik yang melintang di depan rumahnya di lantai 3. Saat ia berusaha untuk mengambil ponselnya, ia tersetrum dan tubuh korban mengeluarkan asap.\n#faktanyagoogle','2020-06-17 10:50:24',2,0,0,0,'2020-06-18 17:00:27','2020-06-18 10:00:27'),
	(408,'faktanyagoogle','https://instagram.com/p/CBhMbcohMnQ',2352572,22223,'Kachey dan Daniel kompak berpose dengan kostum couple-nya. Bahkan tak hanya mereka, pasangan asal California, Amerika Serikat ini selalu mengajak hewan peliharaanya untuk berfoto. Uniknya, kura-kura miliknya ini juga dipakaikan kostum yang sama dengan mereka.\n.\nPostingan yang diunggah oleh keduanya ini diunggah di Instagram dan tak sedikit yang memuji foto mereka. Namun, beberapa warganet menganggap ide miliknya itu dianggap sebagai eksploitasi hewan. Kostum tersebut dapat menghambat kura-kura untuk melakukan termogeluasi juga membuat kura-kura tak dapat menyerap uva dan uvb. Namun, pasang tersebut menegaskan bahwa yang dilakukannya sama saja seperti pemilik anjing yang memakaikan kostum.\n#faktanyagoogle','2020-06-17 09:00:24',2,0,0,0,'2020-06-18 17:00:27','2020-06-18 10:00:27'),
	(409,'humasprovjatim','https://instagram.com/p/CBj20eRpIG8',28218,261,'Untuk mengetahui kesiapan tempat ibadah, khususnya Masjid di Jatim menuju new normal pasca Pembatasan Sosial Berskala Besar (PSBB), Ketua Umum Dewan Masjid Indonesia (DMI) H. M Jusuf Kalla didampingi Wakil Gubernur Jatim Emil Elestianto Dardak meninjau Masjid Nasional Al Akbar Surabaya (MAS), Rabu (17/6).\n.\nSetibanya di MAS, JK pun tak luput melewati petugas pengecekan suhu badan dan penyemprotan Hand Sanitizer. Dirinya pun kagum terhadap Green Toilet MAS yang diresmikan Gubernur Khofifah Indar Parawansa, Jumat (5/6/2020) lalu.\n.\nKeberadaan green toilet ini diharapkan dapat menyiapkan jamaah MAS menuju New Normal. Keunggulannya, Green Toilet ini sudah memenuhi protokol kesehatan di tengah pandemi covid-19.\n.\nPembangunannya diusung agar MAS memiiliki orientasi yang pro environment. Dimana, terdapat sistem pengolahan limbah air wudhu dan limbah toilet berupa IPAL untuk menyiram tanaman dan kolam ikan.\n.\nTidak hanya itu. Green Toilet MAS juga sudah disetting sedemikian rupa untuk menghadapi new normal. Seperti kran-kran air wudhu berjarak satu meter serta menghindari kerumunan dan tetap melakukan physical distancing. .\n.\n#khofifah\n#emil\n#arumi\n#jawatimur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n@khofifah.ip \n@emildardak','2020-06-18 09:49:18',2,0,0,0,'2020-06-19 17:00:16','2020-06-19 10:00:16'),
	(410,'kumparancom','https://instagram.com/p/CBlCBSNFS46',983708,17834,'Menteri Pariwisata dan Ekonomi Kreatif, Wishnutama Kusubandio, membagikan momen lucu ketika meninjau Desa Guwang, Sukawati, Gianyar, Bali, untuk melihat kondisi pariwisata di daerah itu pada masa wabah virus corona, Rabu (17/6).⁠\n-⁠\nDalam akun resmi Instagramnya, @wishnutama membagikan video ketika seorang warga menyapa menteri dan rombongannya yang datang, namun alih-alih menyapa dirinya, warga itu justru menyapa orang yang dikiranya adalah Menteri Wishnutama.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #wishnutama #wisata #menteri #newnormal #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-18 20:51:24',5,0,0,0,'2020-06-19 17:00:24','2020-06-19 10:00:24'),
	(411,'kumparancom','https://instagram.com/p/CBkrzV4l5dj',983708,10185,'Ternyata bucin juga bisa merembet hingga ke masalah keuangan pasangan atau toxic financialship, loh. Lalu apa yang dimaksud dengan financialship? Ini penjelasannya dari perencana keuangan, Aidil Akbar Madjid.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanbisnis #keuangan #pasangan #trendingtopic #info #viral #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan⁠','2020-06-18 17:32:16',4,0,0,0,'2020-06-19 17:00:24','2020-06-19 10:00:24'),
