	(413,'faktanyagoogle','https://instagram.com/p/CBk5YVMBfMs',2352104,36833,'Sebelumnya, sang anak yang bernama Punjumati Dei telah pergi ke bank untuk mencairkan dana pensiun ibunya. Namun, pihak bank tak mengizinkan karena butuh vierifikasi fisik dari sang ibu. Wanita asal India ini sudah beberapa kali pergi ke bank untuk mencairkan, tetapi tetap saja tak di perbolehkan.\n.\nKondisi Covid-19 ini membuat ia kesulitan untuk mendapatkan uang sehingga harus mencairkan dana pensiun ibunya. Ibunya menerima program bantuan dari pemerintah pusat sebesar 500 Rupee atau Rp 93 ribu setiap bulannya. Namun, ibunya yang sudah berusia 100 tahun ini sudah terbaring lemah di tempat tidur dan tak bisa mengambil uangnya ke bank. Akhirnya, sang anak nekat membawa ibunya yang terbaring di tempat tidur ini untuk ke bank. Ia terlihat menyeret-nyeret tempat tidur sang ibu dan berita ini jadi viral di sosial media.\n#faktanyagoogle','2020-06-18 19:30:55',5,0,0,0,'2020-06-19 17:00:32','2020-06-19 10:00:32'),
	(414,'faktanyagoogle','https://instagram.com/p/CBkXCfYB8r1',2352104,25612,'Sebuah rumah di Kawasan Jajar, Solo ini dihuni oleh sepasang suami istri dan 3 anaknya. Tak seperti rumah pada umumnya, rumah ini merupakan bekas gudang es dan tak layak huni. Tembok bangunannya sudah lusuh dan berjamur, begitu pula dengan atapnya yang berkarat dan berlubang.\n.\nKeluarganya mengaku dari awal tinggal di rumah tersebut selalu melihat penampakan, tapi lama-lama terbiasa. Sang ayah, Agus, terpaksa menempati bangunan angker tersebut karena belum mendapatkan pekerjaan. Sebelumnya ia indekos di kawasan Karangasem saat ia masih bekerja. Jadi, sekarang ia menempati bekas gedung es tersebut hingga keadaan ekonomi membaik.\n#faktanyagoogle','2020-06-18 14:30:50',3,0,0,0,'2020-06-19 17:00:32','2020-06-19 10:00:32'),
	(415,'faktanyagoogle','https://instagram.com/p/CBkBPUxB8La',2352104,40353,'Viral kisah seorang pria asal Malaysia yang memberikan surprise ke pasangannya dengan cara yang unik. Yap, ia membeli semua barang yang dimasukkan oleh sang pacar ke dalam keranjang atau shopping cart di market place Taobao.\n.\nPria yang bernama Andrew ini mengaku sudah berpacaran dengan kekasihnya selama 8 tahun dan jarang memberi surprise. Ia berpikir bahwa hal yang paling mudah ia lakukan untuk memberikan surprise yaitu dengan memeriksa keranjang belanja online milik kekasihnya. Akhirnya, Andrew pun membeli semua barang tersebut dan pacarnya menerima 7 buah kardus berukuran besar. Yap, barangnya sangat beragam, mulai dari pakaian hingga produk kecantikan. So sweet banget~\n#faktanyagoogle','2020-06-18 11:20:21',2,0,0,0,'2020-06-19 17:00:32','2020-06-19 10:00:32'),
	(416,'humasprovjatim','https://instagram.com/p/CBmOGLeJw7X',28246,208,'BPK RI memberikan opini wajar tanpa pengecualian (WTP) atas laporan keuangan Pemprov Jatim Tahun 2019. Opini WTP ini sudah diterima Pemprov Jatim selama sembilan tahun berturut-turut.\n.\nPenyampaian opini WTP disampaikan secara virtual oleh anggota V BPK RI Prof. Dr. Bahrullah Akbar dari Gedung BPK RI.\n.\nPredikat opini WTP diserahkan langsung Kepala BPK RI Perwakilan Jatim, Joko Agus Setyono kepada Ketua DPRD Provinsi Jawa Timur, dan Gubernur Jawa Timur @khofifah.ip saat Sidang Paripurna DPRD Jatim, di Gedung DPRD Jatim, Jl. Indrapura Surabaya, Kamis (18/6).\n.\nPenyerahan dilakukan di Gedung DPRD Provinsi Jatim dengan dihadiri Wakil Gubernur Jatim Emil Elestianto Dardak, Sekretaris Daerah Jatim Heru Tjahjono, para pimpinan OPD di lingkup Pemprov Jatim, pimpinan Kanwil BPK RI Jatim, dan para pimpinan serta anggota DPRD Provinsi Jatim.\n.\nPemberian opini WTP tersebut berdasarkan Laporan Hasil Pemeriksaan (LHP) atas Laporan Keuangan Pemerintah Daerah (LKPD) Provinsi Jatim Tahun Anggaran 2019.\n.\n#khofifah\n#emil\n#arumi\n#jawatimur\n#nawabhaktisatya\n\n#gubernur\n#gubernurjatim\n#eastjava\n#wonderfuleastjava\n#cettar\n#jatimcettar\n#humas\n#humasjatim\n#provinsijawatimur\n#millenial\n#cegahcovid19\n#ayobersamalawancovid19\n#gotongroyonglawancovid19\n#physicaldistancing\n#masatransisi\n#wtp\n@khofifah.ip \n@emildardak\n@bpkriofficial \n@dprdjatim','2020-06-19 07:51:11',1,0,0,0,'2020-06-20 17:00:16','2020-06-20 10:00:16'),
