	(419,'kumparancom','https://instagram.com/p/CBm1hw8l6Im',984330,4464,'Taman Impian Jaya Ancol akan kembali membuka pintu mulai Sabtu (20/6), di masa PSBB Transisi. Dalam upaya menekan penyebaran virus corona, pihak pengelola Ancol hanya akan menjual tiket secara daring dan meniadakan pembelian on the spot.\n-\nSelain itu, manajemen Ancol juga menetapkan bahwa pengunjung balita, lansia, serta ibu hamil tidak diizinkan masuk. Pengunjung yang dapat melakukan pembelian tiket pun terbatas, yakni hanya yang memiliki KTP DKI Jakarta.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanTRAVEL #kuatbersama #dirumahaja #ancol #bumil #dufan#viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-19 13:35:44',3,0,0,0,'2020-06-20 17:00:24','2020-06-20 10:00:24'),
	(420,'kumparancom','https://instagram.com/p/CBmzXDPBz_W',984330,9210,'Siaran live saluran televisi di Bolivia mengundang kecaman masyarakat. Dalam siaran tersebut, terekam momen sakaratul maut atau detik-detik kematian pasien COVID-19.\n-\nPihak stasiun televisi berdalih acara itu dimaksudkan untuk menggerakkan pemerintah untuk meningkatkan fasilitas kesehatan di rumah sakit. Namun, tayangan tersebut dianggap tidak pantas disiarkan. Kecaman pun berdatangan, termasuk dari pejabat di lembaga Ombudsman Bolivia, Nadia Cruz.\n-\nTemukan update terkini seputar virus corona hanya di kumparan.com/corona atau klik link di bio.⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #pasiencorona #kasuscorona #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-19 13:17:00',3,0,0,0,'2020-06-20 17:00:24','2020-06-20 10:00:24'),
	(421,'kumparancom','https://instagram.com/p/CBmubFRl5-M',984330,8685,'Maskapai penerbangan @garuda.indonesia tak memberlakukan penggunaan masker bagi pramugari, karena keluhan dari para penumpang yang tidak dapat melihat wajah mereka.\n-\nMenanggapi keluhan tersebut, Direktur Utama Garuda Indonesia, Irfan Setiaputra memutuskan untuk mengubah kewajiban penggunaan APD menjadi face Shield.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀\n-\n#kumparanTRAVEL #kuatbersama #garudaindonesia #pramugari  #penerbangan #wisata #wisataunik #newnormal #pandemi #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-19 12:34:25',2,0,0,0,'2020-06-20 17:00:24','2020-06-20 10:00:24'),
	(422,'kumparancom','https://instagram.com/p/CBmnKpHBgyX',984330,7949,'Anggota Ombudsman RI, Alvin Lie, sempat mengkritik anggota tim komunikasi Gugus Tugas Percepatan Penanganan COVID-19, dr Reisa Broto Asmoro melalui unggahan di Twitter. Menurut Alvin, Reisa tak seharusnya masih menerima tawaran iklan di media sosial pribadi.\n-\nTerkait kritikan Alvin tersebut, @reisabrotoasmoro akhirnya meluruskan melalui jawaban di kolom komentar tweet Alvin tersebut. Reisa menyebut bahwa dirinya saat ini belum berstatus ASN.\n-\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⠀⁠\n-⁠\n#kumparanNEWS #kuatbersama #dirumahaja #reisabrotoasmoro #rumahsakit #viruscorona #covid19 #trendingtopic #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-19 11:30:15',2,0,0,0,'2020-06-20 17:00:24','2020-06-20 10:00:24'),
	(423,'kumparancom','https://instagram.com/p/CBmWEGIj2Er',984330,3333,'Wow, kucing emas Asia ini mempunyai panjang setinggi orang dewasa! ⁠\n-⁠\nKucing emas Asia bernama latin Catopuma temminckii adalah hewan langka yang statusnya terancam punah karena aktivitas manusia dan perburuan liar. Mereka dapat ditemukan di wilayah tropis dan subtropis dengan ketinggian 1.100 hingga 3.738 mdpl di China, India, Semenanjung Melayu, Thailand, Vietnam, dan Indonesia.⁠\n-⁠\nSimak selengkapnya dengan klik link di bio, ﻿atau download aplikasi kumparan di App Store dan Google Play.⁠\n-⁠\n#kumparanSAINS #kucing #hewanlangka #faktahewan #faktaunik #hewan #binatang #trendingtopic #pecintahewan #info #videoviral #videooftheday #beritahariini #berita #beritaterkini #terbaru #indonesia #viral #news #like4like #instalike #repost #instadaily #instanews #instavideo #kumparan','2020-06-19 09:01:12',2,0,0,0,'2020-06-20 17:00:24','2020-06-20 10:00:25'),
	(424,'gnfi','https://instagram.com/p/CBnb2-Ipk7e',424469,4397,'Gula Jawa dan Gula Aren, Si Manis yang Ternyata Berbeda\n\nSelain itu, rasa dari kedua gula tersebut juga tergolong mirip, hanya saja yang membedakan adalah aromanya. Aroma gula aren lebih kuat dari pada aroma gula jawa. Oleh sebab itu, gula jawa lebih sering digunakan dalam bahan makanan karena tidak merusak aroma cita rasa makanan yang sebenarnya.\n\nKira-kira, itulah perbedaan dan sedikit persamaan antara Si Coklat Manis yang selalu ada di dapur. Mana yang lebih sering Kawan GNFI gunakan? Gula aren atau gula jawa?\n\n#Indonesia #goodnews #goodnewsfromindonesia #infografisGNFI #GNFI','2020-06-19 19:10:41',5,0,0,0,'2020-06-20 17:00:32','2020-06-20 10:00:32'),
	(425,'gnfi','https://instagram.com/p/CBmoPbNJ-Cj',424469,3653,'STIB, Sekolah Tinggi Ilmu Beruk di Pariaman\n\nKeberadaan hewan primata beruk (Macaca Nemestrina) biasanya dikenal sebagai hewan liar. Di banyak daerah, primata ini bahkan menjadi hama yang merusak tanaman petani.\n\nNamun lain halnya di kawasan Pariaman, Sumatera Barat. Setelah melalui masa pelatihan hewan-hewan liar ini berubah dari hewan hama menjadi binatang ‘rekan kerja’ para petani, khususnya petani kelapa.\n\nSekolah khusus yang dibangun Badan Usaha Milik Desa (Bumdes) itu memiliki kurikulum yang dibuat sebagai pedoman melatih beruk. Dibutuhkan waktu setahun lamanya untuk menghasilkan beruk terlatih pemetik kelapa terlatih\n\nSelama tiga bulan pertama, beruk akan dikenalkan makanan khusus mereka seperti gula aren, susu, nasi, dan sayur-sayuran. Tiga bulan berikutnya barulah beruk diperkenalkan dengan cara memetik buah kelapa secara bertahap.\n\n#indonesia #goodnews #GoodNewsFromIndonesia #GNFInfo #GNFI','2020-06-19 11:39:38',2,0,0,0,'2020-06-20 17:00:32','2020-06-20 10:00:32'),
	(426,'gnfi','https://instagram.com/p/CBl_Bu6pT2W',424469,5984,'From @indraiswanto1984 - Nama Surabaya, sesuai dengan etimologinya, berasal dari kata Sura ata Suro dan Baya atau Boyo, dalam bahasa Jawa. Suro adalah jenis ikan hiu, sedang boyo adalah istilah bahasa jawa untuk buaya. Menurut mitos, dua hewan ini adalah binatang paling kuat yang juga menjadi simbol kota Surabaya sampai saat ini. Pendapat lain mengatakan, bahwa nama Surabaya juga diambil dari istilah Sura Ing Baya, yang berarti \"berani menghadapi bahaya\".\n.\nSurabaya merupakan pelabuhan utama dan pusat perdagangan komersial di wilayah timur Indonesia, dan sekarang menjadi salah satu kota terbesa di Asia Tenggara. Bersama dengan Lamongan di barat laut, Gresik di barat, Bangkalan di timur laut, Sidoarjo di selatan, Mojokerto dan Jombang di barat daya menjadi kesatuan yang dinamakan Gerbang Kertosusila, seperti Jabodetabek di Jakarta dan sekitarnya.\n\n#indonesia #goodnews #goodnewsfromindonesia #GNFIrepost #GNFI','2020-06-19 05:39:30',1,0,0,0,'2020-06-20 17:00:32','2020-06-20 10:00:32'),
	(427,'gnfi','https://instagram.com/p/CBl8uhSJWhV',424469,5574,'From @n0rth_hooligan - Kota Pontianak merupakan ibukota Provinsi Kalimantan Barat dengan luas wilayah Kota Pontianak mencapai 107,82 km2 yang terdiri dari 6 kecamatan dan 29 kelurahan.\n\nWilayah Kota Pontianak banyak terdapat sungai dan parit yang keseluruhannya berjumlah 61 sungai/parit. Sebagian masyarakat masih memanfaatkan sungai/parit untuk kebutuhan sehari-hari dan sungai/parit tersebut juga sebagai penunjang sarana dan prasarana.\n\n#Indonesia #goodnews #goodnewsfromindonesia #GNFIrepost #GNFI','2020-06-19 05:19:24',1,0,0,0,'2020-06-20 17:00:32','2020-06-20 10:00:32'),
	(428,'detikcom','https://instagram.com/p/CBnvUKKnwWp',2464182,5663,'Polisi masih menyelidiki terkait penemuan sembilan bungkusan kain kafan berisi bangkai ayam dan foto perempuan di Kudus. Polisi menduga bungkusan kain kafan itu digunakan untuk ritual.⁣\n--⁣\n\"Diduga ritual semacam santet, ritual itu (santet),\" kata Kasat Reskrim Polres Kudus AKP Agustinus David kepada wartawan di Makam Setya Luhur Desa Bakalan Krapyak, Kudus, Kamis (18/6/2020) malam.⁣\n--⁣\nDavid menyebut di dalam bungkusan kain kafan itu juga ditemukan beberapa jarum, tulisan mantra, hingga ada foto perempuan yang berbeda-beda. Di salah satu kertasnya bahkan bertuliskan nama perempuan.⁣\n--⁣\nDavid pun masih menyelidiki siapa yang mengubur bungkusan itu di makam umum tersebut. Pihaknya masih mendalami kasus ini.⁣\n--⁣\nSalah satu nama yang disebut dalam kertas tersebut diketahui merupakan warga desa Karang Malang, Kecamatan Gebog, Kudus. Kepala Desa Karang Malang Mashuri menyebut warganya berininisial YF yang disebut itu merupakan warganya namun jarang di rumah.⁣\n--⁣\nBetul nama anak perempuan itu warga Karang Malang Kecamatan Gebog, cuma dia jarang bergaul dengan masyarakat. Dia bergaul sama anak anak punk. Dia jarang di rumah,\" kata Mashuri saat ditemui di Kantor Balai Desa Karang Malang, Jumat (19/6).⁣\n--⁣\nMashuri menduga adanya isu diduga santet ini merupakan perbuatan iseng saja. Sebab, perempuan berusia 19 tahun itu pergaulannya dinilai tidak baik.⁣\n--⁣\nDiberitakan sebelumnya, warga Desa Bakalan Krapyak, Kecamatan Kaliwungu, Kabupaten Kudus digegerkan dengan penemuan benda misterius di makam desa setempat. Ada sembilan benda tak bertuan yang terbungkus kafan dan terkubur di makam tersebut.⁣\n--⁣\nSimak berita selengkapnya hanya di detikcom!⁣\n--⁣\nFoto:  Dian Utoro Aji/detikcom⁣\n--⁣\n#detikcom #bendamisterius #santet','2020-06-19 22:00:41',6,0,0,0,'2020-06-20 17:00:36','2020-06-20 10:00:36'),
	(429,'detikcom','https://instagram.com/p/CBnav2RHVNz',2464182,10059,'Pengguna Twitter bernama Dipa mengunggah thread di akun Twitternya tanikelana yang menjadi viral. Dipa menuliskan tentang pilihannya untuk menjadi seorang petani.⁣\n--⁣\nDipa menuliskan dia baru lulus dari jurusan Hubungan Internasional Fisipol Universitas Gajah Mada (UGM). Setelah lulus, dia langsung memutuskan untuk kembali ke kampung halamannya dan mulai bertani.⁣\n--⁣\nSaat dihubungi Wolipop, pria asal Sukabumi ini menyebutkan alasannya membuat thread di Twitter yang viral itu. \"Sebatas curhat awalnya tetapi ternyata banyak yang respon karena ada keinginan untuk bertani, karena sadar banyak temen yang mau bertani juga,\" ungkap Dipa saat dihubungi Wolipop lewat Whatsapp, Rabu (17/6/2020).⁣\n--⁣\nMelalui Twitter, pria berusia 22 tahun ini menjelaskan awal mula dirinya tertarik berlajar seputar pertanian. Semuanya berawal ketika dia bertemu komunitas Sekti Muda, yang menjadi wadah belajar pertanian alami.⁣\n--⁣\nSelain itu, Dipa juga dibimbing oleh pria bernama Qomarun Najmi dalam dunia pertanian. Setelah banyak bertemu dengan petani, belajar menanam di kost-kostan-nya, jiwa bertaninya yang dipupuk sejak kecil karena main game bertani online atau harvestmoon makin menjadi-jadi. Dan ia pun meminta pendapat dari keluarga tentang keputusannya untuk bertani.⁣\n--⁣\nDipa mengaku didukung oleh keluarganya untuk menjadi petani. Dan juga ia memperoleh dukungan dari teman-temannya.⁣\n--⁣\nHasil dari usahanya mulai bertani tak semulus yang ia bayangkan sebelumnya. Dia mendapati ternyata banyak faktor yang sulit diperhitungkan misalnya fluktuasi harga, iklim, hama, dan penyakit.⁣\n--⁣\nDipa mengatakan alasannya untuk bertani, salah satunya adalah untuk mencari sumber mata pencaharian yang halal dan berkah. Selain itu karena ia merasa hidup ini singkat, dan amat sayang hanya lahir untuk turut merusak bumi dan seisinya.⁣\n--⁣\n\"Di situ aku merasa lewat bertani, apalagi dengan prinsip \"Agroekologi\", mungkin aku bisa hidup tanpa menimbulkan banyak mudharat,\" tulisnya.⁣\n--⁣\nSimak cerita selengkapnya hanya di detikcom!⁣\n--⁣\nFoto: dok.Istimewa⁣\n--⁣\n#detikcom #viral','2020-06-19 19:00:58',5,0,0,0,'2020-06-20 17:00:36','2020-06-20 10:00:36'),
	(430,'detikcom','https://instagram.com/p/CBnT5vQnj5a',2464182,6734,'Satuan Reserse dan Kriminal (Satreskrim) Polres Kota Mamuju, menyelidiki informasi jual beli Pulau Malamber, Sulawesi Barat (Sulbar). Pulau tidak berpenghuni di gugusan Kepulauan Bala-Balakang itu dikabarkan dijual seharga Rp 2 miliar.⁣\n--⁣\nKasat Reskrim Polresta Mamuju AKP Syamsuriansyah mengatakan telah memanggil sejumlah pihak yang diduga mengetahui masalah ini. Di antara kepada desa hingga kepala desa⁣\n--⁣\nPulau Malamber dikabarkan dijual oleh salah seorang pria warga Sumare, Kecamatan Simboro, kepada pengusaha asal Kalimatan.⁣\n--⁣\nCamat Bala-balakang, Juara, membenarkan kabar jual beli Pulau Malamber itu.⁣\n--⁣\n\"Ada, Malamber, tidak tahu ukurannya, harganya Rp 2 miliar, DPnya 200 juta sudah diambil, yang jual warga di Sumare, namanya Rajab,\" kata Juara saat dimintai konfirmasi, Jumat (19/6/2020).⁣\n--⁣\nMenurut Juara, praktik jual beli pulau ini belum berlangsung lama. Dia menduga ada dua pulau yang terjual.⁣\n--⁣\nDiakui Juara, pihaknya telah mengambil Surat Pernyataan Penguasaan Fisik Bidang Tanah (Sporadik) pulau yang terjual, termasuk Malamber Kecil yang dipersiapkan sebagai lokasi penangkaran penyu.⁣\n--⁣\nSimak berita selengkapnya hanya di detikcom!⁣\n--⁣\nFoto: dok.Istimewa⁣\n--⁣\n#detikcom #PulauMalember','2020-06-19 18:01:09',5,0,0,0,'2020-06-20 17:00:36','2020-06-20 10:00:36'),
	(431,'detikcom','https://instagram.com/p/CBm05e1nkpr',2464182,5841,'Jalur sepeda di Jalan Sudirman-Thamrin diatur operasionalnya oleh Polda Metro Jaya dan Dishub DKI. Nantinya, pesepeda yang melanggar bisa ditilang.⁣\n--⁣\nDalam beberapa hari terakhir di Jalan Sudirman-Thamrin dibuat jalur sepeda tidak permanen, yang disebut pop up bike line. Disepakati oleh Polda Metro dan Dishub DKI, jalur sepeda ini akan berlaku pagi dan sore setiap hari.⁣\n--⁣\nSepanjang Senin sampai Jumat, jalur sepeda dibuka pukul 06.00-08.00 WIB dan pukul 16.00-18.00 WIB. Sementara pada Sabtu dibuka pukul 06.00-10.00 WIB dan sore pukul 16.00-19.00 WIB. Untuk Minggu pagi ditiadakan karena sudah akan diberlakukan lagi car free day. Namun begitu, jalur sepeda tersebut akan dibuka lagi sore sampai malam mulai 16.00 sampai 19.00 WIB.⁣\n--⁣\nSelama jam operasional pop up bike line tersebut, pesepeda wajib berada di dalam jalur. Polisi mengancam akan menilang pesepeda yang menggowes ke luar jalur. Namun polisi baru akan memberlakukan tilang tersebut setelah menjalani proses sosialisasi.⁣\n--⁣\nBaca berita selengkapnya hanya di detikcom!⁣\n--⁣\nFoto: uyung/detikcom⁣\n--⁣\n#detikcom #jalursepeda','2020-06-19 13:30:14',3,0,0,0,'2020-06-20 17:00:36','2020-06-20 10:00:36'),
	(432,'detikcom','https://instagram.com/p/CBmnJzAHwEt',2464182,16574,'Kabar duka datang dari serial animasi Doraemon. Pengisi suara atau dubber karakter Shizuka, Prabawati Sukarta meninggal dunia.⁣\n--⁣\nKabar duka ini disampaikan Indonesian Voice Talent lewat akun Instagram resmi mereka seperti dilihat detikcom, Jumat (19/6/2020).⁣\n--⁣\n\"Dubber \"Shizuka\" Prabawati Sukarta Dalam Serial Dora Emon Meninggal Dunia. Innalillahi wa innailaihirojiun. Kabar duka datang dari keluarga besar Radio Republik Indoneisa (RRI). Salah satu penyiar RRI era 1980an bernama Prabawati Sukarta meninggal dunia,\" tulis keterangan yang disampaikan Indonesian Voice Talent.⁣\n--⁣\nPrabawati Sukarta menjadi pengisi suara Shizuka pertama di kartun Doraemon yang setiap hari Minggu tayang di layar kaca. Hingga kini, pengisi suara Shizuka telah melalui pergantian empat kali pengisi suara.⁣\n--⁣\nSimak berita selengkapnya hanya di detikcom!⁣\n--⁣\nFoto: dok.IG/indonesian voice talent⁣\n--⁣\n#detikcom #pengisisuarashizuka #doraemon','2020-06-19 11:30:08',2,0,0,0,'2020-06-20 17:00:37','2020-06-20 10:00:37'),
	(433,'detikcom','https://instagram.com/p/CBmgS7KHZtL',2464182,7483,'Para peneliti di seluruh dunia saat ini sedang berlomba menciptakan vaksin untuk virus Corona. Banyak di antaranya ada yang sudah memasuki tahap uji klinis.⁣\n--⁣\nProf Ngurah Mahardika seorang ahli virologi dari Universitas Udayana Bali menyebut bahwa vaksin apapun yang ditemukan nantinya akan dapat dipakai di Indonesia. Karakteristik virus Corona yang ada di Indonesia dinilainya tidak mempunyai perbedaan yang signifikan dengan virus Corona di dunia.⁣\n--⁣\n\"Virus (Corona) Indonesia itu tidak unik, jadi bibit vaksin dari manapun di dunia akan berkhasiat di Indonesia data sementara,\" kata Prof Ngurah di siaran langsung BNPB, Kamis (18/6/2020).⁣\n--⁣\nMenurutnya, ketidakunikan ini terjadi karena tidak adanya keturunan virus Corona yang berubah di Indonesia. Bahkan dari beberapa virus Corona yang diidentifikasi di Indonesia memiliki kesamaan karakteristik dengan virus yang terdapat di kota asalnya yakni Wuhan.⁣\n--⁣\n\"Ada beberapa virus yang bahkan persis dengan Wuhan (EJ-ITD853Sp, JKT-EIJK02, MND-EIJK06), ada yang berbeda tetapi tidak banyak,\" sambungnya.⁣\n--⁣\n\"Ini artinya ada multiple introduction. Jadi berkali-kali masuk ke Indonesia dan datanya masih sedikit sehingga keturunan virus yang berubah di Indonesia belum kita punya,\" tutupnya.⁣\n--⁣\nBaca berita selengkapnya hanya di detikcom!⁣\n--⁣\n#detikcom #viruscorona #vaksincorona','2020-06-19 10:30:12',2,0,0,0,'2020-06-20 17:00:37','2020-06-20 10:00:37'),
	(434,'detikcom','https://instagram.com/p/CBmPIYOHXUZ',2464182,9338,'Kucing emas yang ditemukan terkena jerat babi di Agam, Sumatera Barat (Sumbar), mati dalam perawatan. Satwa langka tersebut sempat dirawat intensif selama dua hari di Kebun Binatang Kinantan Bukittinggi.⁣\n--⁣\nMenurut Kepala BKSDA Bukittinggi, Vera Chiko, kematian kucing emas itu diduga akibat parasit caplak yang banyak ditemukan di sekujur tubuh satwa. Selain itu, luka akibat jeratan juga menyebabkannya kucing emas itu kehilangan banyak darah⁣\n--⁣\n\"Caplak atau Ektoparasit di sekujur tubuhnya kita temukan. Mulai dari telinga sampai badannya. Selain itu juga mengalami anemia berat. Banyak kehilangan darah. Itu dugaan kita dan tim medis sementara ini,\" kata Chiko.⁣\n--⁣\n\"Kita sudah tangani dengan maksimal, tapi takdir berkata lain,\" sambungnya.⁣\n--⁣\nKucing emas ditemukan dalam kondisi terjerat di perkebunan milik warga di hutan Sungai Dareh Pauah, Nagari Kamang Mudiak, Kamang Magek, Agam, Sumatera Barat, Selasa (16/6). Kucing emas berjenis kelamin jantan itu berusia sekitar 4 tahun.⁣\n--⁣\nSaat ditemukan, kaki kiri bagian depan hewan dengan nama latin Catopuma temminckii itu terlihat membusuk akibat jeratan perangkap babi. Hewan tersebut sempat dievakuasi dan mendapat perawatan sebelum akhirnya mati.⁣\n--⁣\nSimak berita selengkapnya hanya di detikcom!⁣\n--⁣\nFoto: dok.Istimewa⁣\n--⁣\n#detikcom #kucingemas','2020-06-19 08:00:13',2,0,0,0,'2020-06-20 17:00:37','2020-06-20 10:00:37'),
	(435,'kompascom','https://instagram.com/p/CBnmG9_H40C',1296399,5339,'(Link berita klik di IG Stories @Kompascom)⁣⁣⁣⁣ ⁣\n⁣\nShin Tae-yong mulai curhat soal kekecewaannya kepada PSSI selama ia menjabat sebagai pelatih timnas Indonesia, selama enam bulan sejak bulan Januari 2020.⁣\n⁣\nSelama itu pula, Shin Tae-yong rupanya memendam beberapa kecewaan terhadap kebijakan yang dikeluarkan oleh PSSI.⁣\n⁣\nTerbaru, Shin Tae-yong mulai berselisih paham dengan PSSI soal tempat pemusatan latihan yang tepat bagi timnas U-19 Indonesia.⁣\n⁣\nBagaimana pendapat Sahabat Kompas.com? ⁣\n⁣\n| #Kompascom #TerhubungDariRumah  #Faktaberita #JernihBerkomentar #BeritaTerkini #shintaeyong','2020-06-19 20:40:15',5,0,0,0,'2020-06-20 17:00:42','2020-06-20 10:00:42'),
	(436,'kompascom','https://instagram.com/p/CBm4YhLlZFs',1296399,5542,'(Link berita di Stories @kompascom)⁣\n⁣\nMenteri Keuangan Sri Mulyani Indrawati memaparkan dampak pandemi virus corona (Covid-19) berisiko mengerek defisit anggaran penerimaan dan belanja negara (APBN) menjadi kian lebar. ⁣\n⁣\nBendahara Negara itu pun mengatakan peningkatan defisit bakal menjadi beban bagi negara hingga 10 tahun ke depan.⁣\n⁣\nPemerintah memperoyeksi terjadi peningkatan defisit APBN dari Rp 852,9 triliun atau sekitar 5,07 persen dari Produk Domestik Bruto (PDB) di dalam Perpres Nomor 54 tahun 2020, menjadi Rp 1.039,2 triliun atau menjadi 6,34 persen dari PDB. ⁣\n⁣\nBagaimana pendapat Sahabat Kompas.com?⁣\n⁣\n/ #Kompascom #FaktaBerita #JernihBerkomentar #BeritaTerkini #Money','2020-06-19 14:00:41',3,0,0,0,'2020-06-20 17:00:42','2020-06-20 10:00:42'),
