	(455,'nevertooweird','https://instagram.com/p/CBnjy4DgbCl',1569157,40020,'Tag that friend.','2020-06-19 20:20:03',5,0,0,0,'2020-06-20 17:00:57','2020-06-20 10:00:57'),
	(456,'nevertooweird','https://instagram.com/p/CBmRZdJF5ri',1569157,31951,'Hmmm','2020-06-19 08:20:03',2,0,0,0,'2020-06-20 17:00:57','2020-06-20 10:00:57'),
	(457,'faktanyagoogle','https://instagram.com/p/CBnJDz0h-2q',2351435,30444,'Perempuan kelahiran Gunungkidul, Wonosari ini akan segera menyelesaikan studi doktornya di Universitas Tsubuka, Jepang. Yap, Sawitri merupakan mahasiswa S3 Prodi Biosphere Resource Sciene and Technologi dengan fokus kajian genetika hutan. Sebelumnya, ia menyelesaikan studi S1 dan S2 Kehutanan di UGM, Yogyakarta.\n.\nSawitri sejak kecil hidup sederhana, bahkan di rumahnya tak memiliki televisi. Ia merupakan anak seorang penjaga hutan Wanagama, yaitu hutan yang dikelola UGM. Masa kecilnya dihabiskan di tengah hutan dan ia juga sudah ikut menyemai benih dan membudidaya tanaman yang dilakukan bapaknya. Ia bahkan waktu itu sudah hafal jenis pohon dan nama ilmiahnya karena rajin membaca buku. Buku menjadi hiburan bagi Sawitri karena tak memiliki televisi di rumah. Justru keterbatasan itu membuat ia semakin bersemangat untuk bisa meraih pendidikan setinggi-tingginya seperti saat ini. Inspiratif banget!\n#faktanyagoogle','2020-06-19 16:26:24',4,1,0,0,'2020-06-20 17:00:59','2020-06-20 18:36:31'),
	(458,'faktanyagoogle','https://instagram.com/p/CBmWD_XhDXv',2351435,28015,'Siapa sangka, pecahan uang koin Rp 1.000 ini dijual dengan harga yang fantastis. Yap, uang yang rata-rata diproduksi tahun 1993 itu memang sudah jarang ditemukan. Namun, sebenarnya Bank Indonesia belum mencabut peredaran uang tersebut, dan uang koin itu masih berlaku sebagai alat transaksi..\n.\nUang jadul ini bertebaran di toko online dengan harga RP 100 juta bahkan ada yang mencapai Rp 600 juta. Uang logam kelapa sawit ini menjadi barang kuno dengan harga yang melambung tinggi. Gimana, kamu masih nyimpen uang ini guys?\n#faktanyagoogle','2020-06-19 09:00:47',2,1,0,0,'2020-06-20 17:00:59','2020-06-20 18:35:24');
